                'deleted_at' => NULL,
            ),
            196 => 
            array (
                'id' => 1001696,
                'author_id' => 4,
                'quote_text' => 'Measuring programming progress by lines of code is like measuring aircraft building progress by weight.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 18:31:13',
                'created_at' => '2017-07-25 18:31:09',
                'updated_at' => '2017-07-25 18:31:13',
                'deleted_at' => NULL,
            ),
            197 => 
            array (
                'id' => 1001697,
                'author_id' => 197,
                'quote_text' => 'Shifting toward management meant greater responsibility and influence, but it also meant giving up programming day-to-day in my role, which was hard because it took me out of my comfort zone.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
