                'created_at' => '2017-07-25 18:36:16',
                'updated_at' => '2017-07-25 18:36:21',
                'deleted_at' => NULL,
            ),
            198 => 
            array (
                'id' => 1001698,
                'author_id' => 143,
                'quote_text' => 'Experience is the name everyone gives to their mistakes.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 18:39:51',
                'created_at' => '2017-07-25 18:39:47',
