                'deleted_at' => NULL,
            ),
            203 => 
            array (
                'id' => 1001703,
                'author_id' => 183,
                'quote_text' => 'Never trust a computer you can’t throw out a window.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 18:42:48',
                'created_at' => '2017-07-25 18:42:44',
                'updated_at' => '2017-07-25 18:42:48',
                'deleted_at' => NULL,
            ),
            204 => 
            array (
                'id' => 1001704,
                'author_id' => 221,
                'quote_text' => 'True greatness is measured by how much freedom you give to others, not by how much you can coerce others to do what you want.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:00:47',
