                'updated_at' => '2017-07-25 19:00:47',
                'deleted_at' => NULL,
            ),
            205 => 
            array (
                'id' => 1001705,
                'author_id' => 221,
                'quote_text' => 'The three chief virtues of a programmer are: Laziness, Impatience and Hubris',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:00:49',
