                'deleted_at' => NULL,
            ),
            206 => 
            array (
                'id' => 1001706,
                'author_id' => 221,
                'quote_text' => 'In general, they do what you want, unless you want consistency.',
                'created_by' => 1,
                'approved_by' => 1,
