                'deleted_at' => NULL,
            ),
            207 => 
            array (
                'id' => 1001707,
                'author_id' => 221,
                'quote_text' => 'The computer should be doing the hard work. That\'s what it\'s paid to do, after all.',
                'created_by' => 1,
