                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:00:51',
                'created_at' => '2017-07-25 18:49:56',
                'updated_at' => '2017-07-25 19:00:51',
                'deleted_at' => NULL,
            ),
            208 => 
            array (
                'id' => 1001708,
                'author_id' => 221,
                'quote_text' => 'We all agree on the necessity of compromise. We just can\'t agree on when it\'s necessary to compromise.',
