            ),
            217 => 
            array (
                'id' => 1001717,
                'author_id' => 223,
                'quote_text' => 'Motivation is undoubtedly the single greatest influence on how well people perform. Most productivity studies have found that motivation has a stronger influence on productivity than any other factor.',
                'created_by' => 1,
