                'deleted_at' => NULL,
            ),
            218 => 
            array (
                'id' => 1001718,
                'author_id' => 223,
                'quote_text' => 'It\'s hard enough to find an error in your code when you\'re looking for it; it\'s even harder when you\'ve assumed your code is error-free.',
