                'deleted_at' => NULL,
            ),
            221 => 
            array (
                'id' => 1001721,
                'author_id' => 30,
                'quote_text' => 'I have never let my schooling interfere with my education.',
                'created_by' => 1,
                'approved_by' => 1,
