                'updated_at' => '2017-07-25 19:14:15',
                'deleted_at' => NULL,
            ),
            222 => 
            array (
                'id' => 1001722,
                'author_id' => 30,
                'quote_text' => 'Keep away from people who try to belittle your ambitions. Small people always do that, but the really great make you feel that you, too, can become great.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
