                'created_at' => '2017-07-25 19:23:06',
                'updated_at' => '2017-07-25 19:23:10',
                'deleted_at' => NULL,
            ),
            223 => 
            array (
                'id' => 1001723,
                'author_id' => 30,
                'quote_text' => 'The man who does not read has no advantage over the man who cannot read.',
                'created_by' => 1,
