                'id' => 1001728,
                'author_id' => 30,
                'quote_text' => 'To succeed in life, you need two things: ignorance and confidence.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:23:18',
                'created_at' => '2017-07-25 19:20:12',
                'updated_at' => '2017-07-25 19:23:18',
                'deleted_at' => NULL,
            ),
            229 => 
            array (
                'id' => 1001729,
                'author_id' => 30,
                'quote_text' => 'If you tell truth you don’t have to remember anything.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:23:19',
                'created_at' => '2017-07-25 19:19:03',
                'updated_at' => '2017-07-25 19:23:19',
                'deleted_at' => NULL,
            ),
            230 => 
            array (
                'id' => 1001730,
                'author_id' => 30,
                'quote_text' => 'A full belly is little worth where the mind is starved.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:23:20',
                'created_at' => '2017-07-25 19:18:16',
                'updated_at' => '2017-07-25 19:23:20',
                'deleted_at' => NULL,
            ),
            231 => 
            array (
                'id' => 1001731,
                'author_id' => 30,
                'quote_text' => 'The lack of money is the root of all evil.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:23:21',
                'created_at' => '2017-07-25 19:18:03',
                'updated_at' => '2017-07-25 19:23:21',
                'deleted_at' => NULL,
            ),
            232 => 
            array (
                'id' => 1001732,
                'author_id' => 30,
                'quote_text' => 'Nothing so needs reforming as other people’s habits.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:23:22',
                'created_at' => '2017-07-25 19:17:52',
                'updated_at' => '2017-07-25 19:23:22',
                'deleted_at' => NULL,
            ),
            233 => 
            array (
                'id' => 1001733,
                'author_id' => 30,
                'quote_text' => 'Character is the architect of achievements.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:23:24',
                'created_at' => '2017-07-25 19:17:36',
                'updated_at' => '2017-07-25 19:23:24',
                'deleted_at' => NULL,
            ),
            234 => 
            array (
                'id' => 1001734,
                'author_id' => 30,
                'quote_text' => 'They did not know it was impossible, so they did it!',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:23:25',
                'created_at' => '2017-07-25 19:14:43',
                'updated_at' => '2017-07-25 19:23:25',
                'deleted_at' => NULL,
            ),
            235 => 
            array (
                'id' => 1001735,
                'author_id' => 30,
                'quote_text' => 'Get your facts first, then you can distort them as you please.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:23:26',
                'created_at' => '2017-07-25 19:14:22',
                'updated_at' => '2017-07-25 19:23:26',
                'deleted_at' => NULL,
            ),
            236 => 
            array (
                'id' => 1001736,
                'author_id' => 30,
                'quote_text' => 'Twenty years from now you will be more disappointed by the things that you didn’t do than by the ones you did.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:26:06',
                'created_at' => '2017-07-25 19:26:00',
                'updated_at' => '2017-07-25 19:26:06',
                'deleted_at' => NULL,
            ),
            237 => 
            array (
                'id' => 1001737,
                'author_id' => 30,
                'quote_text' => 'Why not go out on a limb? That’s where the fruit is.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:26:07',
                'created_at' => '2017-07-25 19:25:08',
                'updated_at' => '2017-07-25 19:26:07',
                'deleted_at' => NULL,
            ),
            238 => 
            array (
                'id' => 1001738,
                'author_id' => 224,
                'quote_text' => 'Ideas are cheap, execution is everything.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:32:33',
                'created_at' => '2017-07-25 19:32:29',
                'updated_at' => '2017-07-25 19:32:33',
                'deleted_at' => NULL,
            ),
            239 => 
            array (
                'id' => 1001739,
                'author_id' => 224,
                'quote_text' => 'Simplicity is hard to build, easy to use, and hard to charge for. Complexity is easy to build, hard to use, and easy to charge for.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:32:35',
                'created_at' => '2017-07-25 19:30:31',
                'updated_at' => '2017-07-25 19:32:35',
                'deleted_at' => NULL,
            ),
            240 => 
            array (
                'id' => 1001740,
                'author_id' => 225,
                'quote_text' => 'We are setting out to define a new market. And that means we can’t limit ourselves to tweaking the product; we need to tweak the market too.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:36:27',
                'created_at' => '2017-07-25 19:36:23',
                'updated_at' => '2017-07-25 19:36:27',
                'deleted_at' => NULL,
            ),
            241 => 
            array (
                'id' => 1001741,
                'author_id' => 225,
                'quote_text' => 'Ensuring that the pieces all come together is not someone else’s job. It is your job, no matter what your title is and no matter what role you play. The pursuit of that purpose should permeate everything we do.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:36:28',
                'created_at' => '2017-07-25 19:35:53',
                'updated_at' => '2017-07-25 19:36:28',
                'deleted_at' => NULL,
            ),
            242 => 
            array (
                'id' => 1001742,
                'author_id' => 225,
                'quote_text' => 'I think there’s a deep impulse in most humans to do creative stuff, whether that’s music or art, photography or writing. Most people at some point in their life say they want to do something creative… Enabling and empowering that is a very powerful force in human nature and I think it’s always been there.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:36:29',
                'created_at' => '2017-07-25 19:34:44',
                'updated_at' => '2017-07-25 19:36:29',
                'deleted_at' => NULL,
            ),
            243 => 
            array (
                'id' => 1001743,
                'author_id' => 225,
                'quote_text' => 'Be opportunistic. Be open, really listen and assess what kind of response the product gets and evolve in a way that makes sense.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:36:31',
                'created_at' => '2017-07-25 19:34:28',
                'updated_at' => '2017-07-25 19:36:31',
                'deleted_at' => NULL,
            ),
            244 => 
            array (
                'id' => 1001744,
                'author_id' => 226,
                'quote_text' => 'When you hire someone, ask how they are going to push the company forward. Because companies don’t do things, people do things.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:38:49',
                'created_at' => '2017-07-25 19:38:45',
                'updated_at' => '2017-07-25 19:38:49',
                'deleted_at' => NULL,
            ),
            245 => 
            array (
                'id' => 1001745,
                'author_id' => 226,
                'quote_text' => 'Here’s another thing that’s interesting about not making a lot of money on something. It makes you a more clever person. When you don’t have money to throw at a problem, you have to come up with an intelligent solution to solve the same problem.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:40:55',
                'created_at' => '2017-07-25 19:40:51',
                'updated_at' => '2017-07-25 19:40:55',
                'deleted_at' => NULL,
            ),
            246 => 
            array (
                'id' => 1001746,
                'author_id' => 226,
                'quote_text' => 'I think a vision statement should be one sentence and probably not more than about 10 words. That’s when you get a really compelling vision. It has to be simple enough, broad enough to be big, so big enough that it’s hard to do but narrow enough that you know what it means and how you can apply it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:40:56',
                'created_at' => '2017-07-25 19:40:09',
                'updated_at' => '2017-07-25 19:40:56',
                'deleted_at' => NULL,
            ),
            247 => 
            array (
                'id' => 1001747,
                'author_id' => 226,
                'quote_text' => 'Learn web programming. You can start with simple web pages written in HTML and then as you learn, start adding dynamic functionality with JavaScript. With this foundation you can branch out into web frameworks or graphic design or usability and have a really solid foundation for an entire lifetime of learning and making a living for yourself. At the same time, these skills lend themselves very well towards being an entrepreneur and helping to define what the future looks like. That’s pretty powerful.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:40:57',
                'created_at' => '2017-07-25 19:39:43',
                'updated_at' => '2017-07-25 19:40:57',
                'deleted_at' => NULL,
            ),
            248 => 
            array (
                'id' => 1001748,
                'author_id' => 226,
                'quote_text' => 'Do it. You’ll learn more in a year as a founder than you will in a lifetime of working for a big corporation. Joining a young startup is similar, but not quite as wild a ride as being a founder. In either case you’re at the leading edge of the company defining what it will become. You have your fingers in a hundred different pies and get to work on the most interesting thing of all: something you’ve created.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:40:58',
                'created_at' => '2017-07-25 19:39:22',
                'updated_at' => '2017-07-25 19:40:58',
                'deleted_at' => NULL,
            ),
            249 => 
            array (
                'id' => 1001749,
                'author_id' => 227,
                'quote_text' => 'Constant motion is the key to execution.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:45:56',
                'created_at' => '2017-07-25 19:45:23',
                'updated_at' => '2017-07-25 19:45:56',
                'deleted_at' => NULL,
            ),
            250 => 
            array (
                'id' => 1001750,
                'author_id' => 227,
                'quote_text' => 'Nothing extraordinary is achieved through ordinary means.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:45:57',
                'created_at' => '2017-07-25 19:45:15',
                'updated_at' => '2017-07-25 19:45:57',
                'deleted_at' => NULL,
            ),
            251 => 
            array (
                'id' => 1001751,
                'author_id' => 227,
                'quote_text' => 'Everything in life should be approached as a project. Every project can be broken down into just three things: Action Steps, Backburner Items, and References.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:45:59',
                'created_at' => '2017-07-25 19:44:58',
                'updated_at' => '2017-07-25 19:45:59',
                'deleted_at' => NULL,
            ),
            252 => 
            array (
                'id' => 1001752,
                'author_id' => 227,
                'quote_text' => 'Among idealists and visionaries, there is no shortage of good intent, but there’s often a shortage of discipline.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:46:00',
                'created_at' => '2017-07-25 19:44:04',
                'updated_at' => '2017-07-25 19:46:00',
                'deleted_at' => NULL,
            ),
            253 => 
            array (
                'id' => 1001753,
                'author_id' => 228,
                'quote_text' => 'Naming is a really difficult thing. I think names are important only in that they stand out for what you want your brand to stand for. I don’t think that coming up with an extravagant name just to have an extravagant name is necessary. But if you can infuse that name with real meaning around what you stand for as a company or brand, then it becomes important.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:50:13',
                'created_at' => '2017-07-25 19:50:01',
                'updated_at' => '2017-07-25 19:50:13',
                'deleted_at' => NULL,
            ),
            254 => 
            array (
                'id' => 1001754,
                'author_id' => 228,
                'quote_text' => 'I think what’s incredibly important with first employees is that they’ve bought into the vision of the founders… I fundamentally believe that culture in a company is set by your first 10 to 15 hires.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:50:14',
                'created_at' => '2017-07-25 19:49:43',
                'updated_at' => '2017-07-25 19:50:14',
                'deleted_at' => NULL,
            ),
            255 => 
            array (
                'id' => 1001755,
                'author_id' => 228,
                'quote_text' => 'Starting a business is an emotional roller coaster. There are incredibly high highs and incredibly low lows when they happen. And I think starting a business is really about enjoying that roller coaster.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:50:16',
                'created_at' => '2017-07-25 19:49:20',
                'updated_at' => '2017-07-25 19:50:16',
                'deleted_at' => NULL,
            ),
            256 => 
            array (
                'id' => 1001756,
                'author_id' => 228,
                'quote_text' => 'Know what business you’re in and that will dictate your strategy. For some tech companies, it makes sense to launch products fast and then iterate multiple times. For a consumer brand, that’s not a great strategy. You have to make the product really great at launch because you only have one shot.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:50:17',
                'created_at' => '2017-07-25 19:48:46',
                'updated_at' => '2017-07-25 19:50:17',
                'deleted_at' => NULL,
            ),
            257 => 
            array (
                'id' => 1001757,
                'author_id' => 228,
                'quote_text' => 'Never compromise on the product. Make sure that it’s amazing and that you care about every single detail.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:50:18',
                'created_at' => '2017-07-25 19:48:27',
                'updated_at' => '2017-07-25 19:50:18',
                'deleted_at' => NULL,
            ),
            258 => 
            array (
                'id' => 1001758,
                'author_id' => 228,
                'quote_text' => 'Deliver [to] people exceptionally high quality products, do it at a great price, and make them like the purchase experience.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:50:19',
                'created_at' => '2017-07-25 19:47:56',
                'updated_at' => '2017-07-25 19:50:19',
                'deleted_at' => NULL,
            ),
            259 => 
            array (
                'id' => 1001759,
                'author_id' => 229,
                'quote_text' => 'It’s no surprise companies that quickly grow in value attract those who may want to also profit from the hard work of others.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:56:27',
                'created_at' => '2017-07-25 19:54:13',
                'updated_at' => '2017-07-25 19:56:27',
                'deleted_at' => NULL,
            ),
            260 => 
            array (
                'id' => 1001760,
                'author_id' => 229,
                'quote_text' => 'There are very few people in the world who get to build a business… I think trading that for some short-term gain isn’t very interesting.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:56:29',
                'created_at' => '2017-07-25 19:53:59',
                'updated_at' => '2017-07-25 19:56:29',
                'deleted_at' => NULL,
            ),
            261 => 
            array (
                'id' => 1001761,
                'author_id' => 44,
                'quote_text' => 'Inside every problem lies an opportunity.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:58:29',
                'created_at' => '2017-07-25 19:58:24',
                'updated_at' => '2017-07-25 19:58:29',
                'deleted_at' => NULL,
            ),
            262 => 
            array (
                'id' => 1001762,
                'author_id' => 44,
                'quote_text' => 'If you avoid failure, you also avoid success.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:58:30',
                'created_at' => '2017-07-25 19:57:56',
                'updated_at' => '2017-07-25 19:58:30',
                'deleted_at' => NULL,
            ),
            263 => 
            array (
                'id' => 1001763,
                'author_id' => 44,
                'quote_text' => 'The richest people in the world look for and build networks; everyone else looks for work.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:58:32',
                'created_at' => '2017-07-25 19:57:40',
                'updated_at' => '2017-07-25 19:58:32',
                'deleted_at' => NULL,
            ),
            264 => 
            array (
                'id' => 1001764,
                'author_id' => 44,
                'quote_text' => 'Often, in the real world, it’s not the smart who get ahead but the bold.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:58:33',
                'created_at' => '2017-07-25 19:57:27',
                'updated_at' => '2017-07-25 19:58:33',
                'deleted_at' => NULL,
            ),
            265 => 
            array (
                'id' => 1001765,
                'author_id' => 44,
                'quote_text' => 'Most businesses think that product is the most important thing, but without great leadership, mission and a team that deliver results at a high level, even the best product won’t make a company successful.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:59:06',
                'created_at' => '2017-07-25 19:59:02',
                'updated_at' => '2017-07-25 19:59:06',
                'deleted_at' => NULL,
            ),
            266 => 
            array (
                'id' => 1001766,
                'author_id' => 38,
                'quote_text' => 'Don’t wait. The time will never be just right.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 19:59:48',
                'created_at' => '2017-07-25 19:59:45',
                'updated_at' => '2017-07-25 19:59:48',
                'deleted_at' => NULL,
            ),
            267 => 
            array (
                'id' => 1001767,
                'author_id' => 38,
                'quote_text' => 'If you cannot do great things, do small things in a great way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:01:28',
                'created_at' => '2017-07-25 20:01:02',
                'updated_at' => '2017-07-25 20:01:28',
                'deleted_at' => NULL,
            ),
            268 => 
            array (
                'id' => 1001768,
                'author_id' => 38,
                'quote_text' => 'The starting point of all achievement is desire.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:01:29',
                'created_at' => '2017-07-25 20:00:43',
                'updated_at' => '2017-07-25 20:01:29',
                'deleted_at' => NULL,
            ),
            269 => 
            array (
                'id' => 1001769,
                'author_id' => 38,
                'quote_text' => 'A goal is a dream with a deadline.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:01:30',
                'created_at' => '2017-07-25 20:00:29',
                'updated_at' => '2017-07-25 20:01:30',
                'deleted_at' => NULL,
            ),
            270 => 
            array (
                'id' => 1001770,
                'author_id' => 38,
                'quote_text' => 'There is one quality which one must possess to win, and that is definiteness of purpose, the knowledge of what one wants, and a burning desire to possess it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:01:31',
                'created_at' => '2017-07-25 20:00:06',
                'updated_at' => '2017-07-25 20:01:31',
                'deleted_at' => NULL,
            ),
            271 => 
            array (
                'id' => 1001771,
                'author_id' => 230,
                'quote_text' => 'We just felt like if every day we were getting a little bit closer to something that we would be really proud of, we would never regret the time we’d invested.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:03:51',
                'created_at' => '2017-07-25 20:03:47',
                'updated_at' => '2017-07-25 20:03:51',
                'deleted_at' => NULL,
            ),
            272 => 
            array (
                'id' => 1001772,
                'author_id' => 230,
                'quote_text' => 'I think anyone who makes products has this simultaneous joy and, almost, shame looking at it. You look at it all day and all you can see is all these things you want to make better.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:03:52',
                'created_at' => '2017-07-25 20:03:14',
                'updated_at' => '2017-07-25 20:03:52',
                'deleted_at' => NULL,
            ),
            273 => 
            array (
                'id' => 1001773,
                'author_id' => 230,
                'quote_text' => 'If Google teaches you anything, it’s that small ideas can be big.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:03:53',
                'created_at' => '2017-07-25 20:03:00',
                'updated_at' => '2017-07-25 20:03:53',
                'deleted_at' => NULL,
            ),
            274 => 
            array (
                'id' => 1001774,
                'author_id' => 230,
                'quote_text' => 'Really great people, they actually want to work on hard problems… a lot of the most talented and driven people, they’re not super deterred by failure.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:03:54',
                'created_at' => '2017-07-25 20:02:37',
                'updated_at' => '2017-07-25 20:03:54',
                'deleted_at' => NULL,
            ),
            275 => 
            array (
                'id' => 1001775,
                'author_id' => 231,
                'quote_text' => 'Paying your employees well is not only the right thing to do but it makes for good business.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:06:12',
                'created_at' => '2017-07-25 20:05:50',
                'updated_at' => '2017-07-25 20:06:12',
                'deleted_at' => NULL,
            ),
            276 => 
            array (
                'id' => 1001776,
                'author_id' => 231,
                'quote_text' => 'When employees are happy, they are your very best ambassadors.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:06:17',
                'created_at' => '2017-07-25 20:05:38',
                'updated_at' => '2017-07-25 20:06:17',
                'deleted_at' => NULL,
            ),
            277 => 
            array (
                'id' => 1001777,
                'author_id' => 231,
                'quote_text' => 'I think the biggest single thing that causes difficulty in the business world is the short-term view. We become obsessed with it. But it forces bad decisions.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:06:19',
                'created_at' => '2017-07-25 20:05:28',
                'updated_at' => '2017-07-25 20:06:19',
                'deleted_at' => NULL,
            ),
            278 => 
            array (
                'id' => 1001778,
                'author_id' => 231,
                'quote_text' => 'The one constant is value. Value is appreciated no matter where you go.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:06:21',
                'created_at' => '2017-07-25 20:05:08',
                'updated_at' => '2017-07-25 20:06:21',
                'deleted_at' => NULL,
            ),
            279 => 
            array (
                'id' => 1001779,
                'author_id' => 13,
                'quote_text' => 'He that cannot reason is a fool. He that will not is a bigot. He that dare not is a slave.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:10:50',
                'created_at' => '2017-07-25 20:10:46',
                'updated_at' => '2017-07-25 20:10:50',
                'deleted_at' => NULL,
            ),
            280 => 
            array (
                'id' => 1001780,
                'author_id' => 13,
                'quote_text' => 'You cannot push anyone up a ladder unless he be willing to climb a little himself.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:10:51',
                'created_at' => '2017-07-25 20:10:29',
                'updated_at' => '2017-07-25 20:10:51',
                'deleted_at' => NULL,
            ),
            281 => 
            array (
                'id' => 1001781,
                'author_id' => 13,
                'quote_text' => 'The secret to success lies not in doing your own work, but in recognizing the right man to do it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:10:52',
                'created_at' => '2017-07-25 20:10:10',
                'updated_at' => '2017-07-25 20:10:52',
                'deleted_at' => NULL,
            ),
            282 => 
            array (
                'id' => 1001782,
                'author_id' => 13,
                'quote_text' => 'The average person puts only 25% of his energy and ability into his work. The world takes off its hat to those who put in more than 50% of their capacity, and stands on its head for those few and far between souls who devote 100%.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:10:53',
                'created_at' => '2017-07-25 20:09:59',
                'updated_at' => '2017-07-25 20:10:53',
                'deleted_at' => NULL,
            ),
            283 => 
            array (
                'id' => 1001783,
                'author_id' => 13,
                'quote_text' => 'Concentrate your energies, your thoughts, and your capital. The wise man puts all his eggs in one basket and watches the basket.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:10:54',
                'created_at' => '2017-07-25 20:09:38',
                'updated_at' => '2017-07-25 20:10:54',
                'deleted_at' => NULL,
            ),
            284 => 
            array (
                'id' => 1001784,
                'author_id' => 13,
                'quote_text' => 'People who are unable to motivate themselves must be content with mediocrity, no matter how impressive their other talents.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:10:55',
                'created_at' => '2017-07-25 20:09:12',
                'updated_at' => '2017-07-25 20:10:55',
                'deleted_at' => NULL,
            ),
            285 => 
            array (
                'id' => 1001785,
                'author_id' => 13,
                'quote_text' => 'No man will make a great leader who wants to do it all himself or get all the credit for doing it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:10:57',
                'created_at' => '2017-07-25 20:08:55',
                'updated_at' => '2017-07-25 20:10:57',
                'deleted_at' => NULL,
            ),
            286 => 
            array (
                'id' => 1001786,
                'author_id' => 13,
                'quote_text' => 'Do your duty and a little more and your future will take care of itself.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:10:58',
                'created_at' => '2017-07-25 20:08:44',
                'updated_at' => '2017-07-25 20:10:58',
                'deleted_at' => NULL,
            ),
            287 => 
            array (
                'id' => 1001787,
                'author_id' => 13,
                'quote_text' => 'I pay less attention to what men say. I just watch what they do.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:11:00',
                'created_at' => '2017-07-25 20:08:30',
                'updated_at' => '2017-07-25 20:11:00',
                'deleted_at' => NULL,
            ),
            288 => 
            array (
                'id' => 1001788,
                'author_id' => 232,
                'quote_text' => 'Execution really shapes whether your company takes off or not.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:12:32',
                'created_at' => '2017-07-25 20:12:29',
                'updated_at' => '2017-07-25 20:12:32',
                'deleted_at' => NULL,
            ),
            289 => 
            array (
                'id' => 1001789,
                'author_id' => 232,
                'quote_text' => 'I think there’s a huge advantage to those who are early adopters on any platform.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:14:14',
                'created_at' => '2017-07-25 20:14:10',
                'updated_at' => '2017-07-25 20:14:14',
                'deleted_at' => NULL,
            ),
            290 => 
            array (
                'id' => 1001790,
                'author_id' => 232,
                'quote_text' => 'A lot of people start out with an exciting thing and they want to take over the world. But really, the people who do take over the world have a good plan of how to get there and the steps along the way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:14:17',
                'created_at' => '2017-07-25 20:13:30',
                'updated_at' => '2017-07-25 20:14:17',
                'deleted_at' => NULL,
            ),
            291 => 
            array (
                'id' => 1001791,
                'author_id' => 232,
                'quote_text' => 'The idea that you could change the world from your bedroom was pretty compelling to me.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:14:18',
                'created_at' => '2017-07-25 20:13:08',
                'updated_at' => '2017-07-25 20:14:18',
                'deleted_at' => NULL,
            ),
            292 => 
            array (
                'id' => 1001792,
                'author_id' => 232,
                'quote_text' => 'The talent that has to be learned is finding out what someone’s passion is and setting them up to realize that. You don’t get the best work from people if you’re guiding them versus them guiding themselves.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:14:19',
                'created_at' => '2017-07-25 20:12:57',
                'updated_at' => '2017-07-25 20:14:19',
                'deleted_at' => NULL,
            ),
            293 => 
            array (
                'id' => 1001793,
                'author_id' => 233,
                'quote_text' => 'You need to know exactly where you stand in a business at all times. Measure everything, because everything that is measured and watched improves.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:17:06',
                'created_at' => '2017-07-25 20:17:02',
                'updated_at' => '2017-07-25 20:17:06',
                'deleted_at' => NULL,
            ),
            294 => 
            array (
                'id' => 1001794,
                'author_id' => 233,
                'quote_text' => 'You got to go down a lot of wrong roads to find the right one.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:17:07',
                'created_at' => '2017-07-25 20:16:49',
                'updated_at' => '2017-07-25 20:17:07',
                'deleted_at' => NULL,
            ),
            295 => 
            array (
                'id' => 1001795,
                'author_id' => 233,
                'quote_text' => 'Lighten up. Often, at least half of what we accomplish is due to luck. None of us are in control as much as we like to think we are.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:17:09',
                'created_at' => '2017-07-25 20:16:39',
                'updated_at' => '2017-07-25 20:17:09',
                'deleted_at' => NULL,
            ),
            296 => 
            array (
                'id' => 1001796,
                'author_id' => 233,
                'quote_text' => 'I look for people who are doers and decision makers. I look for people who are implementers and are not afraid to get things done.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:17:10',
                'created_at' => '2017-07-25 20:16:26',
                'updated_at' => '2017-07-25 20:17:10',
                'deleted_at' => NULL,
            ),
            297 => 
            array (
                'id' => 1001797,
                'author_id' => 233,
                'quote_text' => 'No matter how difficult your situation is, you can get through it if you don’t look too far into the future, and focus on the present moment. You can get through anything one day at a time.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:17:11',
                'created_at' => '2017-07-25 20:16:04',
                'updated_at' => '2017-07-25 20:17:11',
                'deleted_at' => NULL,
            ),
            298 => 
            array (
                'id' => 1001798,
                'author_id' => 46,
                'quote_text' => 'Those who build great companies understand that the ultimate throttle on growth for any great company is not markets, or technology, or competition, or products. It is one thing above all others: the ability to get and keep enough of the right people.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:19:41',
                'created_at' => '2017-07-25 20:19:37',
                'updated_at' => '2017-07-25 20:19:41',
                'deleted_at' => NULL,
            ),
            299 => 
            array (
                'id' => 1001799,
                'author_id' => 46,
                'quote_text' => 'Good is the enemy of great. And that is one of the key reasons why we have so little that becomes great. We don’t have great schools, principally because we have good schools. We don’t have great government, principally because we have good government. Few people attain great lives, in large part because it is just so easy to settle for a good life.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:19:42',
                'created_at' => '2017-07-25 20:18:20',
                'updated_at' => '2017-07-25 20:19:42',
                'deleted_at' => NULL,
            ),
            300 => 
            array (
                'id' => 1001800,
                'author_id' => 46,
                'quote_text' => 'Building a great company is not a function of circumstance, but conscious choice and discipline.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:19:44',
                'created_at' => '2017-07-25 20:18:02',
                'updated_at' => '2017-07-25 20:19:44',
                'deleted_at' => NULL,
            ),
            301 => 
            array (
                'id' => 1001801,
                'author_id' => 46,
                'quote_text' => 'Bad decisions made with good intentions, are still bad decisions.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:19:45',
                'created_at' => '2017-07-25 20:17:51',
                'updated_at' => '2017-07-25 20:19:45',
                'deleted_at' => NULL,
            ),
            302 => 
            array (
                'id' => 1001802,
                'author_id' => 46,
                'quote_text' => 'Make a contribution. Will someone’s life be better because you were here? Life is about people, so be of service, and be useful.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:19:46',
                'created_at' => '2017-07-25 20:17:42',
                'updated_at' => '2017-07-25 20:19:46',
                'deleted_at' => NULL,
            ),
            303 => 
            array (
                'id' => 1001803,
                'author_id' => 217,
                'quote_text' => 'Surrounding yourself with inspiring people is now just as important as being talented or working hard.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:22:03',
                'created_at' => '2017-07-25 20:21:04',
                'updated_at' => '2017-07-25 20:22:03',
                'deleted_at' => NULL,
            ),
            304 => 
            array (
                'id' => 1001804,
                'author_id' => 217,
                'quote_text' => 'The hardest-working people don’t work hard because they’re disciplined. They work hard because working on an exciting problem is fun.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:22:05',
                'created_at' => '2017-07-25 20:20:49',
                'updated_at' => '2017-07-25 20:22:05',
                'deleted_at' => NULL,
            ),
            305 => 
            array (
                'id' => 1001805,
                'author_id' => 217,
                'quote_text' => 'Instead of trying to make your life perfect, give yourself the freedom to make it an adventure, and go ever upward.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:22:09',
                'created_at' => '2017-07-25 20:20:36',
                'updated_at' => '2017-07-25 20:22:09',
                'deleted_at' => NULL,
            ),
            306 => 
            array (
                'id' => 1001806,
                'author_id' => 234,
                'quote_text' => 'Good products are built by people who want to use it themselves.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:23:45',
                'created_at' => '2017-07-25 20:23:42',
                'updated_at' => '2017-07-25 20:23:45',
                'deleted_at' => NULL,
            ),
            307 => 
            array (
                'id' => 1001807,
                'author_id' => 234,
                'quote_text' => 'Where I feel the most productive and engaged is when I’m buried in code, buried in some project, tweaking some designs.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:24:44',
                'created_at' => '2017-07-25 20:24:21',
                'updated_at' => '2017-07-25 20:24:44',
                'deleted_at' => NULL,
            ),
            308 => 
            array (
                'id' => 1001808,
                'author_id' => 234,
                'quote_text' => 'I want to build something I’d be happy to be employed by 10 years out.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:24:46',
                'created_at' => '2017-07-25 20:23:59',
                'updated_at' => '2017-07-25 20:24:46',
                'deleted_at' => NULL,
            ),
            309 => 
            array (
                'id' => 1001809,
                'author_id' => 234,
                'quote_text' => 'Every feature has some maintenance cost, and having fewer features lets us focus on the ones we care about and make sure they work very well.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:24:54',
                'created_at' => '2017-07-25 20:24:50',
                'updated_at' => '2017-07-25 20:24:54',
                'deleted_at' => NULL,
            ),
            310 => 
            array (
                'id' => 1001810,
                'author_id' => 235,
                'quote_text' => 'I have a list of the hardest, most challenging problems that our company needs to solve and I start at the top and work my way down. And I have a list of the coolest most fascinating things that we can invent and I start at the top of the list and I work my way down.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:28:25',
                'created_at' => '2017-07-25 20:28:04',
                'updated_at' => '2017-07-25 20:28:25',
                'deleted_at' => NULL,
            ),
            311 => 
            array (
                'id' => 1001811,
                'author_id' => 235,
                'quote_text' => 'Fear is the disease. Hustle is the antidote… Whatever it is that you’re afraid of, go after it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:28:26',
                'created_at' => '2017-07-25 20:27:44',
                'updated_at' => '2017-07-25 20:28:26',
                'deleted_at' => NULL,
            ),
            312 => 
            array (
                'id' => 1001812,
                'author_id' => 235,
                'quote_text' => 'When something’s fun, it’s obvious. That’s when you just need to do more of it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:28:27',
                'created_at' => '2017-07-25 20:27:36',
                'updated_at' => '2017-07-25 20:28:27',
                'deleted_at' => NULL,
            ),
            313 => 
            array (
                'id' => 1001813,
                'author_id' => 235,
                'quote_text' => 'At the end of the day you still have to make something people want. You have find a way to produce it. You have to find a way to distribute it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:28:28',
                'created_at' => '2017-07-25 20:27:16',
                'updated_at' => '2017-07-25 20:28:28',
                'deleted_at' => NULL,
            ),
            314 => 
            array (
                'id' => 1001814,
                'author_id' => 235,
                'quote_text' => 'Stand by your principles and be comfortable with confrontation. So few people are, so when the people with the red tape come, it becomes a negotiation.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:28:29',
                'created_at' => '2017-07-25 20:27:00',
                'updated_at' => '2017-07-25 20:28:29',
                'deleted_at' => NULL,
            ),
            315 => 
            array (
                'id' => 1001815,
                'author_id' => 235,
                'quote_text' => 'Jamming on ideas, rapping on what’s next is what entrepreneurs do.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:28:30',
                'created_at' => '2017-07-25 20:26:43',
                'updated_at' => '2017-07-25 20:28:30',
                'deleted_at' => NULL,
            ),
            316 => 
            array (
                'id' => 1001816,
                'author_id' => 235,
                'quote_text' => 'Every time you add complexity to your business model, it just makes it harder for suppliers and your partners to understand it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:28:32',
                'created_at' => '2017-07-25 20:26:34',
                'updated_at' => '2017-07-25 20:28:32',
                'deleted_at' => NULL,
            ),
            317 => 
            array (
                'id' => 1001817,
                'author_id' => 41,
                'quote_text' => 'Storytelling is by far the most underrated skill in business.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:31:35',
                'created_at' => '2017-07-25 20:31:22',
                'updated_at' => '2017-07-25 20:31:35',
                'deleted_at' => NULL,
            ),
            318 => 
            array (
                'id' => 1001818,
                'author_id' => 41,
                'quote_text' => 'A penguin cannot become a giraffe, so just be the best penguin you can be.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:31:38',
                'created_at' => '2017-07-25 20:31:14',
                'updated_at' => '2017-07-25 20:31:38',
                'deleted_at' => NULL,
            ),
            319 => 
            array (
                'id' => 1001819,
                'author_id' => 41,
                'quote_text' => 'There is no excuse for anyone living in the United States or anywhere else right now to slog through his or her entire life working at jobs they hate, or even jobs they simply don’t love, in the name of a paycheck or a sense of responsibility.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:31:40',
                'created_at' => '2017-07-25 20:31:01',
                'updated_at' => '2017-07-25 20:31:40',
                'deleted_at' => NULL,
            ),
            320 => 
            array (
                'id' => 1001820,
                'author_id' => 41,
                'quote_text' => 'No one makes a million dollars with minimal effort unless they win the lottery.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:31:44',
                'created_at' => '2017-07-25 20:30:46',
                'updated_at' => '2017-07-25 20:31:44',
                'deleted_at' => NULL,
            ),
            321 => 
            array (
                'id' => 1001821,
                'author_id' => 41,
                'quote_text' => 'It’s never a bad time to start a business unless you are starting a mediocre business.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:31:46',
                'created_at' => '2017-07-25 20:30:28',
                'updated_at' => '2017-07-25 20:31:46',
                'deleted_at' => NULL,
            ),
            322 => 
            array (
                'id' => 1001822,
                'author_id' => 41,
                'quote_text' => 'Love your family, work super hard, live your passion.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:32:06',
                'created_at' => '2017-07-25 20:32:02',
                'updated_at' => '2017-07-25 20:32:06',
                'deleted_at' => NULL,
            ),
            323 => 
            array (
                'id' => 1001823,
                'author_id' => 236,
                'quote_text' => 'It’s a one-time cost to come up with great name for your startup—but the benefit is forever.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:33:21',
                'created_at' => '2017-07-25 20:33:17',
                'updated_at' => '2017-07-25 20:33:21',
                'deleted_at' => NULL,
            ),
            324 => 
            array (
                'id' => 1001824,
                'author_id' => 236,
                'quote_text' => 'Customers are usually very good at identifying their problems, not so much the solutions.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:34:55',
                'created_at' => '2017-07-25 20:34:51',
                'updated_at' => '2017-07-25 20:34:55',
                'deleted_at' => NULL,
            ),
            325 => 
            array (
                'id' => 1001825,
                'author_id' => 236,
                'quote_text' => 'Don’t try to take market away from your competition. If the market is big enough there should be enough non-consumers you can be selling to.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:34:56',
                'created_at' => '2017-07-25 20:34:39',
                'updated_at' => '2017-07-25 20:34:56',
                'deleted_at' => NULL,
            ),
            326 => 
            array (
                'id' => 1001826,
                'author_id' => 236,
                'quote_text' => 'When recruiting for a startup, you’re looking for the future stars—because you likely can’t afford or convince the current stars.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:34:57',
                'created_at' => '2017-07-25 20:34:16',
                'updated_at' => '2017-07-25 20:34:57',
                'deleted_at' => NULL,
            ),
            327 => 
            array (
                'id' => 1001827,
                'author_id' => 236,
            'quote_text' => 'It doesn’t matter how much ‘real’ (objective) value you have baked into your product if your customers don’t perceive that value.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:34:58',
                'created_at' => '2017-07-25 20:33:48',
                'updated_at' => '2017-07-25 20:34:58',
                'deleted_at' => NULL,
            ),
            328 => 
            array (
                'id' => 1001828,
                'author_id' => 236,
                'quote_text' => 'That is the life of an entrepreneur: It’s a steady stream of hard work, occasionally punctuated by some really hard decisions.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:35:00',
                'created_at' => '2017-07-25 20:33:37',
                'updated_at' => '2017-07-25 20:35:00',
                'deleted_at' => NULL,
            ),
            329 => 
            array (
                'id' => 1001829,
                'author_id' => 236,
                'quote_text' => 'Knowing the right thing to do and doing it are two different things. There is no partial credit for the first.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:35:33',
                'created_at' => '2017-07-25 20:35:28',
                'updated_at' => '2017-07-25 20:35:33',
                'deleted_at' => NULL,
            ),
            330 => 
            array (
                'id' => 1001830,
                'author_id' => 237,
                'quote_text' => 'If running a tech startup, don’t get old and rusty. Each year in age is a liability. Keep curiosity for new and different.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:38:01',
                'created_at' => '2017-07-25 20:37:57',
                'updated_at' => '2017-07-25 20:38:01',
                'deleted_at' => NULL,
            ),
            331 => 
            array (
                'id' => 1001831,
                'author_id' => 237,
                'quote_text' => 'Sometimes your success was in spite of what you did, not because of it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:38:02',
                'created_at' => '2017-07-25 20:37:32',
                'updated_at' => '2017-07-25 20:38:02',
                'deleted_at' => NULL,
            ),
            332 => 
            array (
                'id' => 1001832,
                'author_id' => 237,
                'quote_text' => 'Competitors are trying to take food from your family and your team’s families. Treat accordingly.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:38:04',
                'created_at' => '2017-07-25 20:37:04',
                'updated_at' => '2017-07-25 20:38:04',
                'deleted_at' => NULL,
            ),
            333 => 
            array (
                'id' => 1001833,
                'author_id' => 237,
                'quote_text' => 'When it isn’t blatantly clear where you should focus, the answer is immerse yourself in sales. It has all the answers.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:38:05',
                'created_at' => '2017-07-25 20:36:39',
                'updated_at' => '2017-07-25 20:38:05',
                'deleted_at' => NULL,
            ),
            334 => 
            array (
                'id' => 1001834,
                'author_id' => 238,
                'quote_text' => 'The analytics alone are not enough to be successful—you have to be willing to roll up your sleeves to build a great business.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:40:01',
                'created_at' => '2017-07-25 20:39:47',
                'updated_at' => '2017-07-25 20:40:01',
                'deleted_at' => NULL,
            ),
            335 => 
            array (
                'id' => 1001835,
                'author_id' => 238,
                'quote_text' => 'You need to make sure you’re passionate about the opportunity—if you can’t sleep at night because you’re not pursuing it, that’s when to take the plunge.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:40:02',
                'created_at' => '2017-07-25 20:39:36',
                'updated_at' => '2017-07-25 20:40:02',
                'deleted_at' => NULL,
            ),
            336 => 
            array (
                'id' => 1001836,
                'author_id' => 238,
                'quote_text' => 'If you have conviction about what you’re doing, it makes it easier to weather the ups and downs.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:40:03',
                'created_at' => '2017-07-25 20:39:23',
                'updated_at' => '2017-07-25 20:40:03',
                'deleted_at' => NULL,
            ),
            337 => 
            array (
                'id' => 1001837,
                'author_id' => 239,
                'quote_text' => 'I’m always in awe of people who are artists in their fields – people who understand that simply by taking ideas and translating them into reality, they’ve created value in the world.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:43:17',
                'created_at' => '2017-07-25 20:43:13',
                'updated_at' => '2017-07-25 20:43:17',
                'deleted_at' => NULL,
            ),
            338 => 
            array (
                'id' => 1001838,
                'author_id' => 239,
                'quote_text' => 'Great products sell themselves.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:43:19',
                'created_at' => '2017-07-25 20:42:28',
                'updated_at' => '2017-07-25 20:43:19',
                'deleted_at' => NULL,
            ),
            339 => 
            array (
                'id' => 1001839,
                'author_id' => 239,
                'quote_text' => 'Every startup should address a real and demonstrated need in the world. If you build a solution to a problem lots of people have, it’s so easy to sell your product to the world.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:43:20',
                'created_at' => '2017-07-25 20:42:19',
                'updated_at' => '2017-07-25 20:43:20',
                'deleted_at' => NULL,
            ),
            340 => 
            array (
                'id' => 1001840,
                'author_id' => 239,
                'quote_text' => 'If you’ve got an idea, start today. There’s no better time than now to get going. That doesn’t mean quit your job and jump into your idea 100% from day one, but there’s always small progress that can be made to start the movement.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:43:21',
                'created_at' => '2017-07-25 20:42:04',
                'updated_at' => '2017-07-25 20:43:21',
                'deleted_at' => NULL,
            ),
            341 => 
            array (
                'id' => 1001841,
                'author_id' => 240,
                'quote_text' => 'There’s a big tendency to gravitate toward a closed and proprietary approach too easily.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:45:44',
                'created_at' => '2017-07-25 20:45:10',
                'updated_at' => '2017-07-25 20:45:44',
                'deleted_at' => NULL,
            ),
            342 => 
            array (
                'id' => 1001842,
                'author_id' => 240,
                'quote_text' => 'Simply having rules does not change the things that people want to do. You have to change incentives.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:45:46',
                'created_at' => '2017-07-25 20:44:48',
                'updated_at' => '2017-07-25 20:45:46',
                'deleted_at' => NULL,
            ),
            343 => 
            array (
                'id' => 1001843,
                'author_id' => 240,
                'quote_text' => 'You play for high stakes when you decide to start your own business. Whenever you can, you should cheat to turn the game your way: Grow up more slowly. Stay in school, show up at class, take the full book of final exams. Hang out late at night in the lab with the rest of the crew. Then, go get a job for a regular company. Watch and learn.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:45:47',
                'created_at' => '2017-07-25 20:44:28',
                'updated_at' => '2017-07-25 20:45:47',
                'deleted_at' => NULL,
            ),
            344 => 
            array (
                'id' => 1001844,
                'author_id' => 241,
                'quote_text' => 'It’s not accidental that products get worse over time; it’s because companies stop paying attention to them. They stop caring as much about maintaining the same quality they did when they were just trying to fight for survival and no one would pay attention unless they had the best technology.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:12',
                'created_at' => '2017-07-25 20:51:07',
                'updated_at' => '2017-07-25 20:51:12',
                'deleted_at' => NULL,
            ),
            345 => 
            array (
                'id' => 1001845,
                'author_id' => 241,
                'quote_text' => 'Success really only comes when you nail one thing. And while you may have made the wrong bet, it’s far more likely that you won’t succeed at any bet if you’re hedging. That’s why big companies get indecisive and bureaucratic; they don’t know which direction to bet, and it shows up in their product. It requires honesty and clarity to focus, but that’s usually how businesses succeed.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:13',
                'created_at' => '2017-07-25 20:50:50',
                'updated_at' => '2017-07-25 20:51:13',
                'deleted_at' => NULL,
            ),
            346 => 
            array (
                'id' => 1001846,
                'author_id' => 241,
                'quote_text' => 'Everything comes down to the ease by which you navigate contradictions. Speed versus quality; simplicity versus breadth; lean versus scale.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:14',
                'created_at' => '2017-07-25 20:50:22',
                'updated_at' => '2017-07-25 20:51:14',
                'deleted_at' => NULL,
            ),
            347 => 
            array (
                'id' => 1001847,
                'author_id' => 241,
                'quote_text' => 'I think people are always able to achieve more than they think they can. While that’s cliche, I don’t know if managers think about that enough. You have to set your sights extremely high.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:15',
                'created_at' => '2017-07-25 20:50:11',
                'updated_at' => '2017-07-25 20:51:15',
                'deleted_at' => NULL,
            ),
            348 => 
            array (
                'id' => 1001848,
                'author_id' => 241,
                'quote_text' => 'I’m obsessed with speed. I’m always asking myself, Why can’t we do things faster? Why can’t it happen more efficiently? Why is this requiring three meetings instead of one? What steps can we cut out of this process to automate it? Speed and efficiency are crucial, because we have about 600 people, and we’re competing against companies that have tens of thousands of people.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:17',
                'created_at' => '2017-07-25 20:49:17',
                'updated_at' => '2017-07-25 20:51:17',
                'deleted_at' => NULL,
            ),
            349 => 
            array (
                'id' => 1001849,
                'author_id' => 241,
                'quote_text' => 'There’s a lot of pride that business owners have. It’s actually really critical that pride and ownership extends to everyone in the organization. I think of everyone is in the same boat in driving the company forward.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:18',
                'created_at' => '2017-07-25 20:49:02',
                'updated_at' => '2017-07-25 20:51:18',
                'deleted_at' => NULL,
            ),
            350 => 
            array (
                'id' => 1001850,
                'author_id' => 241,
                'quote_text' => 'The incumbent who has a significant amount of entrenched ways of doing things and is much slower is far easier to compete with. The biggest threats are people in a garage that you never heard of who can come disrupt you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:19',
                'created_at' => '2017-07-25 20:48:48',
                'updated_at' => '2017-07-25 20:51:19',
                'deleted_at' => NULL,
            ),
            351 => 
            array (
                'id' => 1001851,
                'author_id' => 241,
                'quote_text' => 'As a founder, your main job is to ask, ‘How can we grow faster?’ And do everything possible to make it happen.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:20',
                'created_at' => '2017-07-25 20:48:33',
                'updated_at' => '2017-07-25 20:51:20',
                'deleted_at' => NULL,
            ),
            352 => 
            array (
                'id' => 1001852,
                'author_id' => 241,
                'quote_text' => 'Startups win by focusing on early adopters who represent the masses. Big companies lose by focusing on late adopters that don’t.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:24',
                'created_at' => '2017-07-25 20:48:20',
                'updated_at' => '2017-07-25 20:51:24',
                'deleted_at' => NULL,
            ),
            353 => 
            array (
                'id' => 1001853,
                'author_id' => 241,
                'quote_text' => 'Never underestimate incumbents. The good news is, they’ll always underestimate you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:51:25',
                'created_at' => '2017-07-25 20:48:05',
                'updated_at' => '2017-07-25 20:51:25',
                'deleted_at' => NULL,
            ),
            354 => 
            array (
                'id' => 1001854,
                'author_id' => 5,
                'quote_text' => 'We see our customers as invited guests to a party, and we are the hosts. It’s our job every day to make every important aspect of the customer experience a little bit better.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:52:37',
                'created_at' => '2017-07-25 20:52:34',
                'updated_at' => '2017-07-25 20:52:37',
                'deleted_at' => NULL,
            ),
            355 => 
            array (
                'id' => 1001855,
                'author_id' => 28,
                'quote_text' => 'You can’t have good ideas unless you’re willing to generate a lot of bad ones.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:31',
                'created_at' => '2017-07-25 20:55:27',
                'updated_at' => '2017-07-25 20:55:31',
                'deleted_at' => NULL,
            ),
            356 => 
            array (
                'id' => 1001856,
                'author_id' => 28,
                'quote_text' => 'Today, not starting is far, far worse than being wrong. If you start, you’ve got a shot at evolving and adjusting to turn your wrong into a right. But if you don’t start, you never get a chance.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:32',
                'created_at' => '2017-07-25 20:55:18',
                'updated_at' => '2017-07-25 20:55:32',
                'deleted_at' => NULL,
            ),
            357 => 
            array (
                'id' => 1001857,
                'author_id' => 28,
                'quote_text' => 'Remarkable visions and genuine insights are always met with resistance. And when you start to make progress, your efforts are met with even more resistance. Products, services, career paths—whatever it is, the forces for mediocrity will align to stop you, forgiving no errors and never backing down until it’s over. If it were any other way, it would be easy. And if it were any other way, everyone would do it and your work would ultimately be devalued. The yin and yang are clear: without people pushing against your quest to do something worth talking about, it’s unlikely to be worth the journey. Persist.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:33',
                'created_at' => '2017-07-25 20:55:00',
                'updated_at' => '2017-07-25 20:55:33',
                'deleted_at' => NULL,
            ),
            358 => 
            array (
                'id' => 1001858,
                'author_id' => 28,
                'quote_text' => 'If failure is not an option, then neither is success.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:35',
                'created_at' => '2017-07-25 20:54:43',
                'updated_at' => '2017-07-25 20:55:35',
                'deleted_at' => NULL,
            ),
            359 => 
            array (
                'id' => 1001859,
                'author_id' => 28,
                'quote_text' => 'Don’t find customers for your products, find products for your customers.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:36',
                'created_at' => '2017-07-25 20:54:27',
                'updated_at' => '2017-07-25 20:55:36',
                'deleted_at' => NULL,
            ),
            360 => 
            array (
                'id' => 1001860,
                'author_id' => 28,
                'quote_text' => 'The secret of leadership is simple: Do what you believe in. Paint a picture of the future. Go there. People will follow.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:37',
                'created_at' => '2017-07-25 20:54:10',
                'updated_at' => '2017-07-25 20:55:37',
                'deleted_at' => NULL,
            ),
            361 => 
            array (
                'id' => 1001861,
                'author_id' => 28,
                'quote_text' => 'Perhaps your challenge isn’t finding a better project or a better boss. Perhaps you need to get in touch with what it means to feel passionate. People with passion look for ways to make things happen.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:38',
                'created_at' => '2017-07-25 20:53:58',
                'updated_at' => '2017-07-25 20:55:38',
                'deleted_at' => NULL,
            ),
            362 => 
            array (
                'id' => 1001862,
                'author_id' => 28,
                'quote_text' => 'Soon is not as good as now.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:39',
                'created_at' => '2017-07-25 20:53:38',
                'updated_at' => '2017-07-25 20:55:39',
                'deleted_at' => NULL,
            ),
            363 => 
            array (
                'id' => 1001863,
                'author_id' => 28,
                'quote_text' => 'If you can’t state your position in eight words, you don’t have a position.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:40',
                'created_at' => '2017-07-25 20:53:29',
                'updated_at' => '2017-07-25 20:55:40',
                'deleted_at' => NULL,
            ),
            364 => 
            array (
                'id' => 1001864,
                'author_id' => 28,
                'quote_text' => 'What makes someone an artist? I don’t think is has anything to do with a paintbrush. There are painters who follow the numbers, or paint billboards, or work in a small village in China, painting reproductions. These folks, while swell people, aren’t artists. On the other hand, Charlie Chaplin was an artist, beyond a doubt. So is Jonathan Ive, who designed the iPod. You can be an artists who works with oil paints or marble, sure. But there are artists who work with numbers, business models, and customer conversations. Art is about intent and communication, not substances.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:42',
                'created_at' => '2017-07-25 20:53:18',
                'updated_at' => '2017-07-25 20:55:42',
                'deleted_at' => NULL,
            ),
            365 => 
            array (
                'id' => 1001865,
                'author_id' => 28,
                'quote_text' => 'Instead of wondering when your next vacation is, maybe you should set up a life you don’t need to escape from.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:55:43',
                'created_at' => '2017-07-25 20:53:01',
                'updated_at' => '2017-07-25 20:55:43',
                'deleted_at' => NULL,
            ),
            366 => 
            array (
                'id' => 1001866,
                'author_id' => 242,
                'quote_text' => 'The trend of design toward simplicity and accessibility in software happened for a reason—simple sells, simple’s usable and simple scales.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:59:10',
                'created_at' => '2017-07-25 20:59:06',
                'updated_at' => '2017-07-25 20:59:10',
                'deleted_at' => NULL,
            ),
            367 => 
            array (
                'id' => 1001867,
                'author_id' => 242,
                'quote_text' => 'Best way to sell something: don’t sell anything. Earn the awareness, respect, and turst of those who might buy.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:59:11',
                'created_at' => '2017-07-25 20:58:25',
                'updated_at' => '2017-07-25 20:59:11',
                'deleted_at' => NULL,
            ),
            368 => 
            array (
                'id' => 1001868,
                'author_id' => 242,
                'quote_text' => 'There is no black magic to successfully attracting customers via the web.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:59:12',
                'created_at' => '2017-07-25 20:58:15',
                'updated_at' => '2017-07-25 20:59:12',
                'deleted_at' => NULL,
            ),
            369 => 
            array (
                'id' => 1001869,
                'author_id' => 242,
                'quote_text' => 'Better marketing often trumps a better product. Invest in both.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:59:14',
                'created_at' => '2017-07-25 20:57:49',
                'updated_at' => '2017-07-25 20:59:14',
                'deleted_at' => NULL,
            ),
            370 => 
            array (
                'id' => 1001870,
                'author_id' => 242,
                'quote_text' => 'Aligning yourself with people who share your values and your prioritization of those values far outweighs aligning yourself with people who share your vision for a particular product, roadmap, or financial goal.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:59:15',
                'created_at' => '2017-07-25 20:57:39',
                'updated_at' => '2017-07-25 20:59:15',
                'deleted_at' => NULL,
            ),
            371 => 
            array (
                'id' => 1001871,
                'author_id' => 242,
                'quote_text' => 'Tell a story. Make it true. Make it compelling. And make it relevant.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:59:16',
                'created_at' => '2017-07-25 20:57:27',
                'updated_at' => '2017-07-25 20:59:16',
                'deleted_at' => NULL,
            ),
            372 => 
            array (
                'id' => 1001872,
                'author_id' => 242,
                'quote_text' => 'A hard thing is done by figuring out how to start.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:59:17',
                'created_at' => '2017-07-25 20:57:18',
                'updated_at' => '2017-07-25 20:59:17',
                'deleted_at' => NULL,
            ),
            373 => 
            array (
                'id' => 1001873,
                'author_id' => 242,
                'quote_text' => 'Don’t conflate revenue with success, especially not long term. Many of the best things we’ve done have cost or lost money in the short run, but built a better brand over the years because of it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 20:59:18',
                'created_at' => '2017-07-25 20:56:52',
                'updated_at' => '2017-07-25 20:59:18',
                'deleted_at' => NULL,
            ),
            374 => 
            array (
                'id' => 1001874,
                'author_id' => 243,
                'quote_text' => 'At some point software design becomes less about what and more about when.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:06:35',
                'created_at' => '2017-07-25 21:06:31',
                'updated_at' => '2017-07-25 21:06:35',
                'deleted_at' => NULL,
            ),
            375 => 
            array (
                'id' => 1001875,
                'author_id' => 243,
                'quote_text' => 'Optimism is an occupational hazard of programming; feedback is the treatment.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:06:36',
                'created_at' => '2017-07-25 21:06:24',
                'updated_at' => '2017-07-25 21:06:36',
                'deleted_at' => NULL,
            ),
            376 => 
            array (
                'id' => 1001876,
                'author_id' => 243,
                'quote_text' => 'Tests are the Programmer’s stone, transmuting fear into boredom.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:06:37',
                'created_at' => '2017-07-25 21:06:12',
                'updated_at' => '2017-07-25 21:06:37',
                'deleted_at' => NULL,
            ),
            377 => 
            array (
                'id' => 1001877,
                'author_id' => 243,
                'quote_text' => 'A design is "simple" if it follows these rules: Runs all the tests; Contains no duplication; Expresses the intent of the programmer; Minimizes the number of classes and methods.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:06:38',
                'created_at' => '2017-07-25 21:06:00',
                'updated_at' => '2017-07-25 21:06:38',
                'deleted_at' => NULL,
            ),
            378 => 
            array (
                'id' => 1001878,
                'author_id' => 243,
                'quote_text' => 'The craft of programming begins with empathy, not formatting or languages or tools or algorithms or data structures.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:06:39',
                'created_at' => '2017-07-25 21:05:33',
                'updated_at' => '2017-07-25 21:06:39',
                'deleted_at' => NULL,
            ),
            379 => 
            array (
                'id' => 1001879,
                'author_id' => 244,
                'quote_text' => 'Write shy code - modules that don\'t reveal anything unnecessary to other modules and that don\'t rely on other modules\' implementations.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:09:14',
                'created_at' => '2017-07-25 21:09:10',
                'updated_at' => '2017-07-25 21:09:14',
                'deleted_at' => NULL,
            ),
            380 => 
            array (
                'id' => 1001880,
                'author_id' => 244,
                'quote_text' => 'Don\'t live with broken windows.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:09:15',
                'created_at' => '2017-07-25 21:08:33',
                'updated_at' => '2017-07-25 21:09:15',
                'deleted_at' => NULL,
            ),
            381 => 
            array (
                'id' => 1001881,
                'author_id' => 244,
                'quote_text' => 'It\'s not at all important to get it right the first time. It\'s vitally important to get it right the last time.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:09:16',
                'created_at' => '2017-07-25 21:08:24',
                'updated_at' => '2017-07-25 21:09:16',
                'deleted_at' => NULL,
            ),
            382 => 
            array (
                'id' => 1001882,
                'author_id' => 244,
                'quote_text' => 'XML documents are much like humans — they are cute and fun to deal with when they’re small but can get really annoying as they grow bigger.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:09:18',
                'created_at' => '2017-07-25 21:08:16',
                'updated_at' => '2017-07-25 21:09:18',
                'deleted_at' => NULL,
            ),
            383 => 
            array (
                'id' => 1001883,
                'author_id' => 245,
                'quote_text' => 'First do it, then do it right, then do it better.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:10:14',
                'created_at' => '2017-07-25 21:10:10',
                'updated_at' => '2017-07-25 21:10:14',
                'deleted_at' => NULL,
            ),
            384 => 
            array (
                'id' => 1001884,
                'author_id' => 176,
                'quote_text' => 'A happy programmer is a productive programmer. That\'s why we optimize for happiness and you should too. Don\'t just pick tools and practices based on industry standards or performance metrics. Look at the intangibles: Is there passion, pride, and craftsmanship here? Would you truly be happy working in this environment eight hours a day?',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:13:24',
                'created_at' => '2017-07-25 21:13:19',
                'updated_at' => '2017-07-25 21:13:24',
                'deleted_at' => NULL,
            ),
            385 => 
            array (
                'id' => 1001885,
                'author_id' => 176,
                'quote_text' => 'Inspiration is a magical thing, a productivity multiplier, a motivator. But it won’t wait for you. Inspiration is a now thing. If it grabs you, grab it right back.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:16:10',
                'created_at' => '2017-07-25 21:16:06',
                'updated_at' => '2017-07-25 21:16:10',
                'deleted_at' => NULL,
            ),
            386 => 
            array (
                'id' => 1001886,
                'author_id' => 176,
                'quote_text' => 'The whole point of innovation and disruption is doing things differently from those who came before you.  If you hide in the herd, you’re not likely to get ahead of the pack.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:16:12',
                'created_at' => '2017-07-25 21:15:09',
                'updated_at' => '2017-07-25 21:16:12',
                'deleted_at' => NULL,
            ),
            387 => 
            array (
                'id' => 1001887,
                'author_id' => 176,
                'quote_text' => 'If you can’t let your employees work from home out of fear they’ll slack off without your supervision, you’re a babysitter, not a manager.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:16:13',
                'created_at' => '2017-07-25 21:14:46',
                'updated_at' => '2017-07-25 21:16:13',
                'deleted_at' => NULL,
            ),
            388 => 
            array (
                'id' => 1001888,
                'author_id' => 27,
                'quote_text' => 'Leaders must be close enough to relate to others, but far enough ahead to motivate them.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:30',
                'created_at' => '2017-07-25 21:23:26',
                'updated_at' => '2017-07-25 21:23:30',
                'deleted_at' => NULL,
            ),
            389 => 
            array (
                'id' => 1001889,
                'author_id' => 27,
                'quote_text' => 'People never care how much you know until they know how much you care.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:31',
                'created_at' => '2017-07-25 21:23:17',
                'updated_at' => '2017-07-25 21:23:31',
                'deleted_at' => NULL,
            ),
            390 => 
            array (
                'id' => 1001890,
                'author_id' => 27,
                'quote_text' => 'A good leader is a person who takes a little more than his share of the blame and a little less than his share of the credit.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:32',
                'created_at' => '2017-07-25 21:23:08',
                'updated_at' => '2017-07-25 21:23:32',
                'deleted_at' => NULL,
            ),
            391 => 
            array (
                'id' => 1001891,
                'author_id' => 27,
                'quote_text' => 'The greatest day in your life and mine is when we take total responsibility for our attitudes. That\'s the day we truly grow up.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:33',
                'created_at' => '2017-07-25 21:22:49',
                'updated_at' => '2017-07-25 21:23:33',
                'deleted_at' => NULL,
            ),
            392 => 
            array (
                'id' => 1001892,
                'author_id' => 27,
                'quote_text' => 'People buy into the leader before they buy into the vision.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:34',
                'created_at' => '2017-07-25 21:22:35',
                'updated_at' => '2017-07-25 21:23:34',
                'deleted_at' => NULL,
            ),
            393 => 
            array (
                'id' => 1001893,
                'author_id' => 27,
                'quote_text' => 'The greatest mistake we make is living in constant fear that we will make one.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:36',
                'created_at' => '2017-07-25 21:22:27',
                'updated_at' => '2017-07-25 21:23:36',
                'deleted_at' => NULL,
            ),
            394 => 
            array (
                'id' => 1001894,
                'author_id' => 27,
                'quote_text' => 'Learn to say \'no\' to the good so you can say \'yes\' to the best.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:37',
                'created_at' => '2017-07-25 21:22:19',
                'updated_at' => '2017-07-25 21:23:37',
                'deleted_at' => NULL,
            ),
            395 => 
            array (
                'id' => 1001895,
                'author_id' => 27,
                'quote_text' => 'A leader is one who knows the way, goes the way, and shows the way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:38',
                'created_at' => '2017-07-25 21:22:12',
                'updated_at' => '2017-07-25 21:23:38',
                'deleted_at' => NULL,
            ),
            396 => 
            array (
                'id' => 1001896,
                'author_id' => 27,
                'quote_text' => 'A man must be big enough to admit his mistakes, smart enough to profit from them, and strong enough to correct them.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:23:39',
                'created_at' => '2017-07-25 21:21:56',
                'updated_at' => '2017-07-25 21:23:39',
                'deleted_at' => NULL,
            ),
            397 => 
            array (
                'id' => 1001897,
                'author_id' => 20,
                'quote_text' => 'Management is doing things right; leadership is doing the right things.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:27',
                'created_at' => '2017-07-25 21:26:20',
                'updated_at' => '2017-07-25 21:26:27',
                'deleted_at' => NULL,
            ),
            398 => 
            array (
                'id' => 1001898,
                'author_id' => 20,
                'quote_text' => 'The most important thing in communication is to hear what isn\'t being said.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:28',
                'created_at' => '2017-07-25 21:26:10',
                'updated_at' => '2017-07-25 21:26:28',
                'deleted_at' => NULL,
            ),
            399 => 
            array (
                'id' => 1001899,
                'author_id' => 20,
                'quote_text' => 'There is nothing so useless as doing efficiently that which should not be done at all.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:30',
                'created_at' => '2017-07-25 21:26:02',
                'updated_at' => '2017-07-25 21:26:30',
                'deleted_at' => NULL,
            ),
            400 => 
            array (
                'id' => 1001900,
                'author_id' => 20,
                'quote_text' => 'The best way to predict the future is to create it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:31',
                'created_at' => '2017-07-25 21:25:53',
                'updated_at' => '2017-07-25 21:26:31',
                'deleted_at' => NULL,
            ),
            401 => 
            array (
                'id' => 1001901,
                'author_id' => 20,
                'quote_text' => 'So much of what we call management consists in making it difficult for people to work.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:32',
                'created_at' => '2017-07-25 21:25:45',
                'updated_at' => '2017-07-25 21:26:32',
                'deleted_at' => NULL,
            ),
            402 => 
            array (
                'id' => 1001902,
                'author_id' => 20,
                'quote_text' => 'Knowledge has to be improved, challenged, and increased constantly, or it vanishes.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:33',
                'created_at' => '2017-07-25 21:25:36',
                'updated_at' => '2017-07-25 21:26:33',
                'deleted_at' => NULL,
            ),
            403 => 
            array (
                'id' => 1001903,
                'author_id' => 20,
                'quote_text' => 'The entrepreneur always searches for change, responds to it, and exploits it as an opportunity.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:35',
                'created_at' => '2017-07-25 21:25:26',
                'updated_at' => '2017-07-25 21:26:35',
                'deleted_at' => NULL,
            ),
            404 => 
            array (
                'id' => 1001904,
                'author_id' => 20,
                'quote_text' => 'The purpose of a business is to create a customer.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:36',
                'created_at' => '2017-07-25 21:25:18',
                'updated_at' => '2017-07-25 21:26:36',
                'deleted_at' => NULL,
            ),
            405 => 
            array (
                'id' => 1001905,
                'author_id' => 20,
                'quote_text' => 'Plans are only good intentions unless they immediately degenerate into hard work.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:38',
                'created_at' => '2017-07-25 21:25:07',
                'updated_at' => '2017-07-25 21:26:38',
                'deleted_at' => NULL,
            ),
            406 => 
            array (
                'id' => 1001906,
                'author_id' => 20,
                'quote_text' => 'Unless commitment is made, there are only promises and hopes... but no plans.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:26:39',
                'created_at' => '2017-07-25 21:24:59',
                'updated_at' => '2017-07-25 21:26:39',
                'deleted_at' => NULL,
            ),
            407 => 
            array (
                'id' => 1001907,
                'author_id' => 40,
                'quote_text' => 'Setting goals is the first step in turning the invisible into the visible.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:28:57',
                'created_at' => '2017-07-25 21:28:53',
                'updated_at' => '2017-07-25 21:28:57',
                'deleted_at' => NULL,
            ),
            408 => 
            array (
                'id' => 1001908,
                'author_id' => 40,
                'quote_text' => 'If you do what you\'ve always done, you\'ll get what you\'ve always gotten.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:28:59',
                'created_at' => '2017-07-25 21:28:45',
                'updated_at' => '2017-07-25 21:28:59',
                'deleted_at' => NULL,
            ),
            409 => 
            array (
                'id' => 1001909,
                'author_id' => 40,
                'quote_text' => 'It is in your moments of decision that your destiny is shaped.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:29:00',
                'created_at' => '2017-07-25 21:28:35',
                'updated_at' => '2017-07-25 21:29:00',
                'deleted_at' => NULL,
            ),
            410 => 
            array (
                'id' => 1001910,
                'author_id' => 40,
                'quote_text' => 'Quality questions create a quality life. Successful people ask better questions, and as a result, they get better answers.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:29:01',
                'created_at' => '2017-07-25 21:28:27',
                'updated_at' => '2017-07-25 21:29:01',
                'deleted_at' => NULL,
            ),
            411 => 
            array (
                'id' => 1001911,
                'author_id' => 40,
                'quote_text' => 'A real decision is measured by the fact that you\'ve taken a new action. If there\'s no action, you haven\'t truly decided.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:29:02',
                'created_at' => '2017-07-25 21:28:18',
                'updated_at' => '2017-07-25 21:29:02',
                'deleted_at' => NULL,
            ),
            412 => 
            array (
                'id' => 1001912,
                'author_id' => 40,
                'quote_text' => 'We can change our lives. We can do, have, and be exactly what we wish.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:29:04',
                'created_at' => '2017-07-25 21:28:10',
                'updated_at' => '2017-07-25 21:29:04',
                'deleted_at' => NULL,
            ),
            413 => 
            array (
                'id' => 1001913,
                'author_id' => 40,
                'quote_text' => 'Life is a gift, and it offers us the privilege, opportunity, and responsibility to give something back by becoming more.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:29:05',
                'created_at' => '2017-07-25 21:28:00',
                'updated_at' => '2017-07-25 21:29:05',
                'deleted_at' => NULL,
            ),
            414 => 
            array (
                'id' => 1001914,
                'author_id' => 40,
                'quote_text' => 'The path to success is to take massive, determined action.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:29:06',
                'created_at' => '2017-07-25 21:27:52',
                'updated_at' => '2017-07-25 21:29:06',
                'deleted_at' => NULL,
            ),
            415 => 
            array (
                'id' => 1001915,
                'author_id' => 40,
                'quote_text' => 'If you want to be successful, find someone who has achieved the results you want and copy what they do and you\'ll achieve the same results.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:29:08',
                'created_at' => '2017-07-25 21:27:45',
                'updated_at' => '2017-07-25 21:29:08',
                'deleted_at' => NULL,
            ),
            416 => 
            array (
                'id' => 1001916,
                'author_id' => 40,
                'quote_text' => 'People are not lazy. They simply have impotent goals - that is, goals that do not inspire them.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:29:09',
                'created_at' => '2017-07-25 21:27:34',
                'updated_at' => '2017-07-25 21:29:09',
                'deleted_at' => NULL,
            ),
            417 => 
            array (
                'id' => 1001917,
                'author_id' => 178,
                'quote_text' => 'Technology is best when it brings people together.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:31:03',
                'created_at' => '2017-07-25 21:30:59',
                'updated_at' => '2017-07-25 21:31:03',
                'deleted_at' => NULL,
            ),
            418 => 
            array (
                'id' => 1001918,
                'author_id' => 178,
                'quote_text' => 'Usage is like oxygen for ideas. You can never fully anticipate how an audience is going to react to something you\'ve created until it\'s out there.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:31:04',
                'created_at' => '2017-07-25 21:30:35',
                'updated_at' => '2017-07-25 21:31:04',
                'deleted_at' => NULL,
            ),
            419 => 
            array (
                'id' => 1001919,
                'author_id' => 178,
                'quote_text' => 'A common quality I see of people who are successful is that they are voracious readers.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:31:06',
                'created_at' => '2017-07-25 21:30:07',
                'updated_at' => '2017-07-25 21:31:06',
                'deleted_at' => NULL,
            ),
            420 => 
            array (
                'id' => 1001920,
                'author_id' => 178,
                'quote_text' => 'If you are not embarrassed when you ship your first version, you waited too long.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:32:15',
                'created_at' => '2017-07-25 21:32:11',
                'updated_at' => '2017-07-25 21:32:15',
                'deleted_at' => NULL,
            ),
            421 => 
            array (
                'id' => 1001921,
                'author_id' => 175,
                'quote_text' => 'Exchange is all about equivalence.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:35:54',
                'created_at' => '2017-07-25 21:35:50',
                'updated_at' => '2017-07-25 21:35:54',
                'deleted_at' => NULL,
            ),
            422 => 
            array (
                'id' => 1001922,
                'author_id' => 175,
                'quote_text' => 'What is a debt, anyway? A debt is just the perversion of a promise. It is a promise corrupted by both math and violence.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:35:55',
                'created_at' => '2017-07-25 21:35:33',
                'updated_at' => '2017-07-25 21:35:55',
                'deleted_at' => NULL,
            ),
            423 => 
            array (
                'id' => 1001923,
                'author_id' => 175,
                'quote_text' => 'As it turns out, we don\'t \'all\' have to pay our debts. Only some of us do.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:35:56',
                'created_at' => '2017-07-25 21:33:54',
                'updated_at' => '2017-07-25 21:35:56',
                'deleted_at' => NULL,
            ),
            424 => 
            array (
                'id' => 1001924,
                'author_id' => 175,
                'quote_text' => 'Money has no essence. It\'s not \'really\' anything; therefore, its nature has always been and presumably always will be a matter of political conten­tion.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:35:57',
                'created_at' => '2017-07-25 21:33:38',
                'updated_at' => '2017-07-25 21:35:57',
                'deleted_at' => NULL,
            ),
            425 => 
            array (
                'id' => 1001925,
                'author_id' => 188,
                'quote_text' => 'The most important lesson in entrepreneurship: Embrace the struggle.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:37:23',
                'created_at' => '2017-07-25 21:37:19',
                'updated_at' => '2017-07-25 21:37:23',
                'deleted_at' => NULL,
            ),
            426 => 
            array (
                'id' => 1001926,
                'author_id' => 188,
                'quote_text' => 'The one thing with stress is, you’ve got to keep your focus on what you can do, not what happened to you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:41:09',
                'created_at' => '2017-07-25 21:41:05',
                'updated_at' => '2017-07-25 21:41:09',
                'deleted_at' => NULL,
            ),
            427 => 
            array (
                'id' => 1001927,
                'author_id' => 188,
                'quote_text' => 'Spend zero time on what you could have done, and devote all of your time on what you might do.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:41:11',
                'created_at' => '2017-07-25 21:38:01',
                'updated_at' => '2017-07-25 21:41:11',
                'deleted_at' => NULL,
            ),
            428 => 
            array (
                'id' => 1001928,
                'author_id' => 188,
                'quote_text' => 'The only thing that prepares you to run a company, is running a company.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:42:02',
                'created_at' => '2017-07-25 21:41:57',
                'updated_at' => '2017-07-25 21:42:02',
                'deleted_at' => NULL,
            ),
            429 => 
            array (
                'id' => 1001929,
                'author_id' => 173,
                'quote_text' => 'If you don\'t drive your business, you will be driven out of business.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:43:58',
                'created_at' => '2017-07-25 21:43:55',
                'updated_at' => '2017-07-25 21:43:58',
                'deleted_at' => NULL,
            ),
            430 => 
            array (
                'id' => 1001930,
                'author_id' => 173,
                'quote_text' => 'What you have outside you counts less than what you have inside you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:44:00',
                'created_at' => '2017-07-25 21:43:42',
                'updated_at' => '2017-07-25 21:44:00',
                'deleted_at' => NULL,
            ),
            431 => 
            array (
                'id' => 1001931,
                'author_id' => 173,
                'quote_text' => 'The man who has done his level best... is a success, even though the world may write him down a failure.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:44:01',
                'created_at' => '2017-07-25 21:43:30',
                'updated_at' => '2017-07-25 21:44:01',
                'deleted_at' => NULL,
            ),
            432 => 
            array (
                'id' => 1001932,
                'author_id' => 173,
                'quote_text' => 'A shady business never yields a sunny life.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:44:02',
                'created_at' => '2017-07-25 21:43:21',
                'updated_at' => '2017-07-25 21:44:02',
                'deleted_at' => NULL,
            ),
            433 => 
            array (
                'id' => 1001933,
                'author_id' => 173,
                'quote_text' => 'It is only the farmer who faithfully plants seeds in the Spring, who reaps a harvest in the Autumn.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:44:03',
                'created_at' => '2017-07-25 21:43:12',
                'updated_at' => '2017-07-25 21:44:03',
                'deleted_at' => NULL,
            ),
            434 => 
            array (
                'id' => 1001934,
                'author_id' => 173,
                'quote_text' => 'Difficulties should act as a tonic. They should spur us to greater exertion.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:44:04',
                'created_at' => '2017-07-25 21:42:59',
                'updated_at' => '2017-07-25 21:44:04',
                'deleted_at' => NULL,
            ),
            435 => 
            array (
                'id' => 1001935,
                'author_id' => 173,
                'quote_text' => 'Work is the meat of life, pleasure the dessert.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:44:05',
                'created_at' => '2017-07-25 21:42:48',
                'updated_at' => '2017-07-25 21:44:05',
                'deleted_at' => NULL,
            ),
            436 => 
            array (
                'id' => 1001936,
                'author_id' => 173,
                'quote_text' => 'Better to be occasionally cheated than perpetually suspicious.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:44:07',
                'created_at' => '2017-07-25 21:42:38',
                'updated_at' => '2017-07-25 21:44:07',
                'deleted_at' => NULL,
            ),
            437 => 
            array (
                'id' => 1001937,
                'author_id' => 193,
                'quote_text' => 'It is easier to make progress on mega-ambitious dreams. Since no one else is crazy enough to do it, you have little competition.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:47:45',
                'created_at' => '2017-07-25 21:47:22',
                'updated_at' => '2017-07-25 21:47:45',
                'deleted_at' => NULL,
            ),
            438 => 
            array (
                'id' => 1001938,
                'author_id' => 193,
                'quote_text' => 'It’s very hard to fail completely if you aim high enough.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:47:46',
                'created_at' => '2017-07-25 21:46:43',
                'updated_at' => '2017-07-25 21:47:46',
                'deleted_at' => NULL,
            ),
            439 => 
            array (
                'id' => 1001939,
                'author_id' => 193,
                'quote_text' => 'Have a healthy disregard for the impossible.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:47:47',
                'created_at' => '2017-07-25 21:46:12',
                'updated_at' => '2017-07-25 21:47:47',
                'deleted_at' => NULL,
            ),
            440 => 
            array (
                'id' => 1001940,
                'author_id' => 193,
                'quote_text' => 'Always deliver more than expected.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:47:48',
                'created_at' => '2017-07-25 21:45:54',
                'updated_at' => '2017-07-25 21:47:48',
                'deleted_at' => NULL,
            ),
            441 => 
            array (
                'id' => 1001941,
                'author_id' => 193,
                'quote_text' => 'If you’re changing the world, you’re working on important things. You’re excited to get up in the morning.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:47:50',
                'created_at' => '2017-07-25 21:45:45',
                'updated_at' => '2017-07-25 21:47:50',
                'deleted_at' => NULL,
            ),
            442 => 
            array (
                'id' => 1001942,
                'author_id' => 193,
                'quote_text' => 'Lots of companies don’t succeed over time. What do they fundamentally do wrong? They usually miss the future.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:47:51',
                'created_at' => '2017-07-25 21:45:34',
                'updated_at' => '2017-07-25 21:47:51',
                'deleted_at' => NULL,
            ),
            443 => 
            array (
                'id' => 1001943,
                'author_id' => 194,
                'quote_text' => 'Coming up with an idea is the least important part of creating something great. It has to be the right idea and have good taste, but the execution and delivery are what’s key.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:48:49',
                'created_at' => '2017-07-25 21:48:46',
                'updated_at' => '2017-07-25 21:48:49',
                'deleted_at' => NULL,
            ),
            444 => 
            array (
                'id' => 1001944,
                'author_id' => 194,
                'quote_text' => 'Any conversation I have about innovation starts with the ultimate goal.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:48:51',
                'created_at' => '2017-07-25 21:48:17',
                'updated_at' => '2017-07-25 21:48:51',
                'deleted_at' => NULL,
            ),
            445 => 
            array (
                'id' => 1001945,
                'author_id' => 26,
                'quote_text' => 'You were born to win, but to be a winner, you must plan to win, prepare to win, and expect to win.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:36',
                'created_at' => '2017-07-25 21:51:31',
                'updated_at' => '2017-07-25 21:51:36',
                'deleted_at' => NULL,
            ),
            446 => 
            array (
                'id' => 1001946,
                'author_id' => 26,
                'quote_text' => 'You can get everything in life you want if you will just help enough other people get what they want.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:37',
                'created_at' => '2017-07-25 21:51:22',
                'updated_at' => '2017-07-25 21:51:37',
                'deleted_at' => NULL,
            ),
            447 => 
            array (
                'id' => 1001947,
                'author_id' => 26,
                'quote_text' => 'People often say that motivation doesn\'t last. Well, neither does bathing - that\'s why we recommend it daily.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:38',
                'created_at' => '2017-07-25 21:51:09',
                'updated_at' => '2017-07-25 21:51:38',
                'deleted_at' => NULL,
            ),
            448 => 
            array (
                'id' => 1001948,
                'author_id' => 26,
                'quote_text' => 'Remember that failure is an event, not a person.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:39',
                'created_at' => '2017-07-25 21:51:00',
                'updated_at' => '2017-07-25 21:51:39',
                'deleted_at' => NULL,
            ),
            449 => 
            array (
                'id' => 1001949,
                'author_id' => 26,
                'quote_text' => 'Your attitude, not your aptitude, will determine your altitude.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:40',
                'created_at' => '2017-07-25 21:50:52',
                'updated_at' => '2017-07-25 21:51:40',
                'deleted_at' => NULL,
            ),
            450 => 
            array (
                'id' => 1001950,
                'author_id' => 26,
                'quote_text' => 'If you learn from defeat, you haven\'t really lost.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:41',
                'created_at' => '2017-07-25 21:50:42',
                'updated_at' => '2017-07-25 21:51:41',
                'deleted_at' => NULL,
            ),
            451 => 
            array (
                'id' => 1001951,
                'author_id' => 26,
                'quote_text' => 'What you get by achieving your goals is not as important as what you become by achieving your goals.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:43',
                'created_at' => '2017-07-25 21:50:34',
                'updated_at' => '2017-07-25 21:51:43',
                'deleted_at' => NULL,
            ),
            452 => 
            array (
                'id' => 1001952,
                'author_id' => 26,
                'quote_text' => 'Expect the best. Prepare for the worst. Capitalize on what comes.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:44',
                'created_at' => '2017-07-25 21:50:24',
                'updated_at' => '2017-07-25 21:51:44',
                'deleted_at' => NULL,
            ),
            453 => 
            array (
                'id' => 1001953,
                'author_id' => 26,
                'quote_text' => 'A goal properly set is halfway reached.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:45',
                'created_at' => '2017-07-25 21:50:16',
                'updated_at' => '2017-07-25 21:51:45',
                'deleted_at' => NULL,
            ),
            454 => 
            array (
                'id' => 1001954,
                'author_id' => 26,
                'quote_text' => 'Positive thinking will let you do everything better than negative thinking will.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:51:46',
                'created_at' => '2017-07-25 21:50:08',
                'updated_at' => '2017-07-25 21:51:46',
                'deleted_at' => NULL,
            ),
            455 => 
            array (
                'id' => 1001955,
                'author_id' => 186,
                'quote_text' => 'Being idealistic really helps you overcome some of the many obstacles put in your path.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:52:42',
                'created_at' => '2017-07-25 21:52:38',
                'updated_at' => '2017-07-25 21:52:42',
                'deleted_at' => NULL,
            ),
            456 => 
            array (
                'id' => 1001956,
                'author_id' => 36,
                'quote_text' => 'Great leaders focus on equipping their team. It is unfair to expect what you did not equip.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:54:25',
                'created_at' => '2017-07-25 21:54:13',
                'updated_at' => '2017-07-25 21:54:25',
                'deleted_at' => NULL,
            ),
            457 => 
            array (
                'id' => 1001957,
                'author_id' => 36,
                'quote_text' => 'Being an adult is the ability to postpone a want for the sake of a family need.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:54:26',
                'created_at' => '2017-07-25 21:53:59',
                'updated_at' => '2017-07-25 21:54:26',
                'deleted_at' => NULL,
            ),
            458 => 
            array (
                'id' => 1001958,
                'author_id' => 36,
                'quote_text' => 'Your retirement is an opportunity to live out your dreams and take care of your family. Don’t leave it to chance.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:54:28',
                'created_at' => '2017-07-25 21:53:46',
                'updated_at' => '2017-07-25 21:54:28',
                'deleted_at' => NULL,
            ),
            459 => 
            array (
                'id' => 1001959,
                'author_id' => 36,
                'quote_text' => 'Arrival at a new destination only occurs from leaving your current location.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:54:29',
                'created_at' => '2017-07-25 21:53:32',
                'updated_at' => '2017-07-25 21:54:29',
                'deleted_at' => NULL,
            ),
            460 => 
            array (
                'id' => 1001960,
                'author_id' => 35,
                'quote_text' => 'In order to be a great marketer, you have to be focused and intense and look at scarcity, urgency, activity and passion in the marketplace.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:59:07',
                'created_at' => '2017-07-25 21:58:33',
                'updated_at' => '2017-07-25 21:59:07',
                'deleted_at' => NULL,
            ),
            461 => 
            array (
                'id' => 1001961,
                'author_id' => 35,
                'quote_text' => 'This is a great time for the \'guerilla marketer.\' The days when you used to have to buy expensive TV time and a yellow page ad to get started are gone.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:59:08',
                'created_at' => '2017-07-25 21:57:53',
                'updated_at' => '2017-07-25 21:59:08',
                'deleted_at' => NULL,
            ),
            462 => 
            array (
                'id' => 1001962,
                'author_id' => 35,
                'quote_text' => 'People are in such a hurry to launch their product or business that they seldom look at marketing from a bird\'s eye view and they don\'t create a systematic plan.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-25 21:59:10',
                'created_at' => '2017-07-25 21:56:19',
                'updated_at' => '2017-07-25 21:59:10',
                'deleted_at' => NULL,
            ),
            463 => 
            array (
                'id' => 1001963,
                'author_id' => 246,
                'quote_text' => 'Lead me, follow me, or get out of my way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:15:25',
                'created_at' => '2017-07-26 01:15:21',
                'updated_at' => '2017-07-26 01:15:25',
                'deleted_at' => NULL,
            ),
            464 => 
            array (
                'id' => 1001964,
                'author_id' => 247,
                'quote_text' => 'I start with the premise that the function of leadership is to produce more leaders, not more followers.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:16:22',
                'created_at' => '2017-07-26 01:16:18',
                'updated_at' => '2017-07-26 01:16:22',
                'deleted_at' => NULL,
            ),
            465 => 
            array (
                'id' => 1001965,
                'author_id' => 81,
                'quote_text' => 'The best executive is the one who has sense enough to pick good men to do what he wants done, and self-restraint enough to keep from meddling with them while they do it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:17:05',
                'created_at' => '2017-07-26 01:17:01',
                'updated_at' => '2017-07-26 01:17:05',
                'deleted_at' => NULL,
            ),
            466 => 
            array (
                'id' => 1001966,
                'author_id' => 39,
                'quote_text' => 'The challenge of leadership is to be strong, but not rude; be kind, but not weak; be bold, but not bully; be thoughtful, but not lazy; be humble, but not timid; be proud, but not arrogant; have humor, but without folly.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:19:42',
                'created_at' => '2017-07-26 01:19:38',
                'updated_at' => '2017-07-26 01:19:42',
                'deleted_at' => NULL,
            ),
            467 => 
            array (
                'id' => 1001967,
                'author_id' => 33,
                'quote_text' => 'Outstanding leaders go out of their way to boost the self-esteem of their personnel. If people believe in themselves, it\'s amazing what they can accomplish.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:20:07',
                'created_at' => '2017-07-26 01:20:03',
                'updated_at' => '2017-07-26 01:20:07',
                'deleted_at' => NULL,
            ),
            468 => 
            array (
                'id' => 1001968,
                'author_id' => 249,
                'quote_text' => 'A true leader has the confidence to stand alone, the courage to make tough decisions, and the compassion to listen to the needs of others. He does not set out to be a leader, but becomes one by the equality of his actions and the integrity of his intent.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:21:17',
                'created_at' => '2017-07-26 01:21:13',
                'updated_at' => '2017-07-26 01:21:17',
                'deleted_at' => NULL,
            ),
            469 => 
            array (
                'id' => 1001969,
                'author_id' => 89,
                'quote_text' => 'Leadership is the art of getting someone else to do something you want done because he wants to do it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:21:40',
                'created_at' => '2017-07-26 01:21:35',
                'updated_at' => '2017-07-26 01:21:40',
                'deleted_at' => NULL,
            ),
            470 => 
            array (
                'id' => 1001970,
                'author_id' => 246,
                'quote_text' => 'Never tell people how to do things. Tell them what to do and they will surprise you with their ingenuity.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:22:16',
                'created_at' => '2017-07-26 01:22:12',
                'updated_at' => '2017-07-26 01:22:16',
                'deleted_at' => NULL,
            ),
            471 => 
            array (
                'id' => 1001971,
                'author_id' => 251,
                'quote_text' => 'Don\'t necessarily avoid sharp edges. Occasionally they are necessary to leadership.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:23:55',
                'created_at' => '2017-07-26 01:23:50',
                'updated_at' => '2017-07-26 01:23:55',
                'deleted_at' => NULL,
            ),
            472 => 
            array (
                'id' => 1001972,
                'author_id' => 248,
                'quote_text' => 'The key to successful leadership today is influence, not authority.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:24:17',
                'created_at' => '2017-07-26 01:19:08',
                'updated_at' => '2017-07-26 01:24:17',
                'deleted_at' => NULL,
            ),
            473 => 
            array (
                'id' => 1001973,
                'author_id' => 250,
                'quote_text' => 'A man who wants to lead the orchestra must turn his back on the crowd.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:24:24',
                'created_at' => '2017-07-26 01:22:56',
                'updated_at' => '2017-07-26 01:24:24',
                'deleted_at' => NULL,
            ),
            474 => 
            array (
                'id' => 1001974,
                'author_id' => 45,
                'quote_text' => 'Effective leadership is putting first things first. Effective management is discipline, carrying it out.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:24:45',
                'created_at' => '2017-07-26 01:24:41',
                'updated_at' => '2017-07-26 01:24:45',
                'deleted_at' => NULL,
            ),
            475 => 
            array (
                'id' => 1001975,
                'author_id' => 252,
                'quote_text' => 'Great leaders are almost always great simplifiers, who can cut through argument, debate, and doubt to offer a solution everybody can understand.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:25:39',
                'created_at' => '2017-07-26 01:25:35',
                'updated_at' => '2017-07-26 01:25:39',
                'deleted_at' => NULL,
            ),
            476 => 
            array (
                'id' => 1001976,
                'author_id' => 253,
                'quote_text' => 'He who has great power should use it lightly.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:26:33',
                'created_at' => '2017-07-26 01:26:30',
                'updated_at' => '2017-07-26 01:26:33',
                'deleted_at' => NULL,
            ),
            477 => 
            array (
                'id' => 1001977,
                'author_id' => 167,
                'quote_text' => 'If one is lucky, a solitary fantasy can totally transform one million realities.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:27:08',
                'created_at' => '2017-07-26 01:27:04',
                'updated_at' => '2017-07-26 01:27:08',
                'deleted_at' => NULL,
            ),
            478 => 
            array (
                'id' => 1001978,
                'author_id' => 255,
                'quote_text' => 'Lead and inspire people. Don’t try to manage and manipulate people. Inventories can be managed but people must be lead.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:29:15',
                'created_at' => '2017-07-26 01:29:11',
                'updated_at' => '2017-07-26 01:29:15',
                'deleted_at' => NULL,
            ),
            479 => 
            array (
                'id' => 1001979,
                'author_id' => 254,
                'quote_text' => 'It is better to lead from behind and to put others in front, especially when you celebrate victory when nice things occur. You take the front line when there is danger. Then people will appreciate your leadership.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:29:33',
                'created_at' => '2017-07-26 01:29:29',
                'updated_at' => '2017-07-26 01:29:33',
                'deleted_at' => NULL,
            ),
            480 => 
            array (
                'id' => 1001980,
                'author_id' => 256,
                'quote_text' => 'Leadership cannot just go along to get along. Leadership must meet the moral challenge of the day.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:30:20',
                'created_at' => '2017-07-26 01:30:17',
                'updated_at' => '2017-07-26 01:30:20',
                'deleted_at' => NULL,
            ),
            481 => 
            array (
                'id' => 1001981,
                'author_id' => 252,
                'quote_text' => 'Leadership is solving problems. The day soldiers stop bringing you their problems is the day you have stopped leading them. They have either lost confidence that you can help or concluded you do not care. Either case is a failure of leadership.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:31:38',
                'created_at' => '2017-07-26 01:31:35',
                'updated_at' => '2017-07-26 01:31:39',
                'deleted_at' => NULL,
            ),
            482 => 
            array (
                'id' => 1001982,
                'author_id' => 45,
                'quote_text' => 'What you do has far greater impact than what you say.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:32:37',
                'created_at' => '2017-07-26 01:32:34',
                'updated_at' => '2017-07-26 01:32:37',
                'deleted_at' => NULL,
            ),
            483 => 
            array (
                'id' => 1001983,
                'author_id' => 45,
                'quote_text' => 'Management is efficiency in climbing the ladder of success; leadership determines whether the ladder is leaning against the right wall.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:32:38',
                'created_at' => '2017-07-26 01:32:22',
                'updated_at' => '2017-07-26 01:32:38',
                'deleted_at' => NULL,
            ),
            484 => 
            array (
                'id' => 1001984,
                'author_id' => 248,
                'quote_text' => 'The greatest leaders mobilize others by coalescing people around a shared vision.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:33:03',
                'created_at' => '2017-07-26 01:32:59',
                'updated_at' => '2017-07-26 01:33:03',
                'deleted_at' => NULL,
            ),
            485 => 
            array (
                'id' => 1001985,
                'author_id' => 246,
                'quote_text' => 'A good plan violently executed now is better than a perfect plan executed next week.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:33:43',
                'created_at' => '2017-07-26 01:33:39',
                'updated_at' => '2017-07-26 01:33:43',
                'deleted_at' => NULL,
            ),
            486 => 
            array (
                'id' => 1001986,
                'author_id' => 23,
                'quote_text' => 'Earn your leadership every day.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 01:34:09',
                'created_at' => '2017-07-26 01:34:06',
                'updated_at' => '2017-07-26 01:34:09',
                'deleted_at' => NULL,
            ),
            487 => 
            array (
                'id' => 1001987,
                'author_id' => 257,
                'quote_text' => 'To have long term success as a coach or in any position of leadership, you have to be obsessed in some way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:07:19',
                'created_at' => '2017-07-26 03:07:16',
                'updated_at' => '2017-07-26 03:07:19',
                'deleted_at' => NULL,
            ),
            488 => 
            array (
                'id' => 1001988,
                'author_id' => 258,
                'quote_text' => 'Leaders aren\'t born, they are made. And they are made just like anything else, through hard work. And that\'s the price we\'ll have to pay to achieve that goal, or any goal.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:08:40',
                'created_at' => '2017-07-26 03:08:36',
                'updated_at' => '2017-07-26 03:08:40',
                'deleted_at' => NULL,
            ),
            489 => 
            array (
                'id' => 1001989,
                'author_id' => 259,
                'quote_text' => 'Ability is what you’re capable of doing. Motivation determines what you do. Attitude determines how well you do it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:11:05',
                'created_at' => '2017-07-26 03:11:01',
                'updated_at' => '2017-07-26 03:11:05',
                'deleted_at' => NULL,
            ),
            490 => 
            array (
                'id' => 1001990,
                'author_id' => 260,
                'quote_text' => 'Leadership is a matter of having people look at you and gain confidence…If you’re in control, they’re in control.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:12:01',
                'created_at' => '2017-07-26 03:11:56',
                'updated_at' => '2017-07-26 03:12:01',
                'deleted_at' => NULL,
            ),
            491 => 
            array (
                'id' => 1001991,
                'author_id' => 261,
                'quote_text' => 'Success isn’t measured by money or power or social rank. Success is measured by your discipline and inner peace.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:12:48',
                'created_at' => '2017-07-26 03:12:45',
                'updated_at' => '2017-07-26 03:12:48',
                'deleted_at' => NULL,
            ),
            492 => 
            array (
                'id' => 1001992,
                'author_id' => 262,
                'quote_text' => 'Self-praise is for losers. Be a winner. Stand for something. Always have class, and be humble.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:13:23',
                'created_at' => '2017-07-26 03:13:19',
                'updated_at' => '2017-07-26 03:13:23',
                'deleted_at' => NULL,
            ),
            493 => 
            array (
                'id' => 1001993,
                'author_id' => 263,
                'quote_text' => 'If you are afraid of confrontation, you are not going to do very well.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:14:08',
                'created_at' => '2017-07-26 03:14:03',
                'updated_at' => '2017-07-26 03:14:08',
                'deleted_at' => NULL,
            ),
            494 => 
            array (
                'id' => 1001994,
                'author_id' => 264,
                'quote_text' => 'The difference between ordinary and extraordinary is that little extra.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:17:42',
                'created_at' => '2017-07-26 03:14:47',
                'updated_at' => '2017-07-26 03:17:42',
                'deleted_at' => NULL,
            ),
            495 => 
            array (
                'id' => 1001995,
                'author_id' => 265,
                'quote_text' => 'Stats are for losers. They relish in them.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:26:17',
                'created_at' => '2017-07-26 03:24:00',
                'updated_at' => '2017-07-26 03:26:17',
                'deleted_at' => NULL,
            ),
            496 => 
            array (
                'id' => 1001996,
                'author_id' => 266,
                'quote_text' => 'The superior man blames himself. The inferior man blames others.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:26:35',
                'created_at' => '2017-07-26 03:26:31',
                'updated_at' => '2017-07-26 03:26:35',
                'deleted_at' => NULL,
            ),
            497 => 
            array (
                'id' => 1001997,
                'author_id' => 267,
                'quote_text' => 'Confidence is a very fragile thing, and it certainly is something that has to start with your mental approach and your ability to respond and stay focused and not allow negative thoughts to enter into your own mind. When you’re successful, it’s easier to expect success. All of a sudden it’s not there, it becomes more of a challenge.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:27:12',
                'created_at' => '2017-07-26 03:27:09',
                'updated_at' => '2017-07-26 03:27:12',
                'deleted_at' => NULL,
            ),
            498 => 
            array (
                'id' => 1001998,
                'author_id' => 268,
                'quote_text' => 'Failures are expected by losers, ignored by winners.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:27:51',
                'created_at' => '2017-07-26 03:27:48',
                'updated_at' => '2017-07-26 03:27:51',
                'deleted_at' => NULL,
            ),
            499 => 
            array (
                'id' => 1001999,
                'author_id' => 269,
                'quote_text' => 'When you win, say nothing. When you lose, say less.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:28:25',
