        \DB::table('quotes')->insert(array (
            0 => 
            array (
                'id' => 1002000,
                'author_id' => 270,
                'quote_text' => 'My philosophy? Simplicity plus variety',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:29:05',
                'created_at' => '2017-07-26 03:29:02',
                'updated_at' => '2017-07-26 03:29:05',
                'deleted_at' => NULL,
            ),
            1 => 
            array (
                'id' => 1002001,
                'author_id' => 271,
                'quote_text' => 'Adversity is an opportunity for heroism.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:29:47',
                'created_at' => '2017-07-26 03:29:44',
                'updated_at' => '2017-07-26 03:29:47',
                'deleted_at' => NULL,
            ),
            2 => 
            array (
                'id' => 1002002,
                'author_id' => 272,
                'quote_text' => 'I’ve observed that if individuals who prevail in a high competitive environment have any one thing in common besides success, it is failure—and their ability to overcome it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:30:24',
                'created_at' => '2017-07-26 03:30:20',
                'updated_at' => '2017-07-26 03:30:24',
                'deleted_at' => NULL,
            ),
            3 => 
            array (
                'id' => 1002003,
                'author_id' => 273,
                'quote_text' => 'Nobody who ever gave his best regretted it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:32:07',
                'created_at' => '2017-07-26 03:32:03',
                'updated_at' => '2017-07-26 03:32:07',
                'deleted_at' => NULL,
            ),
            4 => 
            array (
                'id' => 1002004,
                'author_id' => 274,
                'quote_text' => 'Stay focused. Your start does not determine how you’re going to finish.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:32:44',
                'created_at' => '2017-07-26 03:32:39',
                'updated_at' => '2017-07-26 03:32:44',
                'deleted_at' => NULL,
            ),
            5 => 
            array (
                'id' => 1002005,
                'author_id' => 275,
                'quote_text' => 'The secret to success is good leadership, and good leadership is all about making the lives of your team members or workers better.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:34:18',
                'created_at' => '2017-07-26 03:34:15',
                'updated_at' => '2017-07-26 03:34:18',
                'deleted_at' => NULL,
            ),
            6 => 
            array (
                'id' => 1002006,
                'author_id' => 275,
                'quote_text' => 'It\'s just really making sure I am doing the best job I can do as a dad. I do think that is my No. 1 job.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:34:20',
                'created_at' => '2017-07-26 03:34:04',
                'updated_at' => '2017-07-26 03:34:20',
                'deleted_at' => NULL,
            ),
            7 => 
            array (
                'id' => 1002007,
                'author_id' => 275,
                'quote_text' => 'If you want to make a difference in the lives of the people you lead, you must be willing to walk alongside them, to lift and encourage them, to share moments of understanding with them, and to spend time with them, not just shout down at them from on high.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:34:55',
                'created_at' => '2017-07-26 03:34:52',
                'updated_at' => '2017-07-26 03:34:55',
                'deleted_at' => NULL,
            ),
            8 => 
            array (
                'id' => 1002008,
                'author_id' => 275,
                'quote_text' => 'If we lose sight of people, we lose sight of the very purpose of leadership.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:37:28',
                'created_at' => '2017-07-26 03:36:54',
                'updated_at' => '2017-07-26 03:37:28',
                'deleted_at' => NULL,
            ),
            9 => 
            array (
                'id' => 1002009,
                'author_id' => 275,
                'quote_text' => 'It\'s the journey that matters. Learning is more important than the test. Practice well, and the games will take care of themselves.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:37:29',
                'created_at' => '2017-07-26 03:36:40',
                'updated_at' => '2017-07-26 03:37:29',
                'deleted_at' => NULL,
            ),
            10 => 
            array (
                'id' => 1002010,
                'author_id' => 275,
                'quote_text' => 'Engage, educate, equip, encourage, empower, energize, and elevate. Those are the methods for maximizing the potential of any individual, team, organization, or institution for ultimate success and significance. Those are the methods of a mentor leader.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:37:30',
                'created_at' => '2017-07-26 03:36:07',
                'updated_at' => '2017-07-26 03:37:30',
                'deleted_at' => NULL,
            ),
            11 => 
            array (
                'id' => 1002011,
                'author_id' => 275,
                'quote_text' => 'It\'s about the journey--mine and yours--and the lives we can touch, the legacy we can leave, and the world we can change for the better.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:37:32',
                'created_at' => '2017-07-26 03:35:45',
                'updated_at' => '2017-07-26 03:37:32',
                'deleted_at' => NULL,
            ),
            12 => 
            array (
                'id' => 1002012,
                'author_id' => 275,
                'quote_text' => 'Integrity doesn\'t come in degrees: low, medium, or high. You either have integrity or you don\'t.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:37:33',
                'created_at' => '2017-07-26 03:35:25',
                'updated_at' => '2017-07-26 03:37:33',
                'deleted_at' => NULL,
            ),
            13 => 
            array (
                'id' => 1002013,
                'author_id' => 275,
                'quote_text' => 'You can’t always control circumstances. However, you can always control your attitude, approach, and response.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:37:34',
                'created_at' => '2017-07-26 03:35:13',
                'updated_at' => '2017-07-26 03:37:34',
                'deleted_at' => NULL,
            ),
            14 => 
            array (
                'id' => 1002014,
                'author_id' => 276,
                'quote_text' => 'You fail all the time, but you aren’t a failure until you start blaming someone else.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:38:15',
                'created_at' => '2017-07-26 03:38:12',
                'updated_at' => '2017-07-26 03:38:15',
                'deleted_at' => NULL,
            ),
            15 => 
            array (
                'id' => 1002015,
                'author_id' => 277,
                'quote_text' => 'Try not to do too many things at once. Know what you want, the number one thing today and tomorrow. Persevere and get it done.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:38:50',
                'created_at' => '2017-07-26 03:38:47',
                'updated_at' => '2017-07-26 03:38:50',
                'deleted_at' => NULL,
            ),
            16 => 
            array (
                'id' => 1002016,
                'author_id' => 278,
                'quote_text' => 'If you want to win, do the ordinary things better than anyone else does them day in and day out.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:39:28',
                'created_at' => '2017-07-26 03:39:25',
                'updated_at' => '2017-07-26 03:39:28',
                'deleted_at' => NULL,
            ),
            17 => 
            array (
                'id' => 1002017,
                'author_id' => 279,
                'quote_text' => 'Excuses are the tools of the incompetent.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:40:16',
                'created_at' => '2017-07-26 03:40:11',
                'updated_at' => '2017-07-26 03:40:16',
                'deleted_at' => NULL,
            ),
            18 => 
            array (
                'id' => 1002018,
                'author_id' => 280,
                'quote_text' => 'On a team, it’s not the strength of the individual players, but it is the strength of the unit and how they all function together.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:42:25',
                'created_at' => '2017-07-26 03:42:21',
                'updated_at' => '2017-07-26 03:42:25',
                'deleted_at' => NULL,
            ),
            19 => 
            array (
                'id' => 1002019,
                'author_id' => 281,
                'quote_text' => 'Winning isn\'t getting ahead of others. It\'s getting ahead of yourself.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:45:45',
                'created_at' => '2017-07-26 03:45:41',
                'updated_at' => '2017-07-26 03:45:45',
                'deleted_at' => NULL,
            ),
            20 => 
            array (
                'id' => 1002020,
                'author_id' => 282,
                'quote_text' => 'If you\'re not gonna go all the way, why go at all?',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 03:46:31',
                'created_at' => '2017-07-26 03:46:27',
                'updated_at' => '2017-07-26 03:46:31',
                'deleted_at' => NULL,
            ),
            21 => 
            array (
                'id' => 1002021,
                'author_id' => 343,
                'quote_text' => 'It takes time to figure out who you are.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:25:56',
                'created_at' => '2017-07-26 04:25:52',
                'updated_at' => '2017-07-26 04:25:56',
                'deleted_at' => NULL,
            ),
            22 => 
            array (
                'id' => 1002022,
                'author_id' => 343,
                'quote_text' => 'Before I was at MacLean hospital, if someone had said mental health to me, the first thing that came to mind was mental toughness, masking pain, hiding, keeping it in … that’s what was embedded in me since I was a kid. You know, never show a sign of weakness. And it’s funny, because now I know it’s the total opposite. It’s being able to have the strength to pick up the phone and ask someone for help.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:25:58',
                'created_at' => '2017-07-26 04:24:55',
                'updated_at' => '2017-07-26 04:25:58',
                'deleted_at' => NULL,
            ),
            23 => 
            array (
                'id' => 1002023,
                'author_id' => 343,
                'quote_text' => 'Football is easy; I’ve done this since I was a baby. To me, that’s not success. Success to me is being a world changer… I say football is my platform, not my purpose. How can I use my platform to fulfill my purpose? I want people to say that he fulfilled his purpose.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:29:53',
                'created_at' => '2017-07-26 04:29:47',
                'updated_at' => '2017-07-26 04:29:53',
                'deleted_at' => NULL,
            ),
            24 => 
            array (
                'id' => 1002024,
                'author_id' => 343,
                'quote_text' => 'I appreciate America for all the opportunities it\'s afforded me.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:34:58',
                'created_at' => '2017-07-26 04:31:17',
                'updated_at' => '2017-07-26 04:34:58',
                'deleted_at' => NULL,
            ),
            25 => 
            array (
                'id' => 1002025,
                'author_id' => 343,
                'quote_text' => 'Mind over Matter.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:35:21',
                'created_at' => '2017-07-26 04:35:15',
                'updated_at' => '2017-07-26 04:35:21',
                'deleted_at' => NULL,
            ),
            26 => 
            array (
                'id' => 1002026,
                'author_id' => 304,
                'quote_text' => 'Set goals – high goals for you and your organization. When your organization has a goal to shoot for, you create teamwork, people working for a common good.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:40:39',
                'created_at' => '2017-07-26 04:40:35',
                'updated_at' => '2017-07-26 04:40:39',
                'deleted_at' => NULL,
            ),
            27 => 
            array (
                'id' => 1002027,
                'author_id' => 304,
                'quote_text' => 'Don’t give up at halftime. Concentrate on winning the second half.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:41:37',
                'created_at' => '2017-07-26 04:41:33',
                'updated_at' => '2017-07-26 04:41:37',
                'deleted_at' => NULL,
            ),
            28 => 
            array (
                'id' => 1002028,
                'author_id' => 304,
                'quote_text' => 'Be aware of \'yes\' men. Generally, they are losers. Surround yourself with winners. Never forget – people win.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:42:51',
                'created_at' => '2017-07-26 04:42:47',
                'updated_at' => '2017-07-26 04:42:51',
                'deleted_at' => NULL,
            ),
            29 => 
            array (
                'id' => 1002029,
                'author_id' => 304,
                'quote_text' => 'In life, you’ll have your back up against the wall many times. You might as well get used to it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:42:53',
                'created_at' => '2017-07-26 04:42:27',
                'updated_at' => '2017-07-26 04:42:53',
                'deleted_at' => NULL,
            ),
            30 => 
            array (
                'id' => 1002030,
                'author_id' => 304,
                'quote_text' => 'It’s awfully important to win with humility. It’s also important to lose. I hate to lose worse than anyone, but if you never lose you won’t know how to act. If you lose with humility, then you can come back.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:42:54',
                'created_at' => '2017-07-26 04:42:14',
                'updated_at' => '2017-07-26 04:42:54',
                'deleted_at' => NULL,
            ),
            31 => 
            array (
                'id' => 1002031,
                'author_id' => 304,
                'quote_text' => 'Sacrifice. Work. Self-discipline. I teach these things, and my boys don’t forget them when they leave.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:42:55',
                'created_at' => '2017-07-26 04:41:23',
                'updated_at' => '2017-07-26 04:42:55',
                'deleted_at' => NULL,
            ),
            32 => 
            array (
                'id' => 1002032,
                'author_id' => 304,
            'quote_text' => 'The old lessons (work, self-discipline, sacrifice, teamwork, fighting to achieve) aren’t being taught by many people other than football coaches these days. The football coach has a captive audience and can teach these lessons because the communication lines between himself and his players are more wide open than between kids and parents. We better teach these lessons or else the country’s future population will be made up of a majority of crooks, drug addicts, or people on relief.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:42:56',
                'created_at' => '2017-07-26 04:41:13',
                'updated_at' => '2017-07-26 04:42:56',
                'deleted_at' => NULL,
            ),
            33 => 
            array (
                'id' => 1002033,
                'author_id' => 304,
                'quote_text' => 'If wanting to win is a fault, as some of my critics seem to insist, then I plead guilty. I like to win. I know no other way. It’s in my blood.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:42:58',
                'created_at' => '2017-07-26 04:40:22',
                'updated_at' => '2017-07-26 04:42:58',
                'deleted_at' => NULL,
            ),
            34 => 
            array (
                'id' => 1002034,
                'author_id' => 304,
                'quote_text' => 'You must learn how to hold a team together. You must lift some men up, calm others down, until finally they’ve got one heartbeat. Then you’ve got yourself a team.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:42:59',
                'created_at' => '2017-07-26 04:40:13',
                'updated_at' => '2017-07-26 04:42:59',
                'deleted_at' => NULL,
            ),
            35 => 
            array (
                'id' => 1002035,
                'author_id' => 304,
                'quote_text' => 'The idea of molding men means a lot to me.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:00',
                'created_at' => '2017-07-26 04:40:04',
                'updated_at' => '2017-07-26 04:43:00',
                'deleted_at' => NULL,
            ),
            36 => 
            array (
                'id' => 1002036,
                'author_id' => 304,
                'quote_text' => 'I think the most important thing of all for any team is a winning attitude. The coaches must have it. The players must have it. The student body must have it. If you have dedicated players who believe in themselves, you don’t need a lot of talent.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:01',
                'created_at' => '2017-07-26 04:39:54',
                'updated_at' => '2017-07-26 04:43:01',
                'deleted_at' => NULL,
            ),
            37 => 
            array (
                'id' => 1002037,
                'author_id' => 304,
                'quote_text' => 'If a man is a quitter, I’d rather find out in practice than in a game. I ask for all a player has so I’ll know later what I can expect.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:02',
                'created_at' => '2017-07-26 04:39:47',
                'updated_at' => '2017-07-26 04:43:02',
                'deleted_at' => NULL,
            ),
            38 => 
            array (
                'id' => 1002038,
                'author_id' => 304,
                'quote_text' => 'If anything goes bad, I did it. If anything goes semi-good, we did it. If anything goes really good, then you did it. That’s all it takes to get people to win football games for you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:04',
                'created_at' => '2017-07-26 04:39:35',
                'updated_at' => '2017-07-26 04:43:04',
                'deleted_at' => NULL,
            ),
            39 => 
            array (
                'id' => 1002039,
                'author_id' => 304,
                'quote_text' => 'There’s a lot of blood, sweat, and guts between dreams and success.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:05',
                'created_at' => '2017-07-26 04:39:21',
                'updated_at' => '2017-07-26 04:43:05',
                'deleted_at' => NULL,
            ),
            40 => 
            array (
                'id' => 1002040,
                'author_id' => 304,
                'quote_text' => 'Never quit. It is the easiest cop-out in the world. Set a goal and don’t quit until you attain it. When you do attain it, set another goal, and don’t quit until you reach it. Never quit.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:06',
                'created_at' => '2017-07-26 04:39:08',
                'updated_at' => '2017-07-26 04:43:06',
                'deleted_at' => NULL,
            ),
            41 => 
            array (
                'id' => 1002041,
                'author_id' => 304,
                'quote_text' => 'I’m no miracle man. I guarantee nothing but hard work.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:07',
                'created_at' => '2017-07-26 04:38:57',
                'updated_at' => '2017-07-26 04:43:07',
                'deleted_at' => NULL,
            ),
            42 => 
            array (
                'id' => 1002042,
                'author_id' => 304,
                'quote_text' => 'Losing doesn’t make me want to quit. It makes me want to fight that much harder.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:09',
                'created_at' => '2017-07-26 04:38:47',
                'updated_at' => '2017-07-26 04:43:09',
                'deleted_at' => NULL,
            ),
            43 => 
            array (
                'id' => 1002043,
                'author_id' => 304,
                'quote_text' => 'I know what it takes to win. If I can sell them on what it takes to win, then we are not going to lose too many football games.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:43:10',
                'created_at' => '2017-07-26 04:38:34',
                'updated_at' => '2017-07-26 04:43:10',
                'deleted_at' => NULL,
            ),
            44 => 
            array (
                'id' => 1002044,
                'author_id' => 304,
                'quote_text' => 'Little things make the difference. Everyone is well prepared in the big things, but only the winners perfect the little things.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:45:06',
                'created_at' => '2017-07-26 04:45:02',
                'updated_at' => '2017-07-26 04:45:06',
                'deleted_at' => NULL,
            ),
            45 => 
            array (
                'id' => 1002045,
                'author_id' => 304,
                'quote_text' => 'The first time you quit, it’s hard. The second time, it gets easier. The third time, you don’t even have to think about it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:45:07',
                'created_at' => '2017-07-26 04:44:52',
                'updated_at' => '2017-07-26 04:45:07',
                'deleted_at' => NULL,
            ),
            46 => 
            array (
                'id' => 1002046,
                'author_id' => 304,
                'quote_text' => 'If you want to coach you have three rules to follow to win. One, surround yourself with people who can’t live without football. I’ve had a lot of them. Two, be able to recognize winners. They come in all forms. And, three, have a plan for everything. A plan for practice, a plan for the game. A plan for being ahead, and a plan for being behind 20-0 at half, with your quarterback hurt and the phones dead, with it raining cats and dogs and no rain gear because the equipment man left it at home.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:45:08',
                'created_at' => '2017-07-26 04:44:27',
                'updated_at' => '2017-07-26 04:45:08',
                'deleted_at' => NULL,
            ),
            47 => 
            array (
                'id' => 1002047,
                'author_id' => 304,
                'quote_text' => 'In a crisis, don’t hide behind anything or anybody. They’re going to find you anyway.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:45:10',
                'created_at' => '2017-07-26 04:43:59',
                'updated_at' => '2017-07-26 04:45:10',
                'deleted_at' => NULL,
            ),
            48 => 
            array (
                'id' => 1002048,
                'author_id' => 304,
                'quote_text' => 'The biggest mistake coaches make is taking borderline cases and trying to save them. I’m not talking about grades now, I’m talking about character. I want to know before a boy enrolls about his home life, and what his parents want him to be.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:45:11',
                'created_at' => '2017-07-26 04:43:40',
                'updated_at' => '2017-07-26 04:45:11',
                'deleted_at' => NULL,
            ),
            49 => 
            array (
                'id' => 1002049,
                'author_id' => 304,
                'quote_text' => 'If they don’t have a winning attitude, I don’t want them.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:47:53',
                'created_at' => '2017-07-26 04:47:49',
                'updated_at' => '2017-07-26 04:47:53',
                'deleted_at' => NULL,
            ),
            50 => 
            array (
                'id' => 1002050,
                'author_id' => 304,
                'quote_text' => 'I have tried to teach them to show class, to have pride, and to display character. I think football, winning games, takes care of itself if you do that.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:47:54',
                'created_at' => '2017-07-26 04:47:40',
                'updated_at' => '2017-07-26 04:47:54',
                'deleted_at' => NULL,
            ),
            51 => 
            array (
                'id' => 1002051,
                'author_id' => 304,
                'quote_text' => 'I always want my players to show class, knock’em down, pat on the back, and run back to the huddle.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:47:55',
                'created_at' => '2017-07-26 04:47:03',
                'updated_at' => '2017-07-26 04:47:55',
                'deleted_at' => NULL,
            ),
            52 => 
            array (
                'id' => 1002052,
                'author_id' => 304,
                'quote_text' => 'I have always tried to teach my players to be fighters. When I say that, I don’t mean put up your dukes and get in a fistfight over something. I’m talking about facing adversity in your life. There is not a person alive who isn’t going to have some awfully bad days in their lives. I tell my players that what I mean by fighting is when your house burns down, and your wife runs off with the drummer, and you’ve lost your job and all the odds are against you. What are you going to do? Most people just lay down and quit. Well, I want my people to fight back.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:47:56',
                'created_at' => '2017-07-26 04:46:50',
                'updated_at' => '2017-07-26 04:47:56',
                'deleted_at' => NULL,
            ),
            53 => 
            array (
                'id' => 1002053,
                'author_id' => 304,
                'quote_text' => 'When you make a mistake, there are only three things you should ever do about it: 1. Admit it. 2. Learn from it, and 3. Don’t repeat it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:47:57',
                'created_at' => '2017-07-26 04:46:16',
                'updated_at' => '2017-07-26 04:47:57',
                'deleted_at' => NULL,
            ),
            54 => 
            array (
                'id' => 1002054,
                'author_id' => 304,
                'quote_text' => 'We can’t have two standards, one set for the dedicated young men who want to do something ambitious and one set for those who don’t.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:47:59',
                'created_at' => '2017-07-26 04:46:09',
                'updated_at' => '2017-07-26 04:47:59',
                'deleted_at' => NULL,
            ),
            55 => 
            array (
                'id' => 1002055,
                'author_id' => 304,
                'quote_text' => 'People who are in it for their own good are individualists. They don’t share the same heartbeat that makes a team so great. A great unit, whether it be football or any organization, shares the same heartbeat.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:48:00',
                'created_at' => '2017-07-26 04:45:41',
                'updated_at' => '2017-07-26 04:48:00',
                'deleted_at' => NULL,
            ),
            56 => 
            array (
                'id' => 1002056,
                'author_id' => 304,
                'quote_text' => 'But there’s one thing about quitters you have to guard against – they are contagious. If one boy goes, the chances are he’ll take somebody with him, and you don’t want that. So when they would start acting that way, I used to pack them up and get them out, or embarrass them, or do something to turn them around.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:48:01',
                'created_at' => '2017-07-26 04:45:28',
                'updated_at' => '2017-07-26 04:48:01',
                'deleted_at' => NULL,
            ),
            57 => 
            array (
                'id' => 1002057,
                'author_id' => 304,
                'quote_text' => 'I ain’t never been nothin but a winner.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:50:21',
                'created_at' => '2017-07-26 04:50:16',
                'updated_at' => '2017-07-26 04:50:21',
                'deleted_at' => NULL,
            ),
            58 => 
            array (
                'id' => 1002058,
                'author_id' => 304,
                'quote_text' => 'It’s not the will to win that matters – everyone has that. It’s the will to prepare to win that matters.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:52:05',
                'created_at' => '2017-07-26 04:52:00',
                'updated_at' => '2017-07-26 04:52:05',
                'deleted_at' => NULL,
            ),
            59 => 
            array (
                'id' => 1002059,
                'author_id' => 304,
                'quote_text' => 'There’s no substitute for guts.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:54:00',
                'created_at' => '2017-07-26 04:53:55',
                'updated_at' => '2017-07-26 04:54:00',
                'deleted_at' => NULL,
            ),
            60 => 
            array (
                'id' => 1002060,
                'author_id' => 304,
                'quote_text' => 'Winning isn’t everything, but it beats anything that comes in second.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:54:01',
                'created_at' => '2017-07-26 04:53:36',
                'updated_at' => '2017-07-26 04:54:01',
                'deleted_at' => NULL,
            ),
            61 => 
            array (
                'id' => 1002061,
                'author_id' => 304,
                'quote_text' => 'If there is one thing that has helped me as a coach, it\'s my ability to recognize winners, or good people who can become winners by paying the price.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:57:32',
                'created_at' => '2017-07-26 04:57:28',
                'updated_at' => '2017-07-26 04:57:32',
                'deleted_at' => NULL,
            ),
            62 => 
            array (
                'id' => 1002062,
                'author_id' => 304,
                'quote_text' => 'A good, quick, small team can beat a big, slow team any time.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:57:34',
                'created_at' => '2017-07-26 04:56:27',
                'updated_at' => '2017-07-26 04:57:34',
                'deleted_at' => NULL,
            ),
            63 => 
            array (
                'id' => 1002063,
                'author_id' => 304,
                'quote_text' => 'Mama wanted me to be a preacher. I told her coachin\' and preachin\' were a lot alike.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:57:35',
                'created_at' => '2017-07-26 04:56:02',
                'updated_at' => '2017-07-26 04:57:35',
                'deleted_at' => NULL,
            ),
            64 => 
            array (
                'id' => 1002064,
                'author_id' => 304,
                'quote_text' => 'You\'re still going to win with preparation and dedication and plain old desire. If you don\'t have genuine desire, you won\'t be dedicated enough to prepare properly.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:57:36',
                'created_at' => '2017-07-26 04:55:34',
                'updated_at' => '2017-07-26 04:57:36',
                'deleted_at' => NULL,
            ),
            65 => 
            array (
                'id' => 1002065,
                'author_id' => 304,
                'quote_text' => 'There is a big difference in wanting to and willing to.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:57:38',
                'created_at' => '2017-07-26 04:55:18',
                'updated_at' => '2017-07-26 04:57:38',
                'deleted_at' => NULL,
            ),
            66 => 
            array (
                'id' => 1002066,
                'author_id' => 304,
                'quote_text' => 'You never know how a horse will pull until you hook him to a heavy load.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 04:57:39',
                'created_at' => '2017-07-26 04:54:52',
                'updated_at' => '2017-07-26 04:57:39',
                'deleted_at' => NULL,
            ),
            67 => 
            array (
                'id' => 1002067,
                'author_id' => 304,
                'quote_text' => 'When you get in the endzone act like you\'ve been there before.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:05:44',
                'created_at' => '2017-07-26 05:05:39',
                'updated_at' => '2017-07-26 05:05:44',
                'deleted_at' => NULL,
            ),
            68 => 
            array (
                'id' => 1002068,
                'author_id' => 304,
                'quote_text' => 'I don\'t hire anybody not brighter than I am. If they\'re not brighter than I am, I don\'t need them.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:05:46',
                'created_at' => '2017-07-26 04:59:56',
                'updated_at' => '2017-07-26 05:05:46',
                'deleted_at' => NULL,
            ),
            69 => 
            array (
                'id' => 1002069,
                'author_id' => 304,
                'quote_text' => 'A champion pays an extra price to be better than anyone else.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:05:47',
                'created_at' => '2017-07-26 04:58:36',
                'updated_at' => '2017-07-26 05:05:47',
                'deleted_at' => NULL,
            ),
            70 => 
            array (
                'id' => 1002070,
                'author_id' => 304,
                'quote_text' => 'Don\'t talk too much or too soon.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:05:48',
                'created_at' => '2017-07-26 04:58:18',
                'updated_at' => '2017-07-26 05:05:48',
                'deleted_at' => NULL,
            ),
            71 => 
            array (
                'id' => 1002071,
                'author_id' => 304,
                'quote_text' => 'In order to have a winner, the team must have a feeling of unity; every player must put the team first - ahead of personal glory.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:07:07',
                'created_at' => '2017-07-26 05:07:02',
                'updated_at' => '2017-07-26 05:07:07',
                'deleted_at' => NULL,
            ),
            72 => 
            array (
                'id' => 1002072,
                'author_id' => 23,
                'quote_text' => 'Some people want it to happen, some wish it would happen, others make it happen.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:13:38',
                'created_at' => '2017-07-26 05:13:34',
                'updated_at' => '2017-07-26 05:13:38',
                'deleted_at' => NULL,
            ),
            73 => 
            array (
                'id' => 1002073,
                'author_id' => 286,
                'quote_text' => 'To do things you’ve never done before, you have to do things you’ve never done before.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:14:25',
                'created_at' => '2017-07-26 05:14:21',
                'updated_at' => '2017-07-26 05:14:25',
                'deleted_at' => NULL,
            ),
            74 => 
            array (
                'id' => 1002074,
                'author_id' => 25,
                'quote_text' => 'Champions aren’t made in the gyms. Champions are made from something they have deep inside them — a desire, a dream, a vision.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:15:15',
                'created_at' => '2017-07-26 05:15:10',
                'updated_at' => '2017-07-26 05:15:15',
                'deleted_at' => NULL,
            ),
            75 => 
            array (
                'id' => 1002075,
                'author_id' => 257,
                'quote_text' => 'There’s always the motivation of wanting to win. Everybody has that. But a champion needs, in his attitude, a motivation above and beyond winning.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:16:23',
                'created_at' => '2017-07-26 05:16:17',
                'updated_at' => '2017-07-26 05:16:23',
                'deleted_at' => NULL,
            ),
            76 => 
            array (
                'id' => 1002076,
                'author_id' => 322,
                'quote_text' => 'Leadership, like coaching, is fighting for the hearts and souls of men and getting them to believe in you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:17:34',
                'created_at' => '2017-07-26 05:17:27',
                'updated_at' => '2017-07-26 05:17:34',
                'deleted_at' => NULL,
            ),
            77 => 
            array (
                'id' => 1002077,
                'author_id' => 23,
                'quote_text' => 'Talent wins games, but teamwork and intelligence wins championships.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:18:46',
                'created_at' => '2017-07-26 05:18:43',
                'updated_at' => '2017-07-26 05:18:46',
                'deleted_at' => NULL,
            ),
            78 => 
            array (
                'id' => 1002078,
                'author_id' => 319,
                'quote_text' => 'One man practicing sportsmanship is far better than 50 preaching it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:21:16',
                'created_at' => '2017-07-26 05:21:13',
                'updated_at' => '2017-07-26 05:21:16',
                'deleted_at' => NULL,
            ),
            79 => 
            array (
                'id' => 1002079,
                'author_id' => 271,
                'quote_text' => 'Persistence can change failure into extraordinary achievement.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:22:01',
                'created_at' => '2017-07-26 05:21:57',
                'updated_at' => '2017-07-26 05:22:01',
                'deleted_at' => NULL,
            ),
            80 => 
            array (
                'id' => 1002080,
                'author_id' => 260,
                'quote_text' => 'I’ve learned that something constructive comes from every defeat.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:22:40',
                'created_at' => '2017-07-26 05:22:37',
                'updated_at' => '2017-07-26 05:22:40',
                'deleted_at' => NULL,
            ),
            81 => 
            array (
                'id' => 1002081,
                'author_id' => 23,
                'quote_text' => 'You have to expect things of yourself before you can do them.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:24:55',
                'created_at' => '2017-07-26 05:24:51',
                'updated_at' => '2017-07-26 05:24:55',
                'deleted_at' => NULL,
            ),
            82 => 
            array (
                'id' => 1002082,
                'author_id' => 257,
                'quote_text' => 'Excellence is the gradual result of always striving to do better.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:25:54',
                'created_at' => '2017-07-26 05:25:51',
                'updated_at' => '2017-07-26 05:25:54',
                'deleted_at' => NULL,
            ),
            83 => 
            array (
                'id' => 1002083,
                'author_id' => 220,
                'quote_text' => 'You wouldn’t have won if we’d beaten you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:31:24',
                'created_at' => '2017-07-26 05:31:20',
                'updated_at' => '2017-07-26 05:31:24',
                'deleted_at' => NULL,
            ),
            84 => 
            array (
                'id' => 1002084,
                'author_id' => 258,
                'quote_text' => 'Coaches who can outline plays on a blackboard are a dime a dozen. The ones who win get inside their players and motivate.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:33:10',
                'created_at' => '2017-07-26 05:32:37',
                'updated_at' => '2017-07-26 05:32:43',
                'deleted_at' => NULL,
            ),
            85 => 
            array (
                'id' => 1002085,
                'author_id' => 25,
                'quote_text' => 'It isn\'t the mountain ahead to climb that wear you out; it\'s the pebble in your shoe.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 05:41:00',
                'created_at' => '2017-07-26 05:40:56',
                'updated_at' => '2017-07-26 05:41:00',
                'deleted_at' => NULL,
            ),
            86 => 
            array (
                'id' => 1002086,
                'author_id' => 305,
                'quote_text' => 'Leaders create culture. Culture drives behavior. Behavior produces results.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:18:14',
                'created_at' => '2017-07-26 06:18:11',
                'updated_at' => '2017-07-26 06:18:14',
                'deleted_at' => NULL,
            ),
            87 => 
            array (
                'id' => 1002087,
                'author_id' => 305,
                'quote_text' => 'If you can raise the level of effort and performance in those around you, you are officially a leader.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:21:03',
                'created_at' => '2017-07-26 06:20:59',
                'updated_at' => '2017-07-26 06:21:03',
                'deleted_at' => NULL,
            ),
            88 => 
            array (
                'id' => 1002088,
                'author_id' => 305,
                'quote_text' => 'It is so easy to be average. It takes a little something to be special. Why be around average?',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:21:04',
                'created_at' => '2017-07-26 06:20:43',
                'updated_at' => '2017-07-26 06:21:04',
                'deleted_at' => NULL,
            ),
            89 => 
            array (
                'id' => 1002089,
                'author_id' => 305,
                'quote_text' => 'The true soldier fights not because he hates what is in front of him, but because he loves what is behind him.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:21:05',
                'created_at' => '2017-07-26 06:19:56',
                'updated_at' => '2017-07-26 06:21:05',
                'deleted_at' => NULL,
            ),
            90 => 
            array (
                'id' => 1002090,
                'author_id' => 305,
                'quote_text' => 'I’ve come to learn that leadership is not automatically granted to you because of your position or your salary or the size of your office. Leadership is influence based on trust that you have earned. A leader is not someone who declares what he wants and then gets angry when he doesn’t get it. A true leader is someone who is going someplace and taking people with him, a catalyst for elite performance who enables people to achieve things they wouldn’t achieve on their own. A leader is someone who earns trust, sets a clear standard, and then equips and inspires people to meet that standard.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:21:06',
                'created_at' => '2017-07-26 06:19:41',
                'updated_at' => '2017-07-26 06:21:06',
                'deleted_at' => NULL,
            ),
            91 => 
            array (
                'id' => 1002091,
                'author_id' => 305,
                'quote_text' => 'Average leaders have quotes. Good leaders have a plan. Exceptional leaders have a system.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:21:07',
                'created_at' => '2017-07-26 06:19:30',
                'updated_at' => '2017-07-26 06:21:07',
                'deleted_at' => NULL,
            ),
            92 => 
            array (
                'id' => 1002092,
                'author_id' => 305,
                'quote_text' => 'Giving up on somebody takes nothing. Helping them change takes a tremendous amount of time, energy, discipline, and love. In the end, it\'s worth it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:21:09',
                'created_at' => '2017-07-26 06:18:54',
                'updated_at' => '2017-07-26 06:21:09',
                'deleted_at' => NULL,
            ),
            93 => 
            array (
                'id' => 1002093,
                'author_id' => 305,
            'quote_text' => 'The leadership challenge is to build a culture that generates and sustains winning behavior. If you attack behavior without building the culture, the behavior may change temporarily, but it will eventually (probably quickly) revert.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:25:25',
                'created_at' => '2017-07-26 06:24:44',
                'updated_at' => '2017-07-26 06:25:25',
                'deleted_at' => NULL,
            ),
            94 => 
            array (
                'id' => 1002094,
                'author_id' => 305,
                'quote_text' => 'You don’t get the culture you want, you get the culture you build. As a leader, you are responsible for creating a winning culture that drives behavior and produces results.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:25:27',
                'created_at' => '2017-07-26 06:24:15',
                'updated_at' => '2017-07-26 06:25:27',
                'deleted_at' => NULL,
            ),
            95 => 
            array (
                'id' => 1002095,
                'author_id' => 181,
                'quote_text' => 'PHP has its flaws, but I think because of frameworks like Laravel, we’re going to see more and more interesting new businesses choose PHP for their platform against something like Rails.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:40:52',
                'created_at' => '2017-07-26 06:40:46',
                'updated_at' => '2017-07-26 06:40:52',
                'deleted_at' => NULL,
            ),
            96 => 
            array (
                'id' => 1002096,
                'author_id' => 181,
                'quote_text' => 'Never blindly follow a programming principle or \'law\' unless you really understand the purpose of that rule, and what problem it’s aiming to solve. Too many developers get stuck on applying the rules for the sake of the rules, and it often leads to poorly designed code.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 06:40:53',
                'created_at' => '2017-07-26 06:39:45',
                'updated_at' => '2017-07-26 06:40:53',
                'deleted_at' => NULL,
            ),
            97 => 
            array (
                'id' => 1002097,
                'author_id' => 180,
                'quote_text' => 'I\'m a big advocate for mastering every inch of your code editor. Don\'t simply learn the basics; harness every inch of productivity you can get out of it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 07:06:37',
                'created_at' => '2017-07-26 06:49:28',
                'updated_at' => '2017-07-26 07:06:37',
                'deleted_at' => NULL,
            ),
            98 => 
            array (
                'id' => 1002098,
                'author_id' => 180,
                'quote_text' => 'If you want to be a better developer, there\'s no short cut. Write and read a lot of code.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 07:06:39',
                'created_at' => '2017-07-26 06:46:43',
                'updated_at' => '2017-07-26 07:06:39',
                'deleted_at' => NULL,
            ),
            99 => 
            array (
                'id' => 1002099,
                'author_id' => 180,
                'quote_text' => 'If you want to talk about sheer joy of development, I\'ll happily put Laravel up against any framework.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 07:06:40',
                'created_at' => '2017-07-26 06:44:00',
                'updated_at' => '2017-07-26 07:06:40',
                'deleted_at' => NULL,
            ),
            100 => 
            array (
                'id' => 1002100,
                'author_id' => 192,
                'quote_text' => 'I try to spend a lot of time with people outside my direct reports. The view from the top is totally distorted. If you only spend time with your directs, you have no perspective on what\'s really going on.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:43:29',
                'created_at' => '2017-07-26 08:42:57',
                'updated_at' => '2017-07-26 08:43:29',
                'deleted_at' => NULL,
            ),
            101 => 
            array (
                'id' => 1002101,
                'author_id' => 192,
                'quote_text' => 'As a leader, you need to care deeply, deeply about your people while not worrying or really even caring about what they think about you. Managing by trying to be liked is the path to ruin.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:43:30',
                'created_at' => '2017-07-26 08:42:37',
                'updated_at' => '2017-07-26 08:43:30',
                'deleted_at' => NULL,
            ),
            102 => 
            array (
                'id' => 1002102,
                'author_id' => 192,
                'quote_text' => 'When you are doing what you love to do, you become resilient.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:45:08',
                'created_at' => '2017-07-26 08:45:03',
                'updated_at' => '2017-07-26 08:45:08',
                'deleted_at' => NULL,
            ),
            103 => 
            array (
                'id' => 1002103,
                'author_id' => 192,
                'quote_text' => 'Believe that if you make courageous choices and bet on yourself and put yourself out there, that you will have an impact, as a result of what you do. And you don\'t need to know now what that would be or how will it happen because no one ever does.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:45:09',
                'created_at' => '2017-07-26 08:44:46',
                'updated_at' => '2017-07-26 08:45:09',
                'deleted_at' => NULL,
            ),
            104 => 
            array (
                'id' => 1002104,
                'author_id' => 192,
                'quote_text' => 'The key is to just get on the bike, and the key to getting on the bike… is to stop thinking about ‘there are a bunch of reasons I might fall off’ and just hop on and peddle the damned thing. You can pick up a map, a tire pump, and better footwear along the way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:45:11',
                'created_at' => '2017-07-26 08:44:24',
                'updated_at' => '2017-07-26 08:45:11',
                'deleted_at' => NULL,
            ),
            105 => 
            array (
                'id' => 1002105,
                'author_id' => 192,
                'quote_text' => 'Once in a rare while, somebody comes along who doesn\'t just raise the bar, they create an entirely new standard of measurement.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:45:12',
                'created_at' => '2017-07-26 08:43:57',
                'updated_at' => '2017-07-26 08:45:12',
                'deleted_at' => NULL,
            ),
            106 => 
            array (
                'id' => 1002106,
                'author_id' => 192,
                'quote_text' => 'What is the thing that matters most to making progress right now?',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:46:38',
                'created_at' => '2017-07-26 08:46:33',
                'updated_at' => '2017-07-26 08:46:38',
                'deleted_at' => NULL,
            ),
            107 => 
            array (
                'id' => 1002107,
                'author_id' => 192,
                'quote_text' => 'Successful businesses measure and count things. I think that\'s a safe assumption on top of which we can drop the following hypothesis: unsuccessful business either measure nothing, the wrong things, too many things, or finally, they measure the right things but they don\'t communicate the measurements efficiently.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:46:39',
                'created_at' => '2017-07-26 08:46:12',
                'updated_at' => '2017-07-26 08:46:39',
                'deleted_at' => NULL,
            ),
            108 => 
            array (
                'id' => 1002108,
                'author_id' => 192,
                'quote_text' => 'The Internet destroyed most of the barriers to publication. The cost of being a publisher dropped to almost zero with two interesting immediate results: anybody can publish, and more importantly, you can publish whatever you want.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:48:09',
                'created_at' => '2017-07-26 08:48:05',
                'updated_at' => '2017-07-26 08:48:09',
                'deleted_at' => NULL,
            ),
            109 => 
            array (
                'id' => 1002109,
                'author_id' => 192,
                'quote_text' => 'Authenticity is absolutely the key to a great tweet.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:48:11',
                'created_at' => '2017-07-26 08:47:36',
                'updated_at' => '2017-07-26 08:48:11',
                'deleted_at' => NULL,
            ),
            110 => 
            array (
                'id' => 1002110,
                'author_id' => 192,
                'quote_text' => 'When I was your age, we didn\'t have the Internet in our pants. We didn\'t even have the Internet not in our pants. That\'s how bad it was.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 08:48:12',
                'created_at' => '2017-07-26 08:47:27',
                'updated_at' => '2017-07-26 08:48:12',
                'deleted_at' => NULL,
            ),
            111 => 
            array (
                'id' => 1002111,
                'author_id' => 192,
                'quote_text' => 'As a CEO you have to balance grit and resiliency with self awareness. If you just have self awareness and not grit, you’ll be over in the corner with your hands over your head. If you have grit but not self-awareness, you could be delusional and spin the company off the tracks.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 10:10:19',
                'created_at' => '2017-07-26 10:10:14',
                'updated_at' => '2017-07-26 10:10:19',
                'deleted_at' => NULL,
            ),
            112 => 
            array (
                'id' => 1002112,
                'author_id' => 192,
                'quote_text' => 'People have Plato\'s form in their mind of what a leader is, or what a C.E.O. is, and it is a bunch of elements that I really don\'t conform to at all. I\'ve given this a lot of thought, and I came to the conclusion that I don\'t care.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 10:10:23',
                'created_at' => '2017-07-26 08:48:49',
                'updated_at' => '2017-07-26 10:10:23',
                'deleted_at' => NULL,
            ),
            113 => 
            array (
                'id' => 1002113,
                'author_id' => 303,
                'quote_text' => 'Mediocre people don\'t like high achievers. High achievers don\'t like mediocre people.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:48:34',
                'created_at' => '2017-07-26 13:48:31',
                'updated_at' => '2017-07-26 13:48:34',
                'deleted_at' => NULL,
            ),
            114 => 
            array (
                'id' => 1002114,
                'author_id' => 353,
                'quote_text' => 'You learn a lot more from the lows. They make you pay attention to what you\'re doing.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:50:00',
                'created_at' => '2017-07-26 13:49:56',
                'updated_at' => '2017-07-26 13:50:00',
                'deleted_at' => NULL,
            ),
            115 => 
            array (
                'id' => 1002115,
                'author_id' => 278,
                'quote_text' => 'Pressure is something you feel when you don\'t know what you\'re doing.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:51:05',
                'created_at' => '2017-07-26 13:50:47',
                'updated_at' => '2017-07-26 13:51:05',
                'deleted_at' => NULL,
            ),
            116 => 
            array (
                'id' => 1002116,
                'author_id' => 258,
                'quote_text' => 'Winning is not a sometime thing; it’s an all-time thing.  You don’t win once in a while, you don’t do things right once in a while, you do them right all the time.  Winning is habit.  Unfortunately, so is losing.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:53:09',
                'created_at' => '2017-07-26 13:53:04',
                'updated_at' => '2017-07-26 13:53:09',
                'deleted_at' => NULL,
            ),
            117 => 
            array (
                'id' => 1002117,
                'author_id' => 258,
                'quote_text' => 'The only place that success comes before work is in the dictionary.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:53:46',
                'created_at' => '2017-07-26 13:53:41',
                'updated_at' => '2017-07-26 13:53:46',
                'deleted_at' => NULL,
            ),
            118 => 
            array (
                'id' => 1002118,
                'author_id' => 258,
                'quote_text' => 'Let me tell you what winning means….  you’re willing to go longer, work harder, give more than anyone else.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:54:34',
                'created_at' => '2017-07-26 13:54:30',
                'updated_at' => '2017-07-26 13:54:34',
                'deleted_at' => NULL,
            ),
            119 => 
            array (
                'id' => 1002119,
                'author_id' => 258,
                'quote_text' => 'Practice doesn’t make perfect.  Perfect practice makes perfect.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:55:05',
                'created_at' => '2017-07-26 13:55:01',
                'updated_at' => '2017-07-26 13:55:05',
                'deleted_at' => NULL,
            ),
            120 => 
            array (
                'id' => 1002120,
                'author_id' => 258,
                'quote_text' => 'Winning isn’t everything, it’s the only thing. If you can shrug off a loss, you can never be a winner!',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:55:45',
                'created_at' => '2017-07-26 13:55:41',
                'updated_at' => '2017-07-26 13:55:45',
                'deleted_at' => NULL,
            ),
            121 => 
            array (
                'id' => 1002121,
                'author_id' => 397,
                'quote_text' => 'Today I will do what others won’t, so tomorrow I can accomplish what others can’t.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:56:46',
                'created_at' => '2017-07-26 13:56:42',
                'updated_at' => '2017-07-26 13:56:46',
                'deleted_at' => NULL,
            ),
            122 => 
            array (
                'id' => 1002122,
                'author_id' => 258,
                'quote_text' => 'Winners never quit and quitters never win.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 13:58:54',
                'created_at' => '2017-07-26 13:58:50',
                'updated_at' => '2017-07-26 13:58:54',
                'deleted_at' => NULL,
            ),
            123 => 
            array (
                'id' => 1002123,
                'author_id' => 258,
                'quote_text' => 'If it doesn\'t matter who wins or loses, then why do they keep score?',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:17:43',
                'created_at' => '2017-07-26 14:17:37',
                'updated_at' => '2017-07-26 14:17:43',
                'deleted_at' => NULL,
            ),
            124 => 
            array (
                'id' => 1002124,
                'author_id' => 313,
                'quote_text' => 'The greatest mistake is to continue to practice a mistake.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:19:04',
                'created_at' => '2017-07-26 14:19:00',
                'updated_at' => '2017-07-26 14:19:04',
                'deleted_at' => NULL,
            ),
            125 => 
            array (
                'id' => 1002125,
                'author_id' => 374,
                'quote_text' => 'Remember, tomorrow is promised to no one.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:19:43',
                'created_at' => '2017-07-26 14:19:38',
                'updated_at' => '2017-07-26 14:19:43',
                'deleted_at' => NULL,
            ),
            126 => 
            array (
                'id' => 1002126,
                'author_id' => 388,
                'quote_text' => 'Success comes in a lot of ways, but it doesn\'t come with money and it doesn\'t come with fame. It comes from having a meaning in your life, doing what you love and being passionate about what you do. That\'s having a life of success. When you have the ability to do what you love, love what you do and have the ability to impact people. That\'s having a life of success. That\'s what having a life of meaning is.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:21:24',
                'created_at' => '2017-07-26 14:21:19',
                'updated_at' => '2017-07-26 14:21:24',
                'deleted_at' => NULL,
            ),
            127 => 
            array (
                'id' => 1002127,
                'author_id' => 388,
                'quote_text' => 'I don\'t know what my future holds, but I do know who holds my future.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:23:21',
                'created_at' => '2017-07-26 14:23:16',
                'updated_at' => '2017-07-26 14:23:21',
                'deleted_at' => NULL,
            ),
            128 => 
            array (
                'id' => 1002128,
                'author_id' => 388,
                'quote_text' => 'Strong leaders encourage you to do things for your own benefit, not just theirs.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:23:22',
                'created_at' => '2017-07-26 14:23:02',
                'updated_at' => '2017-07-26 14:23:22',
                'deleted_at' => NULL,
            ),
            129 => 
            array (
                'id' => 1002129,
                'author_id' => 388,
                'quote_text' => 'I can\'t control the naysayers. I can control my attitude and work ethic and determination and that\'s what I\'m focused on now.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:23:23',
                'created_at' => '2017-07-26 14:22:51',
                'updated_at' => '2017-07-26 14:23:23',
                'deleted_at' => NULL,
            ),
            130 => 
            array (
                'id' => 1002130,
                'author_id' => 388,
            'quote_text' => 'We all know of people who thought they could to it (whatever “it” is) tomorrow. We have all procrastinated on such a way, and often to our personal regret. It happens time and again, putting off things that we convince ourselves might be better, more meaningful, more appropriate for another time. So often that better time either never comes or really isn’t better or more appropriate after all. And then, sadly, the window of opportunity -to do something great- closes.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:23:24',
                'created_at' => '2017-07-26 14:22:30',
                'updated_at' => '2017-07-26 14:23:24',
                'deleted_at' => NULL,
            ),
            131 => 
            array (
                'id' => 1002131,
                'author_id' => 388,
                'quote_text' => 'The people who can finish and finish at the same pace or stronger than when they started, those are the ones who are going to succeed; those are the ones who are going to be great.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:23:53',
                'created_at' => '2017-07-26 14:23:49',
                'updated_at' => '2017-07-26 14:23:53',
                'deleted_at' => NULL,
            ),
            132 => 
            array (
                'id' => 1002132,
                'author_id' => 388,
                'quote_text' => 'Hard work beats talent when talent doesn\'t work hard.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:24:22',
                'created_at' => '2017-07-26 14:24:18',
                'updated_at' => '2017-07-26 14:24:22',
                'deleted_at' => NULL,
            ),
            133 => 
            array (
                'id' => 1002133,
                'author_id' => 388,
                'quote_text' => 'You never know how the tough times you are going through today will inspire someone else tomorrow.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:26:07',
                'created_at' => '2017-07-26 14:26:02',
                'updated_at' => '2017-07-26 14:26:07',
                'deleted_at' => NULL,
            ),
            134 => 
            array (
                'id' => 1002134,
                'author_id' => 388,
                'quote_text' => 'You know what I’ve learned in the process? How important it is not to allow either the highs or the lows in life to determine who you are.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:26:08',
                'created_at' => '2017-07-26 14:25:43',
                'updated_at' => '2017-07-26 14:26:08',
                'deleted_at' => NULL,
            ),
            135 => 
            array (
                'id' => 1002135,
                'author_id' => 388,
                'quote_text' => 'When who you are is grounded in whose you are, you realize it doesn’t matter what life throws your way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:26:09',
                'created_at' => '2017-07-26 14:25:34',
                'updated_at' => '2017-07-26 14:26:09',
                'deleted_at' => NULL,
            ),
            136 => 
            array (
                'id' => 1002136,
                'author_id' => 388,
                'quote_text' => 'What God knows about us is more important than what others think.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:26:10',
                'created_at' => '2017-07-26 14:24:57',
                'updated_at' => '2017-07-26 14:26:10',
                'deleted_at' => NULL,
            ),
            137 => 
            array (
                'id' => 1002137,
                'author_id' => 271,
                'quote_text' => 'When it\'s too hard for them it\'s just right for us!',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:28:00',
                'created_at' => '2017-07-26 14:27:56',
                'updated_at' => '2017-07-26 14:28:00',
                'deleted_at' => NULL,
            ),
            138 => 
            array (
                'id' => 1002138,
                'author_id' => 344,
                'quote_text' => 'You hear about how many fourth quarter comebacks that a guy has and I think it means a guy screwed up in the first three quarters.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:29:23',
                'created_at' => '2017-07-26 14:29:20',
                'updated_at' => '2017-07-26 14:29:23',
                'deleted_at' => NULL,
            ),
            139 => 
            array (
                'id' => 1002139,
                'author_id' => 344,
                'quote_text' => 'It takes 20 years to build a reputation and five minutes to ruin it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:31:01',
                'created_at' => '2017-07-26 14:30:35',
                'updated_at' => '2017-07-26 14:31:01',
                'deleted_at' => NULL,
            ),
            140 => 
            array (
                'id' => 1002140,
                'author_id' => 344,
                'quote_text' => 'If you work hard and you play well, all those critics quiet themselves pretty quickly.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:31:02',
                'created_at' => '2017-07-26 14:30:23',
                'updated_at' => '2017-07-26 14:31:02',
                'deleted_at' => NULL,
            ),
            141 => 
            array (
                'id' => 1002141,
                'author_id' => 344,
                'quote_text' => 'The most valuable player is the one that makes the most players valuable.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:31:03',
                'created_at' => '2017-07-26 14:30:05',
                'updated_at' => '2017-07-26 14:31:03',
                'deleted_at' => NULL,
            ),
            142 => 
            array (
                'id' => 1002142,
                'author_id' => 344,
                'quote_text' => 'I’ve been being asked about my legacy since I was about 25 years old. I’m not sure you can have a legacy when you’re 25 years old. Even 37.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:36:51',
                'created_at' => '2017-07-26 14:35:59',
                'updated_at' => '2017-07-26 14:36:51',
                'deleted_at' => NULL,
            ),
            143 => 
            array (
                'id' => 1002143,
                'author_id' => 344,
                'quote_text' => 'Boy, do I hate to lose.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:36:52',
                'created_at' => '2017-07-26 14:34:49',
                'updated_at' => '2017-07-26 14:36:52',
                'deleted_at' => NULL,
            ),
            144 => 
            array (
                'id' => 1002144,
                'author_id' => 344,
                'quote_text' => 'I want to be out there every single snap, every single play.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:36:54',
                'created_at' => '2017-07-26 14:32:59',
                'updated_at' => '2017-07-26 14:36:54',
                'deleted_at' => NULL,
            ),
            145 => 
            array (
                'id' => 1002145,
                'author_id' => 344,
                'quote_text' => 'Anyone who waits for someone else to make a change automatically becomes a follower.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:36:55',
                'created_at' => '2017-07-26 14:31:57',
                'updated_at' => '2017-07-26 14:36:55',
                'deleted_at' => NULL,
            ),
            146 => 
            array (
                'id' => 1002146,
                'author_id' => 350,
                'quote_text' => 'If I have something to say, I want it to be meaningful.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:40:12',
                'created_at' => '2017-07-26 14:40:08',
                'updated_at' => '2017-07-26 14:40:12',
                'deleted_at' => NULL,
            ),
            147 => 
            array (
                'id' => 1002147,
                'author_id' => 350,
                'quote_text' => 'If you don’t play to win, don’t play at all.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:40:13',
                'created_at' => '2017-07-26 14:38:28',
                'updated_at' => '2017-07-26 14:40:13',
                'deleted_at' => NULL,
            ),
            148 => 
            array (
                'id' => 1002148,
                'author_id' => 350,
                'quote_text' => 'You have to believe in your process. You have to believe in the things that you are doing to help the team win. I think you have to take the good with the bad.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:42:07',
                'created_at' => '2017-07-26 14:42:04',
                'updated_at' => '2017-07-26 14:42:07',
                'deleted_at' => NULL,
            ),
            149 => 
            array (
                'id' => 1002149,
                'author_id' => 350,
                'quote_text' => 'I’m much more comfortable and confident running out on the field in front of 70,000 people instead of standing in front of a camera trying to say some lines. The people who do that as a profession are very talented because it’s certainly not easy.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:42:09',
                'created_at' => '2017-07-26 14:41:56',
                'updated_at' => '2017-07-26 14:42:09',
                'deleted_at' => NULL,
            ),
            150 => 
            array (
                'id' => 1002150,
                'author_id' => 414,
                'quote_text' => 'The unknown is the biggest question.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 14:43:31',
                'created_at' => '2017-07-26 14:43:27',
                'updated_at' => '2017-07-26 14:43:31',
                'deleted_at' => NULL,
            ),
            151 => 
            array (
                'id' => 1002151,
                'author_id' => 419,
                'quote_text' => 'Just like in sports, I think the key in any business is maintaining excellence. It comes down to a leader who\'s able to demand excellence every single day.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:13:32',
                'created_at' => '2017-07-26 15:13:28',
                'updated_at' => '2017-07-26 15:13:32',
                'deleted_at' => NULL,
            ),
            152 => 
            array (
                'id' => 1002152,
                'author_id' => 415,
                'quote_text' => 'Other people can spark a vision for your life, but until you can hold that dream in your own head and your own heart, it’s never going to come true.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:17:19',
                'created_at' => '2017-07-26 15:17:14',
                'updated_at' => '2017-07-26 15:17:19',
                'deleted_at' => NULL,
            ),
            153 => 
            array (
                'id' => 1002153,
                'author_id' => 415,
                'quote_text' => 'I think this can be a championship team. But we do have to take it one game at a time. You can\'t look at the end of the road before you get the next foot in.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:22:08',
                'created_at' => '2017-07-26 15:20:24',
                'updated_at' => '2017-07-26 15:22:08',
                'deleted_at' => NULL,
            ),
            154 => 
            array (
                'id' => 1002154,
                'author_id' => 415,
                'quote_text' => 'Mentally rehearse the big moment. Be it a job interview or a presentation or any other kind of high-pressure task, picture yourself completing the task. Take your time, find a quiet space, and imagine how you will look, what you want to say, how you want to feel. Scientists say that the more you picture yourself doing a task, the more your brain begins to believe that the task is easy and manageable.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:22:09',
                'created_at' => '2017-07-26 15:18:50',
                'updated_at' => '2017-07-26 15:22:09',
                'deleted_at' => NULL,
            ),
            155 => 
            array (
                'id' => 1002155,
                'author_id' => 415,
                'quote_text' => 'I’ve learned how to turn self-doubt into an energy source and to metabolize fear into a result-producing adrenaline.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:22:10',
                'created_at' => '2017-07-26 15:18:13',
                'updated_at' => '2017-07-26 15:22:10',
                'deleted_at' => NULL,
            ),
            156 => 
            array (
                'id' => 1002156,
                'author_id' => 415,
                'quote_text' => 'Too many of us count ourselves out before we even get a chance. We can be our own worst enemies. Do the work. Be excellent. You’ll find your place, and it may just be where you least expect it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:22:11',
                'created_at' => '2017-07-26 15:17:39',
                'updated_at' => '2017-07-26 15:22:11',
                'deleted_at' => NULL,
            ),
            157 => 
            array (
                'id' => 1002157,
                'author_id' => 413,
                'quote_text' => 'I don\'t believe in feeling good about being close. Close ain\'t winning.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:29:43',
                'created_at' => '2017-07-26 15:24:45',
                'updated_at' => '2017-07-26 15:29:43',
                'deleted_at' => NULL,
            ),
            158 => 
            array (
                'id' => 1002158,
                'author_id' => 413,
                'quote_text' => 'I love competition, but my approach to the game was to never make it personal. It was business.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:29:51',
                'created_at' => '2017-07-26 15:29:48',
                'updated_at' => '2017-07-26 15:29:51',
                'deleted_at' => NULL,
            ),
            159 => 
            array (
                'id' => 1002159,
                'author_id' => 387,
                'quote_text' => 'I grew up playing sports. There is a clear line between success and failure.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:36:14',
                'created_at' => '2017-07-26 15:35:28',
                'updated_at' => '2017-07-26 15:36:14',
                'deleted_at' => NULL,
            ),
            160 => 
            array (
                'id' => 1002160,
                'author_id' => 387,
                'quote_text' => 'Every day is an opportunity disguised as a challenge.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:36:15',
                'created_at' => '2017-07-26 15:35:14',
                'updated_at' => '2017-07-26 15:36:15',
                'deleted_at' => NULL,
            ),
            161 => 
            array (
                'id' => 1002161,
                'author_id' => 190,
                'quote_text' => 'Make every detail perfect and limit the number of details to perfect.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:43:54',
                'created_at' => '2017-07-26 15:43:50',
                'updated_at' => '2017-07-26 15:43:54',
                'deleted_at' => NULL,
            ),
            162 => 
            array (
                'id' => 1002162,
                'author_id' => 190,
                'quote_text' => 'It’s really complex to make something simple.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:43:55',
                'created_at' => '2017-07-26 15:42:14',
                'updated_at' => '2017-07-26 15:43:55',
                'deleted_at' => NULL,
            ),
            163 => 
            array (
                'id' => 1002163,
                'author_id' => 190,
                'quote_text' => 'An idea that can change the course of the company can come from anywhere.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:43:56',
                'created_at' => '2017-07-26 15:41:51',
                'updated_at' => '2017-07-26 15:43:56',
                'deleted_at' => NULL,
            ),
            164 => 
            array (
                'id' => 1002164,
                'author_id' => 190,
                'quote_text' => 'Success is never accidental.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:45:32',
                'created_at' => '2017-07-26 15:45:28',
                'updated_at' => '2017-07-26 15:45:32',
                'deleted_at' => NULL,
            ),
            165 => 
            array (
                'id' => 1002165,
                'author_id' => 190,
                'quote_text' => 'You can worry about the competition...or you can focus on what\'s ahead of you and drive fast.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:45:34',
                'created_at' => '2017-07-26 15:44:30',
                'updated_at' => '2017-07-26 15:45:34',
                'deleted_at' => NULL,
            ),
            166 => 
            array (
                'id' => 1002166,
                'author_id' => 190,
                'quote_text' => 'A founder is not a job, it\'s a role, an attitude.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:45:58',
                'created_at' => '2017-07-26 15:45:55',
                'updated_at' => '2017-07-26 15:45:58',
                'deleted_at' => NULL,
            ),
            167 => 
            array (
                'id' => 1002167,
                'author_id' => 190,
                'quote_text' => 'Everyone has an idea. But it\'s really about executing the idea and attracting other people to help you work on the idea.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:47:39',
                'created_at' => '2017-07-26 15:47:35',
                'updated_at' => '2017-07-26 15:47:39',
                'deleted_at' => NULL,
            ),
            168 => 
            array (
                'id' => 1002168,
                'author_id' => 190,
                'quote_text' => 'The greatest lesson that I learned in all of this is that you have to start. Start now, start here, and start small. Keep it simple.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-26 15:47:41',
                'created_at' => '2017-07-26 15:46:39',
                'updated_at' => '2017-07-26 15:47:41',
                'deleted_at' => NULL,
            ),
            169 => 
            array (
                'id' => 1002169,
                'author_id' => 33,
                'quote_text' => 'You can\'t just keep doing what works one time, everything around you is changing. To succeed, stay out in front of change.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:13:37',
                'created_at' => '2017-07-27 16:13:25',
                'updated_at' => '2017-07-27 16:13:37',
                'deleted_at' => NULL,
            ),
            170 => 
            array (
                'id' => 1002170,
                'author_id' => 33,
                'quote_text' => 'There is only one boss. The customer. And he can fire everybody in the company from the chairman on down, simply by spending his money somewhere else.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:13:38',
                'created_at' => '2017-07-27 16:13:05',
                'updated_at' => '2017-07-27 16:13:38',
                'deleted_at' => NULL,
            ),
            171 => 
            array (
                'id' => 1002171,
                'author_id' => 33,
                'quote_text' => 'Individuals don\'t win in business, teams do.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:15:59',
                'created_at' => '2017-07-27 16:15:55',
                'updated_at' => '2017-07-27 16:15:59',
                'deleted_at' => NULL,
            ),
            172 => 
            array (
                'id' => 1002172,
                'author_id' => 33,
                'quote_text' => 'Nothing else can quite substitute for a few well-chosen, well-timed, sincere words of praise. They\'re absolutely free and worth a fortune.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:16:00',
                'created_at' => '2017-07-27 16:15:05',
                'updated_at' => '2017-07-27 16:16:00',
                'deleted_at' => NULL,
            ),
            173 => 
            array (
                'id' => 1002173,
                'author_id' => 33,
                'quote_text' => 'The goal as a company is to have customer service that is not just the best, but legendary.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:16:01',
                'created_at' => '2017-07-27 16:14:39',
                'updated_at' => '2017-07-27 16:16:01',
                'deleted_at' => NULL,
            ),
            174 => 
            array (
                'id' => 1002174,
                'author_id' => 33,
                'quote_text' => 'Communicate everything you can to your associates. The more they know, the more they care. Once they care, there is no stopping them.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:16:03',
                'created_at' => '2017-07-27 16:14:12',
                'updated_at' => '2017-07-27 16:16:03',
                'deleted_at' => NULL,
            ),
            175 => 
            array (
                'id' => 1002175,
                'author_id' => 33,
                'quote_text' => 'If you want a successful business, your people must feel that you are working for them - not that they are working for you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:16:32',
                'created_at' => '2017-07-27 16:16:28',
                'updated_at' => '2017-07-27 16:16:32',
                'deleted_at' => NULL,
            ),
            176 => 
            array (
                'id' => 1002176,
                'author_id' => 33,
                'quote_text' => 'To succeed in this world, you have to change all the time.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:16:34',
                'created_at' => '2017-07-27 16:16:13',
                'updated_at' => '2017-07-27 16:16:34',
                'deleted_at' => NULL,
            ),
            177 => 
            array (
                'id' => 1002177,
                'author_id' => 33,
                'quote_text' => 'I learned early on that one of the secrets to campus leadership was the simplest thing of all: speak to people coming down the sidewalk before they speak to you. I did that in college. I did it when I carried my papers. I would always look ahead and speak to the person coming toward me. If I knew them, I would call them by name, but even if I didn\'t I would still speak to them. Before long, I probably knew more students than anybody in the university, and they recognized me and considered me their friend.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:18:16',
                'created_at' => '2017-07-27 16:18:12',
                'updated_at' => '2017-07-27 16:18:16',
                'deleted_at' => NULL,
            ),
            178 => 
            array (
                'id' => 1002178,
                'author_id' => 33,
                'quote_text' => 'If you don\'t listen to your customers, someone else will.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:18:17',
                'created_at' => '2017-07-27 16:17:34',
                'updated_at' => '2017-07-27 16:18:17',
                'deleted_at' => NULL,
            ),
            179 => 
            array (
                'id' => 1002179,
                'author_id' => 33,
                'quote_text' => 'If one of our customers comes into the store without a smile, I\'ll give them one of mine.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:18:18',
                'created_at' => '2017-07-27 16:16:59',
                'updated_at' => '2017-07-27 16:18:18',
                'deleted_at' => NULL,
            ),
            180 => 
            array (
                'id' => 1002180,
                'author_id' => 420,
                'quote_text' => 'One has to remember that every failure can be a stepping stone to something better.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:20:03',
                'created_at' => '2017-07-27 16:19:51',
                'updated_at' => '2017-07-27 16:20:03',
                'deleted_at' => NULL,
            ),
            181 => 
            array (
                'id' => 1002181,
                'author_id' => 420,
                'quote_text' => 'I was sixty-six years old. I still had to make a living. I looked at my social security check of 105 dollars and decided to use that to try to franchise my chicken recipe. Folks had always liked my chicken.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:21:07',
                'created_at' => '2017-07-27 16:21:03',
                'updated_at' => '2017-07-27 16:21:07',
                'deleted_at' => NULL,
            ),
            182 => 
            array (
                'id' => 1002182,
                'author_id' => 420,
                'quote_text' => 'I just say the moral out of my life is don\'t quit at age 65, maybe your boat hasn\'t come in yet. Mine hadn\'t.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:21:08',
                'created_at' => '2017-07-27 16:20:45',
                'updated_at' => '2017-07-27 16:21:08',
                'deleted_at' => NULL,
            ),
            183 => 
            array (
                'id' => 1002183,
                'author_id' => 420,
                'quote_text' => 'I\'ve only had two rules. Do all you can and do it the best you can. It\'s the only way you ever get that feeling of accomplishing something.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:21:10',
                'created_at' => '2017-07-27 16:20:11',
                'updated_at' => '2017-07-27 16:21:10',
                'deleted_at' => NULL,
            ),
            184 => 
            array (
                'id' => 1002184,
                'author_id' => 420,
                'quote_text' => 'I think a dream is just a suggestion to start something out, do something.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:24:22',
                'created_at' => '2017-07-27 16:23:29',
                'updated_at' => '2017-07-27 16:24:22',
                'deleted_at' => NULL,
            ),
            185 => 
            array (
                'id' => 1002185,
                'author_id' => 420,
                'quote_text' => 'My life isn\'t over and I\'m not going to sit in a rocking chair and take money from the government.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:24:23',
                'created_at' => '2017-07-27 16:22:06',
                'updated_at' => '2017-07-27 16:24:23',
                'deleted_at' => NULL,
            ),
            186 => 
            array (
                'id' => 1002186,
                'author_id' => 420,
                'quote_text' => 'The hard way builds solidly a foundation of confidence that cannot be swept away.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:24:24',
                'created_at' => '2017-07-27 16:21:56',
                'updated_at' => '2017-07-27 16:24:24',
                'deleted_at' => NULL,
            ),
            187 => 
            array (
                'id' => 1002187,
                'author_id' => 420,
                'quote_text' => 'There\'s no reason to be the richest man in the cemetery. You can\'t do any business from there.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:24:26',
                'created_at' => '2017-07-27 16:21:24',
                'updated_at' => '2017-07-27 16:24:26',
                'deleted_at' => NULL,
            ),
            188 => 
            array (
                'id' => 1002188,
                'author_id' => 34,
                'quote_text' => 'The quality of a leader is reflected in the standards they set for themselves.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:25:18',
                'created_at' => '2017-07-27 16:25:14',
                'updated_at' => '2017-07-27 16:25:18',
                'deleted_at' => NULL,
            ),
            189 => 
            array (
                'id' => 1002189,
                'author_id' => 34,
                'quote_text' => 'Luck is a dividend of sweat. The more you sweat, the luckier you get.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:25:19',
                'created_at' => '2017-07-26 05:15:42',
                'updated_at' => '2017-07-27 16:25:19',
                'deleted_at' => NULL,
            ),
            190 => 
            array (
                'id' => 1002190,
                'author_id' => 34,
                'quote_text' => 'If you work just for money, you\'ll never make it, but if you love what you\'re doing and you always put the customer first, success will be yours.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:25:45',
                'created_at' => '2017-07-27 16:25:38',
                'updated_at' => '2017-07-27 16:25:45',
                'deleted_at' => NULL,
            ),
            191 => 
            array (
                'id' => 1002191,
                'author_id' => 34,
                'quote_text' => 'You\'ll learn more about a road by traveling it than by consulting all the maps in the world.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:33:49',
                'created_at' => '2017-07-27 16:33:45',
                'updated_at' => '2017-07-27 16:33:49',
                'deleted_at' => NULL,
            ),
            192 => 
            array (
                'id' => 1002192,
                'author_id' => 34,
                'quote_text' => 'When times are bad is when you want to build! Why wait for things to pick up so everything will cost more?',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:35:21',
                'created_at' => '2017-07-27 16:35:15',
                'updated_at' => '2017-07-27 16:35:21',
                'deleted_at' => NULL,
            ),
            193 => 
            array (
                'id' => 1002193,
                'author_id' => 34,
                'quote_text' => 'To be successful, you must be daring, be first and be different.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:35:23',
                'created_at' => '2017-07-27 16:35:02',
                'updated_at' => '2017-07-27 16:35:23',
                'deleted_at' => NULL,
            ),
            194 => 
            array (
                'id' => 1002194,
                'author_id' => 34,
                'quote_text' => 'That\'s the name of the game... pleasing the customer. If we ever lose sight of that fact, we\'ve lost the ball game.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:35:24',
                'created_at' => '2017-07-27 16:34:46',
                'updated_at' => '2017-07-27 16:35:24',
                'deleted_at' => NULL,
            ),
            195 => 
            array (
                'id' => 1002195,
                'author_id' => 34,
                'quote_text' => 'The key to success is being in the right place at the right time, recognizing that you are there, and taking action!',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:35:28',
                'created_at' => '2017-07-27 16:34:29',
                'updated_at' => '2017-07-27 16:35:28',
                'deleted_at' => NULL,
            ),
            196 => 
            array (
                'id' => 1002196,
                'author_id' => 34,
                'quote_text' => 'There’s almost nothing you can’t accomplish if you set your mind to it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:35:29',
                'created_at' => '2017-07-27 16:34:14',
                'updated_at' => '2017-07-27 16:35:29',
                'deleted_at' => NULL,
            ),
            197 => 
            array (
                'id' => 1002197,
                'author_id' => 34,
                'quote_text' => 'It\'s easy to have principles when you\'re rich. The important thing is to have principles when you\'re poor.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:36:50',
                'created_at' => '2017-07-27 16:36:10',
                'updated_at' => '2017-07-27 16:36:50',
                'deleted_at' => NULL,
            ),
            198 => 
            array (
                'id' => 1002198,
                'author_id' => 34,
                'quote_text' => 'If any of my competitors were drowning, I\'d stick a hose in their mouth and turn on the water. It is ridiculous to call this an industry. This is not. This is rat eat rat, dog eat dog. I\'ll kill \'em, and I\'m going to kill \'em before they kill me. You\'re talking about the American way - of survival of the fittest.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:36:51',
                'created_at' => '2017-07-27 16:36:01',
                'updated_at' => '2017-07-27 16:36:51',
                'deleted_at' => NULL,
            ),
            199 => 
            array (
                'id' => 1002199,
                'author_id' => 34,
                'quote_text' => 'The first dollar is the most you will get if you don\'t love what you are doing.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:06',
                'created_at' => '2017-07-27 16:43:56',
                'updated_at' => '2017-07-27 16:45:06',
                'deleted_at' => NULL,
            ),
            200 => 
            array (
                'id' => 1002200,
                'author_id' => 34,
                'quote_text' => 'There are things money can\'t buy and hard work can\'t win. One of them is happiness.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:08',
                'created_at' => '2017-07-27 16:43:40',
                'updated_at' => '2017-07-27 16:45:08',
                'deleted_at' => NULL,
            ),
            201 => 
            array (
                'id' => 1002201,
                'author_id' => 34,
                'quote_text' => 'The McDonald brothers were simply not on my wavelength at all. I was obsessed with the idea of making McDonald\'s the biggest and the best. They were content with what they had; they didn\'t want to be bothered with more risks and more demands.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:09',
                'created_at' => '2017-07-27 16:41:29',
                'updated_at' => '2017-07-27 16:45:09',
                'deleted_at' => NULL,
            ),
            202 => 
            array (
                'id' => 1002202,
                'author_id' => 34,
                'quote_text' => 'While formal schooling is an important advantage, it is not a guarantee of success nor is its absence a fatal handicap.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:10',
                'created_at' => '2017-07-27 16:40:42',
                'updated_at' => '2017-07-27 16:45:10',
                'deleted_at' => NULL,
            ),
            203 => 
            array (
                'id' => 1002203,
                'author_id' => 34,
                'quote_text' => 'Take calculated risks. Act boldly and thoughtfully. Be an agile company.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:11',
                'created_at' => '2017-07-27 16:40:14',
                'updated_at' => '2017-07-27 16:45:11',
                'deleted_at' => NULL,
            ),
            204 => 
            array (
                'id' => 1002204,
                'author_id' => 34,
                'quote_text' => 'You must perfect every fundamental of your business if you expect it to perform well.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:12',
                'created_at' => '2017-07-27 16:39:59',
                'updated_at' => '2017-07-27 16:45:12',
                'deleted_at' => NULL,
            ),
            205 => 
            array (
                'id' => 1002205,
                'author_id' => 34,
                'quote_text' => 'The definition of salesmanship is the gentle art of letting the customer have it your way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:13',
                'created_at' => '2017-07-27 16:38:44',
                'updated_at' => '2017-07-27 16:45:13',
                'deleted_at' => NULL,
            ),
            206 => 
            array (
                'id' => 1002206,
                'author_id' => 34,
                'quote_text' => 'If you\'re not a risk taker, you should get the hell out of business.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:15',
                'created_at' => '2017-07-27 16:38:15',
                'updated_at' => '2017-07-27 16:45:15',
                'deleted_at' => NULL,
            ),
            207 => 
            array (
                'id' => 1002207,
                'author_id' => 34,
                'quote_text' => 'I was an overnight success all right, but 30 years is a long, long night.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:16',
                'created_at' => '2017-07-27 16:37:44',
                'updated_at' => '2017-07-27 16:45:16',
                'deleted_at' => NULL,
            ),
            208 => 
            array (
                'id' => 1002208,
                'author_id' => 34,
                'quote_text' => 'No self-respecting pitcher throws the same way to every batter and no self-respecting salesman makes the same pitch to every client.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:17',
                'created_at' => '2017-07-27 16:37:17',
                'updated_at' => '2017-07-27 16:45:17',
                'deleted_at' => NULL,
            ),
            209 => 
            array (
                'id' => 1002209,
                'author_id' => 34,
                'quote_text' => 'Achievement must be made against the possibility of failure, against the risk of defeat. It is no achievement to walk a tightrope laid flat on the floor. Where there is no risk, there can be no pride in achievement and, consequently, no happiness. The only way we can advance is by going forward, individually and collectively, in the spirit of the pioneer. We must take the risks involved in our free enterprise system. This is the only way in the world to economic freedom. There is no other way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-27 16:45:18',
                'created_at' => '2017-07-27 16:36:59',
                'updated_at' => '2017-07-27 16:45:18',
                'deleted_at' => NULL,
            ),
            210 => 
            array (
                'id' => 1002210,
                'author_id' => 22,
                'quote_text' => 'The worst thing about new books is that they keep us from reading the old ones.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 20:43:05',
                'created_at' => '2017-07-31 20:42:27',
                'updated_at' => '2017-07-31 20:43:05',
                'deleted_at' => NULL,
            ),
            211 => 
            array (
                'id' => 1002211,
                'author_id' => 22,
                'quote_text' => 'You can\'t live a perfect day without doing something for someone who will never be able to repay you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 20:45:01',
                'created_at' => '2017-07-31 20:44:57',
                'updated_at' => '2017-07-31 20:45:01',
                'deleted_at' => NULL,
            ),
            212 => 
            array (
                'id' => 1002212,
                'author_id' => 22,
                'quote_text' => 'Ability is a poor man\'s wealth.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 20:45:02',
                'created_at' => '2017-07-31 20:44:27',
                'updated_at' => '2017-07-31 20:45:02',
                'deleted_at' => NULL,
            ),
            213 => 
            array (
                'id' => 1002213,
                'author_id' => 22,
                'quote_text' => 'Don\'t measure yourself by what you have accomplished, but by what you should have accomplished with your ability.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 20:45:04',
                'created_at' => '2017-07-31 20:44:17',
                'updated_at' => '2017-07-31 20:45:04',
                'deleted_at' => NULL,
            ),
            214 => 
            array (
                'id' => 1002214,
                'author_id' => 22,
                'quote_text' => 'Consider the rights of others before your own feelings, and the feelings of others before your own rights.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 20:45:05',
                'created_at' => '2017-07-31 20:43:55',
                'updated_at' => '2017-07-31 20:45:05',
                'deleted_at' => NULL,
            ),
            215 => 
            array (
                'id' => 1002215,
                'author_id' => 22,
                'quote_text' => 'Adversity is the state in which man mostly easily becomes acquainted with himself, being especially free of admirers then.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 20:45:06',
                'created_at' => '2017-07-31 20:43:32',
                'updated_at' => '2017-07-31 20:45:06',
                'deleted_at' => NULL,
            ),
            216 => 
            array (
                'id' => 1002216,
                'author_id' => 433,
                'quote_text' => 'Just win, baby!',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:29:10',
                'created_at' => '2017-07-31 21:29:06',
                'updated_at' => '2017-07-31 21:29:10',
                'deleted_at' => NULL,
            ),
            217 => 
            array (
                'id' => 1002217,
                'author_id' => 433,
                'quote_text' => 'We would rather be feared than respected.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:29:37',
                'created_at' => '2017-07-31 21:29:32',
                'updated_at' => '2017-07-31 21:29:37',
                'deleted_at' => NULL,
            ),
            218 => 
            array (
                'id' => 1002218,
                'author_id' => 424,
                'quote_text' => 'Continuity is a great thing; staying the course and being patient, those are important virtues. But also there is virtue in being realistic enough to know you have to make serious changes sometimes.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:32:32',
                'created_at' => '2017-07-31 21:32:28',
                'updated_at' => '2017-07-31 21:32:32',
                'deleted_at' => NULL,
            ),
            219 => 
            array (
                'id' => 1002219,
                'author_id' => 430,
                'quote_text' => 'I\'ve studied the lives of the 20th century\'s great businessmen and concluded self-confidence was instrumental in all their success.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:34:26',
                'created_at' => '2017-07-31 21:34:22',
                'updated_at' => '2017-07-31 21:34:26',
                'deleted_at' => NULL,
            ),
            220 => 
            array (
                'id' => 1002220,
                'author_id' => 430,
                'quote_text' => 'The best way to learn is by doing. The only way to build a strong work ethic is getting your hands dirty.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:34:27',
                'created_at' => '2017-07-31 21:34:01',
                'updated_at' => '2017-07-31 21:34:27',
                'deleted_at' => NULL,
            ),
            221 => 
            array (
                'id' => 1002221,
                'author_id' => 429,
                'quote_text' => 'Technology is notorious for engrossing people so much that they don\'t always focus on balance and enjoy life at the same time.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:38:25',
                'created_at' => '2017-07-31 21:36:42',
                'updated_at' => '2017-07-31 21:38:25',
                'deleted_at' => NULL,
            ),
            222 => 
            array (
                'id' => 1002222,
                'author_id' => 432,
                'quote_text' => 'I own this football team. You don\'t dismiss owners',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:41:27',
                'created_at' => '2017-07-31 21:41:23',
                'updated_at' => '2017-07-31 21:41:27',
                'deleted_at' => NULL,
            ),
            223 => 
            array (
                'id' => 1002223,
                'author_id' => 431,
                'quote_text' => 'As a developer, it\'s a great feeling knowing you have made an impact. There\'s also a lot of responsibility that goes with that: you have to really put the city\'s needs first. It\'s not all about making money.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:43:26',
                'created_at' => '2017-07-31 21:43:20',
                'updated_at' => '2017-07-31 21:43:26',
                'deleted_at' => NULL,
            ),
            224 => 
            array (
                'id' => 1002224,
                'author_id' => 427,
                'quote_text' => 'The biggest thrill wasn\'t in winning on Sunday but in meeting the payroll on Monday.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 21:45:02',
                'created_at' => '2017-07-31 21:44:58',
                'updated_at' => '2017-07-31 21:45:02',
                'deleted_at' => NULL,
            ),
            225 => 
            array (
                'id' => 1002225,
                'author_id' => 436,
                'quote_text' => 'The wonderful thing about America is optimism. You know the American Dream. That is something so precious.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:23:17',
                'created_at' => '2017-07-31 22:17:00',
                'updated_at' => '2017-07-31 22:23:17',
                'deleted_at' => NULL,
            ),
            226 => 
            array (
                'id' => 1002226,
                'author_id' => 426,
                'quote_text' => 'Some people like to play golf; I like to come to work.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:25:46',
                'created_at' => '2017-07-31 22:25:41',
                'updated_at' => '2017-07-31 22:25:46',
                'deleted_at' => NULL,
            ),
            227 => 
            array (
                'id' => 1002227,
                'author_id' => 423,
                'quote_text' => 'I have found that what drives me is the desire to prove, to myself and to my peers, that I can do what I set out to do and build something that matters.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:29:09',
                'created_at' => '2017-07-31 22:28:21',
                'updated_at' => '2017-07-31 22:29:09',
                'deleted_at' => NULL,
            ),
            228 => 
            array (
                'id' => 1002228,
                'author_id' => 423,
                'quote_text' => 'I look at each day as a chance to move one notch above yesterday - whether it\'s in service quality, delivery, speed, or any other aspect of the business.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:29:11',
                'created_at' => '2017-07-31 22:27:52',
                'updated_at' => '2017-07-31 22:29:11',
                'deleted_at' => NULL,
            ),
            229 => 
            array (
                'id' => 1002229,
                'author_id' => 423,
                'quote_text' => 'You achieve long-term success step by step. Try to achieve your goals one at a time, like you do target practice.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:29:12',
                'created_at' => '2017-07-31 22:27:20',
                'updated_at' => '2017-07-31 22:29:12',
                'deleted_at' => NULL,
            ),
            230 => 
            array (
                'id' => 1002230,
                'author_id' => 422,
                'quote_text' => 'Life is about collecting good people around you. You can’t have enough good people.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:32:16',
                'created_at' => '2017-07-31 22:32:10',
                'updated_at' => '2017-07-31 22:32:16',
                'deleted_at' => NULL,
            ),
            231 => 
            array (
                'id' => 1002231,
                'author_id' => 422,
                'quote_text' => 'Envy and jealousy are incurable diseases.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:32:18',
                'created_at' => '2017-07-31 22:30:21',
                'updated_at' => '2017-07-31 22:32:18',
                'deleted_at' => NULL,
            ),
            232 => 
            array (
                'id' => 1002232,
                'author_id' => 421,
                'quote_text' => 'I run because it\'s so symbolic of life. You have to drive yourself to overcome the obstacles. You might feel that you can\'t. But then you find your inner strength, and realize you\'re capable of so much more than you thought.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:38:03',
                'created_at' => '2017-07-31 22:34:22',
                'updated_at' => '2017-07-31 22:38:03',
                'deleted_at' => NULL,
            ),
            233 => 
            array (
                'id' => 1002233,
                'author_id' => 434,
                'quote_text' => 'Life is a game. Money is how we keep score.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:43:12',
                'created_at' => '2017-07-31 22:43:07',
                'updated_at' => '2017-07-31 22:43:12',
                'deleted_at' => NULL,
            ),
            234 => 
            array (
                'id' => 1002234,
                'author_id' => 434,
                'quote_text' => 'You should set goals beyond your reach so you always have something to live for.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:43:13',
                'created_at' => '2017-07-31 22:42:55',
                'updated_at' => '2017-07-31 22:43:13',
                'deleted_at' => NULL,
            ),
            235 => 
            array (
                'id' => 1002235,
                'author_id' => 434,
                'quote_text' => 'The mind is just another muscle.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:43:14',
                'created_at' => '2017-07-31 22:42:33',
                'updated_at' => '2017-07-31 22:43:14',
                'deleted_at' => NULL,
            ),
            236 => 
            array (
                'id' => 1002236,
                'author_id' => 434,
                'quote_text' => 'My son is now an \'entrepreneur.\' That\'s what you\'re called when you don\'t have a job.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:43:16',
                'created_at' => '2017-07-31 22:42:24',
                'updated_at' => '2017-07-31 22:43:16',
                'deleted_at' => NULL,
            ),
            237 => 
            array (
                'id' => 1002237,
                'author_id' => 425,
                'quote_text' => 'Winning is not a goal, it is a belief.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:45:59',
                'created_at' => '2017-07-31 22:45:55',
                'updated_at' => '2017-07-31 22:45:59',
                'deleted_at' => NULL,
            ),
            238 => 
            array (
                'id' => 1002238,
                'author_id' => 435,
                'quote_text' => 'If we don’t win, and win consistently, it will be my fault because I picked the wrong people.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:58:19',
                'created_at' => '2017-07-31 22:58:15',
                'updated_at' => '2017-07-31 22:58:19',
                'deleted_at' => NULL,
            ),
            239 => 
            array (
                'id' => 1002239,
                'author_id' => 428,
                'quote_text' => 'Sometimes, in order to be successful, a business must reset.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 22:59:45',
                'created_at' => '2017-07-31 22:59:40',
                'updated_at' => '2017-07-31 22:59:45',
                'deleted_at' => NULL,
            ),
            240 => 
            array (
                'id' => 1002240,
                'author_id' => 428,
                'quote_text' => 'If you\'re going to have a satisfactory standard of living, you\'re going to have to be competitive in this world. And you can\'t be competitive if you don\'t have a good education.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:00:20',
                'created_at' => '2017-07-31 23:00:15',
                'updated_at' => '2017-07-31 23:00:20',
                'deleted_at' => NULL,
            ),
            241 => 
            array (
                'id' => 1002241,
                'author_id' => 416,
                'quote_text' => 'Sports ideally teach discipline and commitment. They challenge you and build character for everything you do in life.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:01:42',
                'created_at' => '2017-07-31 23:01:31',
                'updated_at' => '2017-07-31 23:01:42',
                'deleted_at' => NULL,
            ),
            242 => 
            array (
                'id' => 1002242,
                'author_id' => 410,
                'quote_text' => 'If your dream ain\'t bigger than you, there\'s a problem with your dream.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:08:30',
                'created_at' => '2017-07-31 23:08:25',
                'updated_at' => '2017-07-31 23:08:30',
                'deleted_at' => NULL,
            ),
            243 => 
            array (
                'id' => 1002243,
                'author_id' => 410,
                'quote_text' => 'If you look good, you feel good, If you feel good, you play good, If you play good, they pay good.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:08:31',
                'created_at' => '2017-07-31 23:07:57',
                'updated_at' => '2017-07-31 23:08:31',
                'deleted_at' => NULL,
            ),
            244 => 
            array (
                'id' => 1002244,
                'author_id' => 129,
                'quote_text' => 'Statistics are no substitute for judgment.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:15:32',
                'created_at' => '2017-07-31 23:15:28',
                'updated_at' => '2017-07-31 23:15:32',
                'deleted_at' => NULL,
            ),
            245 => 
            array (
                'id' => 1002245,
                'author_id' => 205,
                'quote_text' => 'The path of least resistance is a terrible teacher.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:18:42',
                'created_at' => '2017-07-31 23:18:37',
                'updated_at' => '2017-07-31 23:18:42',
                'deleted_at' => NULL,
            ),
            246 => 
            array (
                'id' => 1002246,
                'author_id' => 205,
                'quote_text' => 'If you want momentum, you’ll have to create it yourself, right now, by getting up and getting started.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:18:43',
                'created_at' => '2017-07-31 23:17:13',
                'updated_at' => '2017-07-31 23:18:43',
                'deleted_at' => NULL,
            ),
            247 => 
            array (
                'id' => 1002247,
                'author_id' => 205,
                'quote_text' => 'Where the head goes, the body follow. Perception precedes action. Right action follows the right perspective.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:18:44',
                'created_at' => '2017-07-31 23:16:52',
                'updated_at' => '2017-07-31 23:18:44',
                'deleted_at' => NULL,
            ),
            248 => 
            array (
                'id' => 1002248,
                'author_id' => 45,
                'quote_text' => 'Start with the end in mind.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:21:03',
                'created_at' => '2017-07-31 23:20:58',
                'updated_at' => '2017-07-31 23:21:03',
                'deleted_at' => NULL,
            ),
            249 => 
            array (
                'id' => 1002249,
                'author_id' => 45,
                'quote_text' => 'The key is not to prioritize what\'s on your schedule, but to schedule your priorities.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:21:04',
                'created_at' => '2017-07-31 23:20:50',
                'updated_at' => '2017-07-31 23:21:04',
                'deleted_at' => NULL,
            ),
            250 => 
            array (
                'id' => 1002250,
                'author_id' => 45,
                'quote_text' => 'Seek first to understand, then to be understood.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:21:06',
                'created_at' => '2017-07-31 23:20:43',
                'updated_at' => '2017-07-31 23:21:06',
                'deleted_at' => NULL,
            ),
            251 => 
            array (
                'id' => 1002251,
                'author_id' => 45,
                'quote_text' => 'Trust is the glue of life. It\'s the most essential ingredient in effective communication. It\'s the foundational principle that holds all relationships.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:21:07',
                'created_at' => '2017-07-31 23:20:35',
                'updated_at' => '2017-07-31 23:21:07',
                'deleted_at' => NULL,
            ),
            252 => 
            array (
                'id' => 1002252,
                'author_id' => 45,
                'quote_text' => 'Live out of your imagination, not your history.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:21:08',
                'created_at' => '2017-07-31 23:20:21',
                'updated_at' => '2017-07-31 23:21:08',
                'deleted_at' => NULL,
            ),
            253 => 
            array (
                'id' => 1002253,
                'author_id' => 45,
                'quote_text' => 'The main thing is to keep the main thing the main thing.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:21:10',
                'created_at' => '2017-07-31 23:20:13',
                'updated_at' => '2017-07-31 23:21:10',
                'deleted_at' => NULL,
            ),
            254 => 
            array (
                'id' => 1002254,
                'author_id' => 45,
                'quote_text' => 'There are three constants in life... change, choice and principles.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:21:11',
                'created_at' => '2017-07-31 23:20:04',
                'updated_at' => '2017-07-31 23:21:11',
                'deleted_at' => NULL,
            ),
            255 => 
            array (
                'id' => 1002255,
                'author_id' => 45,
                'quote_text' => 'Motivation is a fire from within. If someone else tries to light that fire under you, chances are it will burn very briefly.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:21:12',
                'created_at' => '2017-07-31 23:19:49',
                'updated_at' => '2017-07-31 23:21:12',
                'deleted_at' => NULL,
            ),
            256 => 
            array (
                'id' => 1002256,
                'author_id' => 19,
                'quote_text' => 'Develop success from failures. Discouragement and failure are two of the surest stepping stones to success.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:09',
                'created_at' => '2017-07-31 23:23:56',
                'updated_at' => '2017-07-31 23:24:09',
                'deleted_at' => NULL,
            ),
            257 => 
            array (
                'id' => 1002257,
                'author_id' => 19,
                'quote_text' => 'Inaction breeds doubt and fear. Action breeds confidence and courage. If you want to conquer fear, do not sit home and think about it. Go out and get busy.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:10',
                'created_at' => '2017-07-31 23:23:46',
                'updated_at' => '2017-07-31 23:24:10',
                'deleted_at' => NULL,
            ),
            258 => 
            array (
                'id' => 1002258,
                'author_id' => 19,
                'quote_text' => 'People rarely succeed unless they have fun in what they are doing.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:11',
                'created_at' => '2017-07-31 23:23:33',
                'updated_at' => '2017-07-31 23:24:11',
                'deleted_at' => NULL,
            ),
            259 => 
            array (
                'id' => 1002259,
                'author_id' => 19,
                'quote_text' => 'Any fool can criticize, condemn, and complain but it takes character and self control to be understanding and forgiving.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:12',
                'created_at' => '2017-07-31 23:23:26',
                'updated_at' => '2017-07-31 23:24:12',
                'deleted_at' => NULL,
            ),
            260 => 
            array (
                'id' => 1002260,
                'author_id' => 19,
                'quote_text' => 'You can conquer almost any fear if you will only make up your mind to do so. For remember, fear doesn\'t exist anywhere except in the mind.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:13',
                'created_at' => '2017-07-31 23:22:55',
                'updated_at' => '2017-07-31 23:24:13',
                'deleted_at' => NULL,
            ),
            261 => 
            array (
                'id' => 1002261,
                'author_id' => 19,
                'quote_text' => 'When dealing with people, remember you are not dealing with creatures of logic, but creatures of emotion.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:14',
                'created_at' => '2017-07-31 23:22:45',
                'updated_at' => '2017-07-31 23:24:14',
                'deleted_at' => NULL,
            ),
            262 => 
            array (
                'id' => 1002262,
                'author_id' => 19,
                'quote_text' => 'It isn\'t what you have, or who you are, or where you are, or what you are doing that makes you happy or unhappy. It is what you think about.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:16',
                'created_at' => '2017-07-31 23:22:36',
                'updated_at' => '2017-07-31 23:24:16',
                'deleted_at' => NULL,
            ),
            263 => 
            array (
                'id' => 1002263,
                'author_id' => 19,
                'quote_text' => 'Most of the important things in the world have been accomplished by people who have kept on trying when there seemed to be no hope at all.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:17',
                'created_at' => '2017-07-31 23:22:25',
                'updated_at' => '2017-07-31 23:24:17',
                'deleted_at' => NULL,
            ),
            264 => 
            array (
                'id' => 1002264,
                'author_id' => 19,
                'quote_text' => 'You can make more friends in two months by becoming interested in other people than you can in two years by trying to get other people interested in you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:24:18',
                'created_at' => '2017-07-31 23:22:16',
                'updated_at' => '2017-07-31 23:24:18',
                'deleted_at' => NULL,
            ),
            265 => 
            array (
                'id' => 1002265,
                'author_id' => 16,
                'quote_text' => 'I have not failed. I\'ve just found 10,000 ways that won\'t work.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:46',
                'created_at' => '2017-07-31 23:26:41',
                'updated_at' => '2017-07-31 23:26:46',
                'deleted_at' => NULL,
            ),
            266 => 
            array (
                'id' => 1002266,
                'author_id' => 16,
                'quote_text' => 'Genius is one percent inspiration and ninety-nine percent perspiration.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:47',
                'created_at' => '2017-07-31 23:26:34',
                'updated_at' => '2017-07-31 23:26:47',
                'deleted_at' => NULL,
            ),
            267 => 
            array (
                'id' => 1002267,
                'author_id' => 16,
                'quote_text' => 'Opportunity is missed by most people because it is dressed in overalls and looks like work.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:49',
                'created_at' => '2017-07-31 23:26:22',
                'updated_at' => '2017-07-31 23:26:49',
                'deleted_at' => NULL,
            ),
            268 => 
            array (
                'id' => 1002268,
                'author_id' => 16,
                'quote_text' => 'Many of life\'s failures are people who did not realize how close they were to success when they gave up.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:50',
                'created_at' => '2017-07-31 23:26:11',
                'updated_at' => '2017-07-31 23:26:50',
                'deleted_at' => NULL,
            ),
            269 => 
            array (
                'id' => 1002269,
                'author_id' => 16,
                'quote_text' => 'If we all did the things we are capable of doing, we would literally astound ourselves.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:52',
                'created_at' => '2017-07-31 23:26:03',
                'updated_at' => '2017-07-31 23:26:52',
                'deleted_at' => NULL,
            ),
            270 => 
            array (
                'id' => 1002270,
                'author_id' => 16,
                'quote_text' => 'Hell, there are no rules here - we\'re trying to accomplish something.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:54',
                'created_at' => '2017-07-31 23:25:54',
                'updated_at' => '2017-07-31 23:26:54',
                'deleted_at' => NULL,
            ),
            271 => 
            array (
                'id' => 1002271,
                'author_id' => 16,
                'quote_text' => 'Our greatest weakness lies in giving up. The most certain way to succeed is always to try just one more time.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:55',
                'created_at' => '2017-07-31 23:25:39',
                'updated_at' => '2017-07-31 23:26:55',
                'deleted_at' => NULL,
            ),
            272 => 
            array (
                'id' => 1002272,
                'author_id' => 16,
                'quote_text' => 'Show me a thoroughly satisfied man and I will show you a failure.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:57',
                'created_at' => '2017-07-31 23:25:32',
                'updated_at' => '2017-07-31 23:26:57',
                'deleted_at' => NULL,
            ),
            273 => 
            array (
                'id' => 1002273,
                'author_id' => 16,
                'quote_text' => 'Just because something doesn\'t do what you planned it to do doesn\'t mean it\'s useless.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:58',
                'created_at' => '2017-07-31 23:25:24',
                'updated_at' => '2017-07-31 23:26:58',
                'deleted_at' => NULL,
            ),
            274 => 
            array (
                'id' => 1002274,
                'author_id' => 16,
                'quote_text' => 'Everything comes to him who hustles while he waits.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:26:59',
                'created_at' => '2017-07-31 23:25:14',
                'updated_at' => '2017-07-31 23:26:59',
                'deleted_at' => NULL,
            ),
            275 => 
            array (
                'id' => 1002275,
                'author_id' => 139,
                'quote_text' => 'If I have seen further than others, it is by standing upon the shoulders of giants.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:21',
                'created_at' => '2017-07-31 23:29:17',
                'updated_at' => '2017-07-31 23:29:21',
                'deleted_at' => NULL,
            ),
            276 => 
            array (
                'id' => 1002276,
                'author_id' => 139,
                'quote_text' => 'I can calculate the motion of heavenly bodies, but not the madness of people.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:24',
                'created_at' => '2017-07-31 23:29:07',
                'updated_at' => '2017-07-31 23:29:24',
                'deleted_at' => NULL,
            ),
            277 => 
            array (
                'id' => 1002277,
                'author_id' => 139,
                'quote_text' => 'Tact is the knack of making a point without making an enemy.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:26',
                'created_at' => '2017-07-31 23:28:58',
                'updated_at' => '2017-07-31 23:29:26',
                'deleted_at' => NULL,
            ),
            278 => 
            array (
                'id' => 1002278,
                'author_id' => 139,
                'quote_text' => 'Truth is ever to be found in simplicity, and not in the multiplicity and confusion of things.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:28',
                'created_at' => '2017-07-31 23:28:50',
                'updated_at' => '2017-07-31 23:29:28',
                'deleted_at' => NULL,
            ),
            279 => 
            array (
                'id' => 1002279,
                'author_id' => 139,
                'quote_text' => 'A man may imagine things that are false, but he can only understand things that are true, for if the things be false, the apprehension of them is not understanding.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:29',
                'created_at' => '2017-07-31 23:28:42',
                'updated_at' => '2017-07-31 23:29:29',
                'deleted_at' => NULL,
            ),
            280 => 
            array (
                'id' => 1002280,
                'author_id' => 139,
                'quote_text' => 'This most beautiful system of the sun, planets and comets, could only proceed from the counsel and dominion of an intelligent and powerful Being.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:32',
                'created_at' => '2017-07-31 23:28:34',
                'updated_at' => '2017-07-31 23:29:32',
                'deleted_at' => NULL,
            ),
            281 => 
            array (
                'id' => 1002281,
                'author_id' => 139,
                'quote_text' => 'To every action there is always opposed an equal reaction.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:34',
                'created_at' => '2017-07-31 23:28:25',
                'updated_at' => '2017-07-31 23:29:34',
                'deleted_at' => NULL,
            ),
            282 => 
            array (
                'id' => 1002282,
                'author_id' => 139,
                'quote_text' => 'If I have done the public any service, it is due to my patient thought.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:35',
                'created_at' => '2017-07-31 23:28:17',
                'updated_at' => '2017-07-31 23:29:35',
                'deleted_at' => NULL,
            ),
            283 => 
            array (
                'id' => 1002283,
                'author_id' => 139,
                'quote_text' => 'To myself I am only a child playing on the beach, while vast oceans of truth lie undiscovered before me.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:37',
                'created_at' => '2017-07-31 23:28:08',
                'updated_at' => '2017-07-31 23:29:37',
                'deleted_at' => NULL,
            ),
            284 => 
            array (
                'id' => 1002284,
                'author_id' => 139,
                'quote_text' => 'Errors are not in the art but in the artificers.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:29:38',
                'created_at' => '2017-07-31 23:27:58',
                'updated_at' => '2017-07-31 23:29:38',
                'deleted_at' => NULL,
            ),
            285 => 
            array (
                'id' => 1002285,
                'author_id' => 17,
                'quote_text' => 'Try not to become a man of success, but rather try to become a man of value.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:29',
                'created_at' => '2017-07-31 23:32:26',
                'updated_at' => '2017-07-31 23:32:29',
                'deleted_at' => NULL,
            ),
            286 => 
            array (
                'id' => 1002286,
                'author_id' => 17,
                'quote_text' => 'Imagination is more important than knowledge.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:31',
                'created_at' => '2017-07-31 23:32:17',
                'updated_at' => '2017-07-31 23:32:31',
                'deleted_at' => NULL,
            ),
            287 => 
            array (
                'id' => 1002287,
                'author_id' => 17,
                'quote_text' => 'The important thing is not to stop questioning. Curiosity has its own reason for existing.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:32',
                'created_at' => '2017-07-31 23:32:09',
                'updated_at' => '2017-07-31 23:32:32',
                'deleted_at' => NULL,
            ),
            288 => 
            array (
                'id' => 1002288,
                'author_id' => 17,
                'quote_text' => 'Anyone who has never made a mistake has never tried anything new.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:33',
                'created_at' => '2017-07-31 23:32:00',
                'updated_at' => '2017-07-31 23:32:33',
                'deleted_at' => NULL,
            ),
            289 => 
            array (
                'id' => 1002289,
                'author_id' => 17,
                'quote_text' => 'Two things are infinite: the universe and human stupidity; and I\'m not sure about the universe.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:34',
                'created_at' => '2017-07-31 23:31:43',
                'updated_at' => '2017-07-31 23:32:34',
                'deleted_at' => NULL,
            ),
            290 => 
            array (
                'id' => 1002290,
                'author_id' => 17,
                'quote_text' => 'Science without religion is lame, religion without science is blind.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:35',
                'created_at' => '2017-07-31 23:31:26',
                'updated_at' => '2017-07-31 23:32:35',
                'deleted_at' => NULL,
            ),
            291 => 
            array (
                'id' => 1002291,
                'author_id' => 17,
                'quote_text' => 'No problem can be solved from the same level of consciousness that created it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:37',
                'created_at' => '2017-07-31 23:31:16',
                'updated_at' => '2017-07-31 23:32:37',
                'deleted_at' => NULL,
            ),
            292 => 
            array (
                'id' => 1002292,
                'author_id' => 17,
                'quote_text' => 'Everything should be made as simple as possible, but not simpler.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:38',
                'created_at' => '2017-07-31 23:31:07',
                'updated_at' => '2017-07-31 23:32:38',
                'deleted_at' => NULL,
            ),
            293 => 
            array (
                'id' => 1002293,
                'author_id' => 17,
                'quote_text' => 'The most beautiful thing we can experience is the mysterious. It is the source of all true art and science.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:39',
                'created_at' => '2017-07-31 23:30:56',
                'updated_at' => '2017-07-31 23:32:39',
                'deleted_at' => NULL,
            ),
            294 => 
            array (
                'id' => 1002294,
                'author_id' => 17,
                'quote_text' => 'I have no special talents. I am only passionately curious.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:32:41',
                'created_at' => '2017-07-31 23:30:47',
                'updated_at' => '2017-07-31 23:32:41',
                'deleted_at' => NULL,
            ),
            295 => 
            array (
                'id' => 1002295,
                'author_id' => 17,
                'quote_text' => 'Example isn\'t another way to teach, it is the only way to teach.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:34:59',
                'created_at' => '2017-07-31 23:34:54',
                'updated_at' => '2017-07-31 23:34:59',
                'deleted_at' => NULL,
            ),
            296 => 
            array (
                'id' => 1002296,
                'author_id' => 17,
                'quote_text' => 'Logic will get you from A to B. Imagination will take you everywhere.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:35:00',
                'created_at' => '2017-07-31 23:34:33',
                'updated_at' => '2017-07-31 23:35:00',
                'deleted_at' => NULL,
            ),
            297 => 
            array (
                'id' => 1002297,
                'author_id' => 17,
                'quote_text' => 'Insanity: doing the same thing over and over again and expecting different results.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-07-31 23:35:01',
                'created_at' => '2017-07-31 23:34:14',
                'updated_at' => '2017-07-31 23:35:01',
                'deleted_at' => NULL,
            ),
            298 => 
            array (
                'id' => 1002298,
                'author_id' => 52,
                'quote_text' => 'To go to heaven, fully to enjoy God, is infinitely better than the most pleasant accommodations here.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:05:00',
                'created_at' => '2017-08-01 00:04:54',
                'updated_at' => '2017-08-01 00:05:00',
                'deleted_at' => NULL,
            ),
            299 => 
            array (
                'id' => 1002299,
                'author_id' => 52,
                'quote_text' => 'Grace is but glory begun, and glory is but grace perfected.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:05:01',
                'created_at' => '2017-08-01 00:04:41',
                'updated_at' => '2017-08-01 00:05:01',
                'deleted_at' => NULL,
            ),
            300 => 
            array (
                'id' => 1002300,
                'author_id' => 52,
                'quote_text' => 'Prayer is as natural an expression of faith as breathing is of life.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:05:03',
                'created_at' => '2017-08-01 00:04:28',
                'updated_at' => '2017-08-01 00:05:03',
                'deleted_at' => NULL,
            ),
            301 => 
            array (
                'id' => 1002301,
                'author_id' => 52,
                'quote_text' => 'The way to Heaven is ascending; we must be content to travel uphill, though it be hard and tiresome, and contrary to the natural bias of our flesh.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:05:04',
                'created_at' => '2017-08-01 00:04:20',
                'updated_at' => '2017-08-01 00:05:04',
                'deleted_at' => NULL,
            ),
            302 => 
            array (
                'id' => 1002302,
                'author_id' => 52,
                'quote_text' => 'The happiness of the creature consists in rejoicing in God, by which also God is magnified and exalted.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:05:05',
                'created_at' => '2017-08-01 00:04:09',
                'updated_at' => '2017-08-01 00:05:05',
                'deleted_at' => NULL,
            ),
            303 => 
            array (
                'id' => 1002303,
                'author_id' => 52,
                'quote_text' => 'Resolution One: I will live for God. Resolution Two: If no one else does, I still will.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:05:06',
                'created_at' => '2017-08-01 00:03:55',
                'updated_at' => '2017-08-01 00:05:06',
                'deleted_at' => NULL,
            ),
            304 => 
            array (
                'id' => 1002304,
                'author_id' => 52,
                'quote_text' => 'Resolved, never to do anything which I should be afraid to do if it were the last hour of my life.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:05:08',
                'created_at' => '2017-08-01 00:03:42',
                'updated_at' => '2017-08-01 00:05:08',
                'deleted_at' => NULL,
            ),
            305 => 
            array (
                'id' => 1002305,
                'author_id' => 17,
                'quote_text' => 'If you can\'t explain it simply, you don\'t understand it well enough.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:12:18',
                'created_at' => '2017-08-01 00:12:12',
                'updated_at' => '2017-08-01 00:12:18',
                'deleted_at' => NULL,
            ),
            306 => 
            array (
                'id' => 1002306,
                'author_id' => 17,
                'quote_text' => 'The only way to escape the corruptible effect of praise is to go on working.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:18:33',
                'created_at' => '2017-08-01 00:18:23',
                'updated_at' => '2017-08-01 00:18:33',
                'deleted_at' => NULL,
            ),
            307 => 
            array (
                'id' => 1002307,
                'author_id' => 17,
                'quote_text' => 'A happy man is too satisfied with the present to dwell too much on the future.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:18:35',
                'created_at' => '2017-08-01 00:17:23',
                'updated_at' => '2017-08-01 00:18:35',
                'deleted_at' => NULL,
            ),
            308 => 
            array (
                'id' => 1002308,
                'author_id' => 15,
                'quote_text' => 'Go as far as you can see; when you get there, you\'ll be able to see farther.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:28:51',
                'created_at' => '2017-08-01 00:27:47',
                'updated_at' => '2017-08-01 00:28:51',
                'deleted_at' => NULL,
            ),
            309 => 
            array (
                'id' => 1002309,
                'author_id' => 15,
                'quote_text' => 'If you have to ask how much it costs, you can\'t afford it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:28:53',
                'created_at' => '2017-08-01 00:27:18',
                'updated_at' => '2017-08-01 00:28:53',
                'deleted_at' => NULL,
            ),
            310 => 
            array (
                'id' => 1002310,
                'author_id' => 15,
                'quote_text' => 'The first step towards getting somewhere is to decide that you are not going to stay where you are.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:28:54',
                'created_at' => '2017-08-01 00:27:05',
                'updated_at' => '2017-08-01 00:28:54',
                'deleted_at' => NULL,
            ),
            311 => 
            array (
                'id' => 1002311,
                'author_id' => 15,
                'quote_text' => 'A man generally has two reasons for doing a thing. One that sounds good, and a real one.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:28:55',
                'created_at' => '2017-08-01 00:26:55',
                'updated_at' => '2017-08-01 00:28:55',
                'deleted_at' => NULL,
            ),
            312 => 
            array (
                'id' => 1002312,
                'author_id' => 15,
                'quote_text' => 'Anyone can be a millionaire, but to become a billionaire you need an astrologer.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:28:56',
                'created_at' => '2017-08-01 00:26:43',
                'updated_at' => '2017-08-01 00:28:56',
                'deleted_at' => NULL,
            ),
            313 => 
            array (
                'id' => 1002313,
                'author_id' => 15,
                'quote_text' => 'I don’t want a lawyer who tells me what I can’t do. I hire a lawyer to tell me how I can do what I want.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:33:49',
                'created_at' => '2017-08-01 00:30:11',
                'updated_at' => '2017-08-01 00:33:49',
                'deleted_at' => NULL,
            ),
            314 => 
            array (
                'id' => 1002314,
                'author_id' => 13,
                'quote_text' => 'No man will make a great leader who wants to do it all himself, or to get all the credit for doing it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:36:58',
                'created_at' => '2017-08-01 00:36:03',
                'updated_at' => '2017-08-01 00:36:58',
                'deleted_at' => NULL,
            ),
            315 => 
            array (
                'id' => 1002315,
                'author_id' => 13,
                'quote_text' => 'As I grow older, I pay less attention to what men say. I just watch what they do.',
                'created_by' => 1,
