            ),
            317 => 
            array (
                'id' => 1002317,
                'author_id' => 13,
                'quote_text' => 'The man who acquires the ability to take full possession of his own mind may take possession of anything else to which he is justly entitled.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:37:02',
