            ),
            324 => 
            array (
                'id' => 1002324,
                'author_id' => 13,
                'quote_text' => 'Teamwork is the ability to work together toward a common vision. It is the fuel that allows common people to attain uncommon results.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:39:35',
                'created_at' => '2017-08-01 00:38:45',
                'updated_at' => '2017-08-01 00:39:35',
                'deleted_at' => NULL,
            ),
            325 => 
            array (
                'id' => 1002325,
                'author_id' => 13,
                'quote_text' => 'I shall argue that strong men, conversely, know when to compromise and that all principles can be compromised to serve a greater principle.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:39:36',
                'created_at' => '2017-08-01 00:38:31',
                'updated_at' => '2017-08-01 00:39:36',
                'deleted_at' => NULL,
            ),
            326 => 
            array (
                'id' => 1002326,
                'author_id' => 13,
                'quote_text' => 'Success can be attained in any branch of human labor. There is always room at the top in every pursuit. Concentrate all your thought and energy upon the performance of your duties.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:39:37',
                'created_at' => '2017-08-01 00:38:14',
                'updated_at' => '2017-08-01 00:39:37',
                'deleted_at' => NULL,
            ),
            327 => 
            array (
                'id' => 1002327,
                'author_id' => 13,
                'quote_text' => 'Do not look for approval except for the consciousness of doing your best.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:39:38',
                'created_at' => '2017-08-01 00:37:39',
                'updated_at' => '2017-08-01 00:39:38',
                'deleted_at' => NULL,
            ),
            328 => 
            array (
                'id' => 1002328,
                'author_id' => 13,
                'quote_text' => 'The men who have succeeded are men who have chosen one line and stuck to it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:41:27',
                'created_at' => '2017-08-01 00:39:58',
                'updated_at' => '2017-08-01 00:41:27',
                'deleted_at' => NULL,
            ),
            329 => 
            array (
                'id' => 1002329,
                'author_id' => 14,
                'quote_text' => 'If you want to succeed you should strike out on new paths, rather than travel the worn paths of accepted success.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:24',
                'created_at' => '2017-08-01 00:44:20',
                'updated_at' => '2017-08-01 00:44:24',
                'deleted_at' => NULL,
            ),
            330 => 
            array (
                'id' => 1002330,
                'author_id' => 14,
                'quote_text' => 'I do not think that there is any other quality so essential to success of any kind as the quality of perseverance. It overcomes almost everything, even nature.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:25',
                'created_at' => '2017-08-01 00:44:11',
                'updated_at' => '2017-08-01 00:44:25',
                'deleted_at' => NULL,
            ),
            331 => 
            array (
                'id' => 1002331,
                'author_id' => 14,
                'quote_text' => 'Good management consists in showing average people how to do the work of superior people.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:26',
                'created_at' => '2017-08-01 00:43:55',
                'updated_at' => '2017-08-01 00:44:26',
                'deleted_at' => NULL,
            ),
            332 => 
            array (
                'id' => 1002332,
                'author_id' => 14,
                'quote_text' => 'If your only goal is to become rich, you will never achieve it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:27',
                'created_at' => '2017-08-01 00:43:44',
                'updated_at' => '2017-08-01 00:44:27',
                'deleted_at' => NULL,
            ),
            333 => 
            array (
                'id' => 1002333,
                'author_id' => 14,
                'quote_text' => 'I would rather earn 1% off a 100 people\'s efforts than 100% of my own efforts.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:28',
                'created_at' => '2017-08-01 00:43:34',
                'updated_at' => '2017-08-01 00:44:28',
                'deleted_at' => NULL,
            ),
            334 => 
            array (
                'id' => 1002334,
                'author_id' => 14,
                'quote_text' => 'I always tried to turn every disaster into an opportunity.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:29',
                'created_at' => '2017-08-01 00:43:22',
                'updated_at' => '2017-08-01 00:44:29',
                'deleted_at' => NULL,
            ),
            335 => 
            array (
                'id' => 1002335,
                'author_id' => 14,
                'quote_text' => 'The ability to deal with people is as purchasable a commodity as sugar or coffee and I will pay more for that ability than for any other under the sun.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:31',
                'created_at' => '2017-08-01 00:43:14',
                'updated_at' => '2017-08-01 00:44:31',
                'deleted_at' => NULL,
            ),
            336 => 
            array (
                'id' => 1002336,
                'author_id' => 14,
                'quote_text' => 'Singleness of purpose is one of the chief essentials for success in life, no matter what may be one\'s aim.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:32',
                'created_at' => '2017-08-01 00:42:59',
                'updated_at' => '2017-08-01 00:44:32',
                'deleted_at' => NULL,
            ),
            337 => 
            array (
                'id' => 1002337,
                'author_id' => 14,
                'quote_text' => 'A friendship founded on business is better than a business founded on friendship.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:44:33',
                'created_at' => '2017-08-01 00:42:52',
                'updated_at' => '2017-08-01 00:44:33',
                'deleted_at' => NULL,
            ),
            338 => 
            array (
                'id' => 1002338,
                'author_id' => 12,
                'quote_text' => 'If I had learned education I would not have had time to learn anything else.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:45:54',
                'created_at' => '2017-08-01 00:45:50',
                'updated_at' => '2017-08-01 00:45:54',
                'deleted_at' => NULL,
            ),
            339 => 
            array (
                'id' => 1002339,
                'author_id' => 12,
                'quote_text' => 'I don\'t care half so much about making money as I do about making my point, and coming out ahead.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:45:55',
                'created_at' => '2017-08-01 00:45:41',
                'updated_at' => '2017-08-01 00:45:55',
                'deleted_at' => NULL,
            ),
            340 => 
            array (
                'id' => 1002340,
                'author_id' => 12,
                'quote_text' => 'You have undertaken to cheat me. I won\'t sue you, for the law is too slow. I\'ll ruin you.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:45:56',
                'created_at' => '2017-08-01 00:45:28',
                'updated_at' => '2017-08-01 00:45:56',
                'deleted_at' => NULL,
            ),
            341 => 
            array (
                'id' => 1002341,
                'author_id' => 12,
                'quote_text' => 'There is no friendship in trade.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:46:48',
                'created_at' => '2017-08-01 00:46:45',
                'updated_at' => '2017-08-01 00:46:48',
                'deleted_at' => NULL,
            ),
            342 => 
            array (
                'id' => 1002342,
                'author_id' => 12,
                'quote_text' => 'Never be a minion, always be an owner.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:46:50',
                'created_at' => '2017-08-01 00:46:31',
                'updated_at' => '2017-08-01 00:46:50',
                'deleted_at' => NULL,
            ),
            343 => 
            array (
                'id' => 1002343,
                'author_id' => 196,
                'quote_text' => 'Wear your failure as a badge of honor.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 00:51:17',
                'created_at' => '2017-08-01 00:51:13',
                'updated_at' => '2017-08-01 00:51:17',
                'deleted_at' => NULL,
            ),
            344 => 
            array (
                'id' => 1002344,
                'author_id' => 196,
                'quote_text' => 'Academics is important but not everything. Take risks, try different things, follow your passion.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 01:01:48',
                'created_at' => '2017-08-01 00:54:02',
                'updated_at' => '2017-08-01 01:01:48',
                'deleted_at' => NULL,
            ),
            345 => 
            array (
                'id' => 1002345,
                'author_id' => 182,
                'quote_text' => 'I have to completely rethink the problem in a certain way, but I think that’s just how software development goes because you would never get anything right just from the first try.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 01:13:14',
                'created_at' => '2017-08-01 01:11:03',
                'updated_at' => '2017-08-01 01:13:14',
                'deleted_at' => NULL,
            ),
            346 => 
            array (
                'id' => 1002346,
                'author_id' => 182,
                'quote_text' => 'I was attracted to JavaScript because of the ability to just build something and share it instantly with the world. You put it on the web, and you get a URL, you can send it to anyone with a browser.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 01:13:16',
                'created_at' => '2017-08-01 01:04:04',
                'updated_at' => '2017-08-01 01:13:16',
                'deleted_at' => NULL,
            ),
            347 => 
            array (
                'id' => 1002347,
                'author_id' => 182,
                'quote_text' => 'I also really care about the approachability part of Vue, which is rooted in the belief that technology should be enabling more people to build things.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 01:13:24',
                'created_at' => '2017-08-01 01:13:21',
                'updated_at' => '2017-08-01 01:13:24',
                'deleted_at' => NULL,
            ),
            348 => 
            array (
                'id' => 1002348,
                'author_id' => 182,
                'quote_text' => 'I basically learned programming through just random online resources and books, but an important way that I learned was just by reading other people’s code.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 01:20:17',
                'created_at' => '2017-08-01 01:20:13',
                'updated_at' => '2017-08-01 01:20:17',
                'deleted_at' => NULL,
            ),
            349 => 
            array (
                'id' => 1002349,
                'author_id' => 191,
                'quote_text' => 'Be a user of your own product. Make it better based on your own desires. But don’t trick yourself into thinking you are your user.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:05:44',
                'created_at' => '2017-08-01 03:05:40',
                'updated_at' => '2017-08-01 03:05:44',
                'deleted_at' => NULL,
            ),
            350 => 
            array (
                'id' => 1002350,
                'author_id' => 191,
                'quote_text' => 'Creativity comes from constraint.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:05:45',
                'created_at' => '2017-08-01 03:05:31',
                'updated_at' => '2017-08-01 03:05:45',
                'deleted_at' => NULL,
            ),
            351 => 
            array (
                'id' => 1002351,
                'author_id' => 191,
                'quote_text' => 'User experience is everything. It always has been, but it’s still undervalued and under-invested in. If you don’t know user-centered design, study it. Hire people who know it. Obsess over it. Live and breathe it. Get your whole company on board.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:05:46',
                'created_at' => '2017-08-01 03:04:59',
                'updated_at' => '2017-08-01 03:05:46',
                'deleted_at' => NULL,
            ),
            352 => 
            array (
                'id' => 1002352,
                'author_id' => 191,
                'quote_text' => 'When I meet with the founders of a new company, my advice is almost always, ‘Do fewer things.’ It’s true of partnerships, marketing opportunities, anything that’s taking up your time. The vast majority of things are distractions, and very few really matter to your success.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:05:48',
                'created_at' => '2017-08-01 03:04:48',
                'updated_at' => '2017-08-01 03:05:48',
                'deleted_at' => NULL,
            ),
            353 => 
            array (
                'id' => 1002353,
                'author_id' => 191,
                'quote_text' => 'When you’re obsessing about one thing, you can reach insights about how to solve hard problems. If you have too many things to think about, you’ll get to the superficial solution, not the brilliant one.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:08:49',
                'created_at' => '2017-08-01 03:07:58',
                'updated_at' => '2017-08-01 03:08:49',
                'deleted_at' => NULL,
            ),
            354 => 
            array (
                'id' => 1002354,
                'author_id' => 191,
                'quote_text' => 'Luck comes in many forms—and often looks bad at first. I always look back on the deals that we didn’t do and the things that didn’t work out, and realize what seemed like a bummer at the time was really lucky. …if you have some plan and it doesn’t go that way, roll with it. There’s no way to know if it’s good or bad until later, if ever.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:08:51',
                'created_at' => '2017-08-01 03:07:48',
                'updated_at' => '2017-08-01 03:08:51',
                'deleted_at' => NULL,
            ),
            355 => 
            array (
                'id' => 1002355,
                'author_id' => 191,
                'quote_text' => 'I think one of the things that kills great things so often is compromise—letting people talk you out of what your gut is telling you. Not that I don’t value people’s input, but you have to have the strength to ignore it sometimes, too. If you feel really strongly, there might be something to that, and if you see something that other people don’t see, it could be because it’s that powerful and different. If everyone agrees, it’s probably because you’re not doing anything original.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:08:53',
                'created_at' => '2017-08-01 03:07:21',
                'updated_at' => '2017-08-01 03:08:53',
                'deleted_at' => NULL,
            ),
            356 => 
            array (
                'id' => 1002356,
                'author_id' => 191,
                'quote_text' => 'I was surprised by the success of something so simple. That’s a mantra for many people in the technology world—simplicity. But what we built wasn’t that amazing. It was the idea of putting a couple of things together and being able to establish a lead by doing something really, really simple. How far you can get on a simple idea is amazing… Simplicity is powerful.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:08:55',
                'created_at' => '2017-08-01 03:06:44',
                'updated_at' => '2017-08-01 03:08:55',
                'deleted_at' => NULL,
            ),
            357 => 
            array (
                'id' => 1002357,
                'author_id' => 191,
                'quote_text' => 'Love those close to you. Failure of your company is not failure in life. Failure in your relationships is.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:10:06',
                'created_at' => '2017-08-01 03:10:01',
                'updated_at' => '2017-08-01 03:10:06',
                'deleted_at' => NULL,
            ),
            358 => 
            array (
                'id' => 1002358,
                'author_id' => 191,
                'quote_text' => 'Take care of yourself. When you don’t sleep, eat crap, don’t exercise, and are living off adrenaline for too long, your performance suffers. Your decisions suffer. Your company suffers.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:10:07',
                'created_at' => '2017-08-01 03:09:52',
                'updated_at' => '2017-08-01 03:10:07',
                'deleted_at' => NULL,
            ),
            359 => 
            array (
                'id' => 1002359,
                'author_id' => 191,
                'quote_text' => 'Take on big challenges. It’s pretty simple: Hard things are valuable; easy things are not so valuable. Reaching the mountaintop is rewarding because it is hard. If it was easy, everybody would do it.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:10:09',
                'created_at' => '2017-08-01 03:09:33',
                'updated_at' => '2017-08-01 03:10:09',
                'deleted_at' => NULL,
            ),
            360 => 
            array (
                'id' => 1002360,
                'author_id' => 191,
                'quote_text' => 'Work with amazing people. Don’t compromise on who you choose to found your company with and hire. Do not put up with ego-centric personalities or downer attitudes.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:10:10',
                'created_at' => '2017-08-01 03:09:16',
                'updated_at' => '2017-08-01 03:10:10',
                'deleted_at' => NULL,
            ),
            361 => 
            array (
                'id' => 1002361,
                'author_id' => 37,
                'quote_text' => 'If decisions were a choice between alternatives, decisions would come easy. Decision is the selection and formulation of alternatives.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:16:07',
                'created_at' => '2017-08-01 03:16:02',
                'updated_at' => '2017-08-01 03:16:07',
                'deleted_at' => NULL,
            ),
            362 => 
            array (
                'id' => 1002362,
                'author_id' => 37,
                'quote_text' => 'Words are like planets, each with its own gravitational pull.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:16:08',
                'created_at' => '2017-08-01 03:15:32',
                'updated_at' => '2017-08-01 03:16:08',
                'deleted_at' => NULL,
            ),
            363 => 
            array (
                'id' => 1002363,
                'author_id' => 37,
                'quote_text' => 'A way of seeing is also a way of not seeing.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:16:09',
                'created_at' => '2017-08-01 03:14:54',
                'updated_at' => '2017-08-01 03:16:09',
                'deleted_at' => NULL,
            ),
            364 => 
            array (
                'id' => 1002364,
                'author_id' => 37,
                'quote_text' => 'Stories are equipment for living.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:16:11',
                'created_at' => '2017-08-01 03:14:45',
                'updated_at' => '2017-08-01 03:16:11',
                'deleted_at' => NULL,
            ),
            365 => 
            array (
                'id' => 1002365,
                'author_id' => 37,
                'quote_text' => 'Wherever there is persuasion, there is rhetoric, and wherever there is rhetoric, there is meaning.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:16:12',
                'created_at' => '2017-08-01 03:14:06',
                'updated_at' => '2017-08-01 03:16:12',
                'deleted_at' => NULL,
            ),
            366 => 
            array (
                'id' => 1002366,
                'author_id' => 37,
                'quote_text' => 'You persuade a man only insofar as you can talk his language by speech, gesture, tonality, order, image, attitude, idea, identifying your ways with his.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:16:13',
                'created_at' => '2017-08-01 03:13:46',
                'updated_at' => '2017-08-01 03:16:13',
                'deleted_at' => NULL,
            ),
            367 => 
            array (
                'id' => 1002367,
                'author_id' => 37,
                'quote_text' => 'Every question selects a field of battle.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:23:03',
                'created_at' => '2017-08-01 03:19:15',
                'updated_at' => '2017-08-01 03:23:03',
                'deleted_at' => NULL,
            ),
            368 => 
            array (
                'id' => 1002368,
                'author_id' => 37,
                'quote_text' => 'Language does our thinking for us.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:23:04',
                'created_at' => '2017-08-01 03:16:58',
                'updated_at' => '2017-08-01 03:23:04',
                'deleted_at' => NULL,
            ),
            369 => 
            array (
                'id' => 1002369,
                'author_id' => 202,
                'quote_text' => 'You can\'t argue with facts. You\'re not entitled to your own facts.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:20',
                'created_at' => '2017-08-01 03:46:16',
                'updated_at' => '2017-08-01 03:46:20',
                'deleted_at' => NULL,
            ),
            370 => 
            array (
                'id' => 1002370,
                'author_id' => 202,
                'quote_text' => 'You can’t dwell on problems too early, or they will swamp the virtues and you will decide not to do the project.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:21',
                'created_at' => '2017-08-01 03:43:33',
                'updated_at' => '2017-08-01 03:46:21',
                'deleted_at' => NULL,
            ),
            371 => 
            array (
                'id' => 1002371,
                'author_id' => 202,
                'quote_text' => 'The very best companies in the world are best not only because of their creativity, but because of their ability to implement.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:23',
                'created_at' => '2017-08-01 03:37:23',
                'updated_at' => '2017-08-01 03:46:23',
                'deleted_at' => NULL,
            ),
            372 => 
            array (
                'id' => 1002372,
                'author_id' => 202,
                'quote_text' => 'Every problem has a better solution when you start thinking about it differently than the normal way.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:24',
                'created_at' => '2017-08-01 03:33:39',
                'updated_at' => '2017-08-01 03:46:24',
                'deleted_at' => NULL,
            ),
            373 => 
            array (
                'id' => 1002373,
                'author_id' => 202,
                'quote_text' => 'Central tenets of the Hacker Ethic: the free flow of information, particularly information that helped fellow hackers understand, explore, and build systems.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:25',
                'created_at' => '2017-08-01 03:33:06',
                'updated_at' => '2017-08-01 03:46:25',
                'deleted_at' => NULL,
            ),
            374 => 
            array (
                'id' => 1002374,
                'author_id' => 202,
                'quote_text' => 'The problem is television? When you’re young, you look at television and think, There’s a conspiracy. The networks have conspired to dumb us down. But when you get a little older, you realize that’s not true. The networks are in business to give people exactly what they want. That’s a far more depressing thought.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:26',
                'created_at' => '2017-08-01 03:30:59',
                'updated_at' => '2017-08-01 03:46:26',
                'deleted_at' => NULL,
            ),
            375 => 
            array (
                'id' => 1002375,
                'author_id' => 202,
                'quote_text' => 'Design is a funny word. Some people think design means how it looks. But of course, if you dig deeper, it’s really how it works.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:28',
                'created_at' => '2017-08-01 03:30:14',
                'updated_at' => '2017-08-01 03:46:28',
                'deleted_at' => NULL,
            ),
            376 => 
            array (
                'id' => 1002376,
                'author_id' => 202,
                'quote_text' => 'Technological wizards generally fall into two categories: the Michelangelo types who dream of Sistine Chapels and then actually spend years building them, and the da Vincis, who have a million ideas but seldom finish anything themselves.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:29',
                'created_at' => '2017-08-01 03:29:19',
                'updated_at' => '2017-08-01 03:46:29',
                'deleted_at' => NULL,
            ),
            377 => 
            array (
                'id' => 1002377,
                'author_id' => 202,
                'quote_text' => 'It’s your life story if you’re a mathematician: every time you discover something neat, you discover that Gauss or Newton knew it in his crib.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:30',
                'created_at' => '2017-08-01 03:27:14',
                'updated_at' => '2017-08-01 03:46:30',
                'deleted_at' => NULL,
            ),
            378 => 
            array (
                'id' => 1002378,
                'author_id' => 202,
                'quote_text' => 'To hackers, a program was an organic entity that had a life independent from that of its author.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:32',
                'created_at' => '2017-08-01 03:26:20',
                'updated_at' => '2017-08-01 03:46:32',
                'deleted_at' => NULL,
            ),
            379 => 
            array (
                'id' => 1002379,
                'author_id' => 202,
                'quote_text' => 'Systems are organic, living creations: if people stop working on them and improving them, they die.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:46:33',
                'created_at' => '2017-08-01 03:25:53',
                'updated_at' => '2017-08-01 03:46:33',
                'deleted_at' => NULL,
            ),
            380 => 
            array (
                'id' => 1002380,
                'author_id' => 437,
                'quote_text' => 'Any sufficiently advanced technology is indistinguishable from magic.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:48:44',
                'created_at' => '2017-08-01 03:48:39',
                'updated_at' => '2017-08-01 03:48:44',
                'deleted_at' => NULL,
            ),
            381 => 
            array (
                'id' => 1002381,
                'author_id' => 437,
                'quote_text' => 'The only way to discover the limits of the possible is to go beyond them into the impossible.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:48:45',
                'created_at' => '2017-08-01 03:48:31',
                'updated_at' => '2017-08-01 03:48:45',
                'deleted_at' => NULL,
            ),
            382 => 
            array (
                'id' => 1002382,
                'author_id' => 437,
                'quote_text' => 'Politicians should read science fiction, not westerns and detective stories.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:48:46',
                'created_at' => '2017-08-01 03:48:23',
                'updated_at' => '2017-08-01 03:48:46',
                'deleted_at' => NULL,
            ),
            383 => 
            array (
                'id' => 1002383,
                'author_id' => 437,
                'quote_text' => 'This is the first age that\'s ever paid much attention to the future, which is a little ironic since we may not have one.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:51:42',
                'created_at' => '2017-08-01 03:51:38',
                'updated_at' => '2017-08-01 03:51:42',
                'deleted_at' => NULL,
            ),
            384 => 
            array (
                'id' => 1002384,
                'author_id' => 138,
                'quote_text' => 'A man, as a general rule, owes very little to what he is born with - a man is what he makes of himself.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:55:12',
                'created_at' => '2017-08-01 03:54:08',
                'updated_at' => '2017-08-01 03:55:12',
                'deleted_at' => NULL,
            ),
            385 => 
            array (
                'id' => 1002385,
                'author_id' => 138,
                'quote_text' => 'Before anything else, preparation is the key to success.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:55:13',
                'created_at' => '2017-08-01 03:53:25',
                'updated_at' => '2017-08-01 03:55:13',
                'deleted_at' => NULL,
            ),
            386 => 
            array (
                'id' => 1002386,
                'author_id' => 138,
                'quote_text' => 'Concentrate all your thoughts upon the work at hand. The sun\'s rays do not burn until brought to a focus.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:55:14',
                'created_at' => '2017-08-01 03:53:06',
                'updated_at' => '2017-08-01 03:55:14',
                'deleted_at' => NULL,
            ),
            387 => 
            array (
                'id' => 1002387,
                'author_id' => 138,
                'quote_text' => 'When one door closes another door opens; but we so often look so long and so regretfully upon the closed door, that we do not see the ones which open for us.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 03:55:15',
                'created_at' => '2017-08-01 03:52:54',
                'updated_at' => '2017-08-01 03:55:15',
                'deleted_at' => NULL,
            ),
            388 => 
            array (
                'id' => 1002388,
                'author_id' => 438,
                'quote_text' => 'I don\'t care that they stole my idea... I care that they don\'t have any of their own.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:00:59',
                'created_at' => '2017-08-01 04:00:22',
                'updated_at' => '2017-08-01 04:00:59',
                'deleted_at' => NULL,
            ),
            389 => 
            array (
                'id' => 1002389,
                'author_id' => 438,
                'quote_text' => 'Our virtues and our failings are inseparable, like force and matter. When they separate, man is no more.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:01:00',
                'created_at' => '2017-08-01 03:57:20',
                'updated_at' => '2017-08-01 04:01:00',
                'deleted_at' => NULL,
            ),
            390 => 
            array (
                'id' => 1002390,
                'author_id' => 438,
                'quote_text' => 'I do not think you can name many great inventions that have been made by married men.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:01:02',
                'created_at' => '2017-08-01 03:56:35',
                'updated_at' => '2017-08-01 04:01:02',
                'deleted_at' => NULL,
            ),
            391 => 
            array (
                'id' => 1002391,
                'author_id' => 438,
                'quote_text' => 'The present is theirs; the future, for which I really worked, is mine.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:01:03',
                'created_at' => '2017-08-01 03:56:25',
                'updated_at' => '2017-08-01 04:01:03',
                'deleted_at' => NULL,
            ),
            392 => 
            array (
                'id' => 1002392,
                'author_id' => 438,
                'quote_text' => 'One must be sane to think clearly, but one can think deeply and be quite insane.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:01:04',
                'created_at' => '2017-08-01 03:56:10',
                'updated_at' => '2017-08-01 04:01:04',
                'deleted_at' => NULL,
            ),
            393 => 
            array (
                'id' => 1002393,
                'author_id' => 438,
                'quote_text' => 'As I review the events of my past life I realize how subtle are the influences that shape our destinies.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:08:50',
                'created_at' => '2017-08-01 04:08:46',
                'updated_at' => '2017-08-01 04:08:50',
                'deleted_at' => NULL,
            ),
            394 => 
            array (
                'id' => 1002394,
                'author_id' => 438,
                'quote_text' => 'My method is different. I do not rush into actual work. When I get an idea I start at once building it up in my imagination. I change the construction, make improvements, and operate the device entirely in my mind.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:08:51',
                'created_at' => '2017-08-01 04:07:38',
                'updated_at' => '2017-08-01 04:08:51',
                'deleted_at' => NULL,
            ),
            395 => 
            array (
                'id' => 1002395,
                'author_id' => 438,
                'quote_text' => 'The scientific man does not aim at an immediate result. He does not expect that his advanced ideas will be readily taken up. His work is like that of the planter — for the future. His duty is to lay the foundation for those who are to come, and point the way. He lives and labors and hopes.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:08:53',
                'created_at' => '2017-08-01 04:05:15',
                'updated_at' => '2017-08-01 04:08:53',
                'deleted_at' => NULL,
            ),
            396 => 
            array (
                'id' => 1002396,
                'author_id' => 438,
                'quote_text' => 'Invention is the most important product of man\'s creative brain. The ultimate purpose is the complete mastery of mind over the material world, the harnessing of human nature to human needs.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:08:54',
                'created_at' => '2017-08-01 04:03:31',
                'updated_at' => '2017-08-01 04:08:54',
                'deleted_at' => NULL,
            ),
            397 => 
            array (
                'id' => 1002397,
                'author_id' => 438,
                'quote_text' => 'Be alone, that is the secret of invention; be alone, that is when ideas are born.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:08:55',
                'created_at' => '2017-08-01 04:01:22',
                'updated_at' => '2017-08-01 04:08:55',
                'deleted_at' => NULL,
            ),
            398 => 
            array (
                'id' => 1002398,
                'author_id' => 438,
                'quote_text' => 'Of all things, I liked books best.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:08:57',
                'created_at' => '2017-08-01 04:01:08',
                'updated_at' => '2017-08-01 04:08:57',
                'deleted_at' => NULL,
            ),
            399 => 
            array (
                'id' => 1002399,
                'author_id' => 140,
                'quote_text' => 'You must keep your mind on the objective, not on the obstacle.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:14:05',
                'created_at' => '2017-08-01 04:14:01',
                'updated_at' => '2017-08-01 04:14:05',
                'deleted_at' => NULL,
            ),
            400 => 
            array (
                'id' => 1002400,
                'author_id' => 140,
                'quote_text' => 'The distribution of wealth is just as important as its creation.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:14:07',
                'created_at' => '2017-08-01 04:13:33',
                'updated_at' => '2017-08-01 04:14:07',
                'deleted_at' => NULL,
            ),
            401 => 
            array (
                'id' => 1002401,
                'author_id' => 140,
                'quote_text' => 'Putting out a newspaper without promotion is like winking at a girl in the dark - well-intentioned, but ineffective.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:14:08',
                'created_at' => '2017-08-01 04:13:09',
                'updated_at' => '2017-08-01 04:14:08',
                'deleted_at' => NULL,
            ),
            402 => 
            array (
                'id' => 1002402,
                'author_id' => 140,
                'quote_text' => 'News is what people don\'t want you to print. Everything thing else is ads.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:14:09',
                'created_at' => '2017-08-01 04:11:38',
                'updated_at' => '2017-08-01 04:14:09',
                'deleted_at' => NULL,
            ),
            403 => 
            array (
                'id' => 1002403,
                'author_id' => 140,
                'quote_text' => 'You can crush a man with journalism.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:14:10',
                'created_at' => '2017-08-01 04:11:21',
                'updated_at' => '2017-08-01 04:14:10',
                'deleted_at' => NULL,
            ),
            404 => 
            array (
                'id' => 1002404,
                'author_id' => 140,
                'quote_text' => 'A politician will do anything to keep his job - even become a patriot.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
                'approved_at' => '2017-08-01 04:14:12',
                'created_at' => '2017-08-01 04:10:38',
                'updated_at' => '2017-08-01 04:14:12',
                'deleted_at' => NULL,
            ),
            405 => 
            array (
                'id' => 1002405,
                'author_id' => 140,
                'quote_text' => 'Truth is not only stranger than fiction, it is more interesting.',
                'created_by' => 1,
                'approved_by' => 1,
                'updated_by' => 1,
